(this["webpackJsonpgita-cards"]=this["webpackJsonpgita-cards"]||[]).push([[19],{105:function(n,t,a){"use strict";a.r(t);t.default=[{text:"\u0905\u0930\u094d\u091c\u0941\u0928 \u0909\u0935\u093e\u091a\n\u0915\u093f\u0902 \u0924\u0926\u094d\u092c\u094d\u0930\u0939\u094d\u092e \u0915\u093f\u092e\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u0902 \u0915\u093f\u0902 \u0915\u0930\u094d\u092e \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e\u0964\n\u0905\u0927\u093f\u092d\u0942\u0924\u0902 \u091a \u0915\u093f\u0902 \u092a\u094d\u0930\u094b\u0915\u094d\u0924\u092e\u0927\u093f\u0926\u0948\u0935\u0902 \u0915\u093f\u092e\u0941\u091a\u094d\u092f\u0924\u0947\u0964\u09648.1\u0964\u0964",translation:"\u0964\u09648.1, 8.2\u0964\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u094b\u0932\u0947, \u0939\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e ! \u0935\u0939 \u092c\u094d\u0930\u0939\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948? \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948? \u0915\u0930\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948? \u0905\u0927\u093f\u092d\u0942\u0924 \u0915\u093f\u0938\u0915\u094b \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948? \u0914\u0930 \u0905\u0927\u093f\u0926\u0948\u0935 \u0915\u093f\u0938\u0915\u094b \u0915\u0939\u093e \u091c\u093e\u0924\u093e \u0939\u0948? \u092f\u0939\u093e\u0901 \u0905\u0927\u093f\u092f\u091c\u094d\u091e \u0915\u094c\u0928 \u0939\u0948 \u0914\u0930 \u0935\u0939 \u0907\u0938 \u0926\u0947\u0939\u092e\u0947\u0902 \u0915\u0948\u0938\u0947 \u0939\u0948? \u0939\u0947 \u092e\u0927\u0942\u0938\u0942\u0926\u0928 ! \u0928\u093f\u092f\u0924\u093e\u0924\u094d\u092e\u093e (\u0935\u0936\u0940\u092d\u0942\u0924 \u0905\u0902\u0924\u0903\u0915\u0930\u0923 \u0935\u093e\u0932\u0947) \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0906\u092a \u0915\u0948\u0938\u0947 \u091c\u093e\u0928\u0928\u0947\u092e\u0947\u0902 \u0906\u0924\u0947 \u0939\u0948\u0902?",commentary:"\u0964\u09648.1\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0915\u093f\u0902 \u0924\u0926\u094d\u092c\u094d\u0930\u0939\u094d\u092e', \u0939\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0935\u0939 \u092c\u094d\u0930\u0939\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0936\u092c\u094d\u0926\u0938\u0947 \u0915\u094d\u092f\u093e \u0938\u092e\u091d\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947'"},{text:"\u0905\u0927\u093f\u092f\u091c\u094d\u091e\u0903 \u0915\u0925\u0902 \u0915\u094b\u093d\u0924\u094d\u0930 \u0926\u0947\u0939\u0947\u093d\u0938\u094d\u092e\u093f\u0928\u094d\u092e\u0927\u0941\u0938\u0942\u0926\u0928\u0964\n\u092a\u094d\u0930\u092f\u093e\u0923\u0915\u093e\u0932\u0947 \u091a \u0915\u0925\u0902 \u091c\u094d\u091e\u0947\u092f\u094b\u093d\u0938\u093f \u0928\u093f\u092f\u0924\u093e\u0924\u094d\u092e\u092d\u093f\u0903\u0964\u09648.2\u0964\u0964",translation:"\u0964\u09648.1, 8.2\u0964\u0964 \u0905\u0930\u094d\u091c\u0941\u0928 \u092c\u094b\u0932\u0947, \u0939\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e ! \u0935\u0939 \u092c\u094d\u0930\u0939\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948? \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948? \u0915\u0930\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948? \u0905\u0927\u093f\u092d\u0942\u0924 \u0915\u093f\u0938\u0915\u094b \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948? \u0914\u0930 \u0905\u0927\u093f\u0926\u0948\u0935 \u0915\u093f\u0938\u0915\u094b \u0915\u0939\u093e \u091c\u093e\u0924\u093e \u0939\u0948? \u092f\u0939\u093e\u0901 \u0905\u0927\u093f\u092f\u091c\u094d\u091e \u0915\u094c\u0928 \u0939\u0948 \u0914\u0930 \u0935\u0939 \u0907\u0938 \u0926\u0947\u0939\u092e\u0947\u0902 \u0915\u0948\u0938\u0947 \u0939\u0948? \u0939\u0947 \u092e\u0927\u0942\u0938\u0942\u0926\u0928 ! \u0928\u093f\u092f\u0924\u093e\u0924\u094d\u092e\u093e (\u0935\u0936\u0940\u092d\u0942\u0924 \u0905\u0928\u094d\u0924\u0903\u0915\u0930\u0923\u0935\u093e\u0932\u0947) \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0906\u092a \u0915\u0948\u0938\u0947 \u091c\u093e\u0928\u0928\u0947\u092e\u0947\u0902 \u0906\u0924\u0947 \u0939\u0948\u0902?",commentary:"\u0964\u09648.2\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0915\u093f\u0902 \u0924\u0926\u094d\u092c\u094d\u0930\u0939\u094d\u092e',\u0939\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0924\u094d\u0924\u092e \u0935\u0939 \u092c\u094d\u0930\u0939\u094d\u092e \u0915\u094d\u092f\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e \u0936\u092c\u094d\u0926\u0938\u0947 \u0915\u094d\u092f\u093e \u0938\u092e\u091d\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947"},{text:"\u0936\u094d\u0930\u0940 \u092d\u0917\u0935\u093e\u0928\u0941\u0935\u093e\u091a\n\u0905\u0915\u094d\u0937\u0930\u0902 \u092c\u094d\u0930\u0939\u094d\u092e \u092a\u0930\u092e\u0902 \u0938\u094d\u0935\u092d\u093e\u0935\u094b\u093d\u0927\u094d\u092f\u093e\u0924\u094d\u092e\u092e\u0941\u091a\u094d\u092f\u0924\u0947\u0964\n\u092d\u0942\u0924\u092d\u093e\u0935\u094b\u0926\u094d\u092d\u0935\u0915\u0930\u094b \u0935\u093f\u0938\u0930\u094d\u0917\u0903 \u0915\u0930\u094d\u092e\u0938\u0902\u091c\u094d\u091e\u093f\u0924\u0903\u0964\u09648.3\u0964\u0964",translation:"\u0964\u09648.3\u0964\u0964 \u0936\u094d\u0930\u0940\u092d\u0917\u0935\u093e\u0928\u094d \u092c\u094b\u0932\u0947, \u092a\u0930\u092e \u0905\u0915\u094d\u0937\u0930 \u092c\u094d\u0930\u0939\u094d\u092e \u0939\u0948 \u0914\u0930 \u091c\u0940\u0935\u0915\u093e \u0905\u092a\u0928\u093e \u091c\u094b \u0939\u094b\u0928\u093e\u092a\u0928 \u0939\u0948, \u0909\u0938\u0915\u094b \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902 \u0915\u093e \u0909\u0926\u094d\u092d\u0935 (\u0938\u0924\u094d\u0924\u093e \u0915\u094b \u092a\u094d\u0930\u0915\u091f) \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u093e \u091c\u094b \u0924\u094d\u092f\u093e\u0917 \u0939\u0948 \u0909\u0938\u0915\u094b \u0915\u0930\u094d\u092e \u0915\u0939\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.3\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0905\u0915\u094d\u0937\u0930\u0902 \u092c\u094d\u0930\u0939\u094d\u092e \u092a\u0930\u092e\u092e\u094d',\u092a\u0930\u092e \u0905\u0915\u094d\u0937\u0930\u0915\u093e \u0928\u093e\u092e \u092c\u094d\u0930\u0939\u094d\u092e \u0939\u0948\u0964 \u092f\u0926\u094d\u092f\u092a\u093f \u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u092c\u094d\u0930\u0939\u094d\u092e \u0936\u092c\u094d\u0926 \u092a\u094d\u0930\u0923\u0935 \u0935\u0947\u0926 \u092a\u094d\u0930\u0915\u0943\u0924\u093f \u0906\u0926\u093f \u0915\u093e \u0935\u093e\u091a\u0915 \u092d\u0940 \u0906\u092f\u093e \u0939\u0948 \u0924\u0925\u093e\u092a\u093f \u092f\u0939\u093e\u0901 \u092c\u094d\u0930\u0939\u094d\u092e \u0936\u092c\u094d\u0926\u0915\u0947 \u0938\u093e\u0925 \u092a\u0930\u092e \u0914\u0930 \u0905\u0915\u094d\u0937\u0930 \u0935\u093f\u0936\u0947\u0937\u0923 \u0926\u0947\u0928\u0947\u0938\u0947 \u092f\u0939 \u0936\u092c\u094d\u0926 \u0938\u0930\u094d\u0935\u094b\u092a\u0930\u093f \u0938\u091a\u094d\u091a\u093f\u0926\u093e\u0928\u0928\u094d\u0926\u0918\u0928 \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0935\u093e\u091a\u0915 \u0939\u0948\u0964"},{text:"\u0905\u0927\u093f\u092d\u0942\u0924\u0902 \u0915\u094d\u0937\u0930\u094b \u092d\u093e\u0935\u0903 \u092a\u0941\u0930\u0941\u0937\u0936\u094d\u091a\u093e\u0927\u093f\u0926\u0948\u0935\u0924\u092e\u094d\u0964\n\u0905\u0927\u093f\u092f\u091c\u094d\u091e\u094b\u093d\u0939\u092e\u0947\u0935\u093e\u0924\u094d\u0930 \u0926\u0947\u0939\u0947 \u0926\u0947\u0939\u092d\u0943\u0924\u093e\u0902 \u0935\u0930\u0964\u09648.4\u0964\u0964",translation:"\u0964\u09648.4\u0964\u0964 \u0939\u0947 \u0926\u0947\u0939\u0927\u093e\u0930\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u0915\u094d\u0937\u0930\u092d\u093e\u0935 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0928\u093e\u0936\u0935\u093e\u0928\u094d \u092a\u0926\u093e\u0930\u094d\u0925\u0915\u094b \u0905\u0927\u093f\u092d\u0942\u0924 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902, \u092a\u0941\u0930\u0941\u0937 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0939\u093f\u0930\u0923\u094d\u092f\u0917\u0930\u094d\u092d \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940 \u0905\u0927\u093f\u0926\u0948\u0935 \u0939\u0948\u0902 \u0914\u0930 \u0907\u0938 \u0926\u0947\u0939\u092e\u0947\u0902 \u0905\u0928\u094d\u0924\u0930\u094d\u092f\u093e\u092e\u0940\u0930\u0942\u092a\u0938\u0947 \u092e\u0948\u0902 \u0939\u0940 \u0905\u0927\u093f\u092f\u091c\u094d\u091e \u0939\u0942\u0901\u0964 ",commentary:"\u0964\u09648.4\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0905\u0927\u093f\u092d\u0942\u0924\u0902 \u0915\u094d\u0937\u0930\u094b \u092d\u093e\u0935\u0903',\u092a\u0943\u0925\u094d\u0935\u0940 \u091c\u0932 \u0924\u0947\u091c \u0935\u093e\u092f\u0941 \u0914\u0930 \u0906\u0915\u093e\u0936, \u0907\u0928 \u092a\u091e\u094d\u091a\u092e\u0939\u093e\u092d\u0942\u0924\u094b\u0902\u0938\u0947 \u092c\u0928\u0940 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0937\u0923 \u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0928\u0936\u0940\u0932 \u0914\u0930 \u0928\u093e\u0936\u0935\u093e\u0928\u094d \u0938\u0943\u0937\u094d\u091f\u093f\u0915\u094b \u0905\u0927\u093f\u092d\u0942\u0924 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964'\u092a\u0941\u0930\u0941\u0937\u0936\u094d\u091a\u093e\u0927\u093f\u0926\u0948\u0935\u0924\u092e\u094d', \u092f\u0939\u093e\u0901 '\u0905\u0927\u093f\u0926\u0948\u0935\u0924' (\u0905\u0927\u093f\u0926\u0948\u0935) \u092a\u0926 \u0906\u0926\u093f\u092a\u0941\u0930\u0941\u0937 \u0939\u093f\u0930\u0923\u094d\u092f\u0917\u0930\u094d\u092d \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0915\u093e \u0935\u093e\u091a\u0915 \u0939\u0948\u0964 \u092e\u0939\u093e\u0938\u0930\u094d\u0917\u0915\u0947 \u0906\u0926\u093f \u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u0902\u0915\u0932\u094d\u092a\u0938\u0947 \u0938\u092c\u0938\u0947 \u092a\u0939\u0932\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940 \u0939\u0940 \u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092b\u093f\u0930 \u0935\u0947 \u0939\u0940 \u0938\u0930\u094d\u0917\u0915\u0947 \u0906\u0926\u093f \u092e\u0947\u0902 \u0938\u092c \u0938\u0943\u0937\u094d\u091f\u093f\u0915\u0940 \u0930\u091a\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964\n'\u0905\u0927\u093f\u092f\u091c\u094d\u091e\u094b\u093d\u0939\u092e\u0947\u0935\u093e\u0924\u094d\u0930 \u0926\u0947\u0939\u0947 \u0926\u0947\u0939\u092d\u0943\u0924\u093e\u0902 \u0935\u0930',\u0939\u0947 \u0926\u0947\u0939\u0927\u093e\u0930\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0905\u0930\u094d\u091c\u0941\u0928 \u0907\u0938 \u0926\u0947\u0939\u092e\u0947\u0902 \u0905\u0927\u093f\u092f\u091c\u094d\u091e \u092e\u0948\u0902 \u0939\u0940 \u0939\u0942\u0901 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0907\u0938 \u092e\u0928\u0941\u0937\u094d\u092f\u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u0905\u0928\u094d\u0924\u0930\u094d\u092f\u093e\u092e\u0940\u0930\u0942\u092a\u0938\u0947 \u092e\u0948\u0902 \u0939\u0940 \u0939\u0942\u0901\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0917\u0940\u0924\u093e\u092e\u0947\u0902 '\u0939\u0943\u0926\u093f \u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0935\u093f\u0937\u094d\u0920\u093f\u0924\u092e\u094d' (13\u0964 17) '\u0938\u0930\u094d\u0935\u0938\u094d\u092f \u091a\u093e\u0939\u0902 \u0939\u0943\u0926\u093f \u0938\u0902\u0928\u093f\u0935\u093f\u0937\u094d\u091f\u0903' (15\u0964 15) '\u0908\u0936\u094d\u0935\u0930\u0903 \u0938\u0930\u094d\u0935\u092d\u0942\u0924\u093e\u0928\u093e\u0902 \u0939\u0943\u0926\u094d\u0926\u0947\u0936\u0947\u093d\u0930\u094d\u091c\u0941\u0928 \u0924\u093f\u0937\u094d\u0920\u0924\u093f' (18\u0964 61) \u0906\u0926\u093f \u092e\u0947\u0902 \u0905\u092a\u0928\u0947\u0915\u094b \u0905\u0928\u094d\u0924\u0930\u094d\u092f\u093e\u092e\u0940\u0930\u0942\u092a\u0938\u0947 \u0938\u092c\u0915\u0947 \u0939\u0943\u0926\u092f \u092e\u0947\u0902 \u0935\u093f\u0930\u093e\u091c\u092e\u093e\u0928 \u092c\u0924\u093e\u092f\u093e \u0939\u0948\u0964\n'\u0905\u0939\u092e\u0947\u0935 \u0905\u0924\u094d\u0930  \u0926\u0947\u0939\u0947'\u0915\u0939\u0928\u0947 \u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0926\u0942\u0938\u0930\u0940 \u092f\u094b\u0928\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0924\u094b \u092a\u0942\u0930\u094d\u0935\u0915\u0943\u0924 \u0915\u0930\u094d\u092e\u094b\u0902\u0915\u093e \u092d\u094b\u0917 \u0939\u094b\u0924\u093e \u0939\u0948 \u0928\u092f\u0947 \u0915\u0930\u094d\u092e \u0928\u0939\u0940\u0902 \u092c\u0928\u0924\u0947 \u092a\u0930 \u0907\u0938 \u092e\u0928\u0941\u0937\u094d\u092f\u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u0928\u092f\u0947 \u0915\u0930\u094d\u092e \u092d\u0940 \u092c\u0928\u0924\u0947 \u0939\u0948\u0902\u0964 \u0909\u0928 \u0915\u0930\u094d\u092e\u094b\u0902\u0915\u0947 \u092a\u094d\u0930\u0947\u0930\u0915 \u0905\u0928\u094d\u0924\u0930\u094d\u092f\u093e\u092e\u0940 \u092d\u0917\u0935\u093e\u0928\u094d \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u091c\u0939\u093e\u0901 \u092e\u0928\u0941\u0937\u094d\u092f \u0930\u093e\u0917\u0926\u094d\u0935\u0947\u0937 \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093e \u0909\u0938\u0915\u0947 \u0938\u092c \u0915\u0930\u094d\u092e \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092a\u094d\u0930\u0947\u0930\u0923\u093e\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0936\u0941\u0926\u094d\u0927 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092c\u0928\u094d\u0927\u0928\u0915\u093e\u0930\u0915 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u0947 \u0914\u0930 \u091c\u0939\u093e\u0901 \u0935\u0939 \u0930\u093e\u0917\u0926\u094d\u0935\u0947\u0937\u0915\u0947 \u0915\u093e\u0930\u0923 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092a\u094d\u0930\u0947\u0930\u0923\u093e\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0915\u0930\u094d\u092e \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u093e \u0909\u0938\u0915\u0947 \u0915\u0930\u094d\u092e \u092c\u0928\u094d\u0927\u0928\u0915\u093e\u0930\u0915 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0930\u093e\u0917 \u0914\u0930 \u0926\u094d\u0935\u0947\u0937 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u0947 \u092e\u0939\u093e\u0928\u094d \u0936\u0924\u094d\u0930\u0941 \u0939\u0948\u0902 (\u0917\u0940\u0924\u093e 3\u0964 34)\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092a\u094d\u0930\u0947\u0930\u0923\u093e\u0938\u0947 \u0915\u092d\u0940 \u0928\u093f\u0937\u093f\u0926\u094d\u0927\u0915\u0930\u094d\u092e \u0939\u094b\u0924\u0947 \u0939\u0940 \u0928\u0939\u0940\u0902\u0964 \u0936\u094d\u0930\u0941\u0924\u093f \u0914\u0930 \u0938\u094d\u092e\u0943\u0924\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0906\u091c\u094d\u091e\u093e \u0939\u0948, '\u0936\u094d\u0930\u0941\u0924\u093f\u0938\u094d\u092e\u0943\u0924\u0940 \u092e\u092e\u0948\u0935\u093e\u091c\u094d\u091e\u0947\u0964' \u0905\u0924\u0903 \u092d\u0917\u0935\u093e\u0928\u094d \u0936\u094d\u0930\u0941\u0924\u093f \u0914\u0930 \u0938\u094d\u092e\u0943\u0924\u093f\u0915\u0947 \u0935\u093f\u0930\u0941\u0926\u094d\u0927 \u092a\u094d\u0930\u0947\u0930\u0923\u093e \u0915\u0948\u0938\u0947 \u0915\u0930 \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u0947\u0964 \u0928\u093f\u0937\u093f\u0926\u094d\u0927\u0915\u0930\u094d\u092e \u0924\u094b \u092e\u0928\u0941\u0937\u094d\u092f \u0915\u093e\u092e\u0928\u093e\u0915\u0947 \u0935\u0936\u0940\u092d\u0942\u0924 \u0939\u094b\u0915\u0930 \u0939\u0940 \u0915\u0930\u0924\u093e \u0939\u0948 (\u0917\u0940\u0924\u093e 3\u0964 37)\u0964 \u0905\u0917\u0930 \u092e\u0928\u0941\u0937\u094d\u092f \u0915\u093e\u092e\u0928\u093e\u0915\u0947 \u0935\u0936\u0940\u092d\u0942\u0924 \u0928 \u0939\u094b \u0924\u094b \u0909\u0938\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0939\u0940 \u0935\u093f\u0939\u093f\u0924 \u0915\u0930\u094d\u092e \u0939\u094b\u0902\u0917\u0947 \u091c\u093f\u0928\u0915\u094b \u0905\u0920\u093e\u0930\u0939\u0935\u0947\u0902 \u0938\u0939\u091c,\u0938\u094d\u0935\u092d\u093e\u0935\u0928\u093f\u092f\u0924 \u0915\u0930\u094d\u092e \u0928\u093e\u092e\u0938\u0947 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964\u092f\u0939\u093e\u0901 \u0905\u0930\u094d\u091c\u0941\u0928 \u0915\u0947 \u0932\u093f\u092f\u0947 '\u0926\u0947\u0939\u092d\u0943\u0924\u093e\u0902 \u0935\u0930' \u0915\u0939\u0928\u0947 \u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0926\u0947\u0939\u0927\u093e\u0930\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0935\u0939\u0940 \u092e\u0928\u0941\u0937\u094d\u092f \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u0948 \u091c\u094b \u0907\u0938 \u0926\u0947\u0939\u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0948\u0902, \u0910\u0938\u093e \u091c\u093e\u0928 \u0932\u0947\u0924\u093e \u0939\u0948\u0964 \u0910\u0938\u093e \u091c\u094d\u091e\u093e\u0928 \u0928 \u0939\u094b \u0924\u094b \u092d\u0940 \u0910\u0938\u093e \u092e\u093e\u0928 \u0932\u0947 \u0915\u093f \u0938\u094d\u0925\u0942\u0932 \u0938\u0942\u0915\u094d\u0937\u094d\u092e \u0914\u0930 \u0915\u093e\u0930\u0923\u0936\u0930\u0940\u0930\u0915\u0947 \u0915\u0923\u0915\u0923\u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0948\u0902 \u0914\u0930 \u0909\u0928\u0915\u093e \u0905\u0928\u0941\u092d\u0935 \u0915\u0930\u0928\u093e \u0939\u0940 \u092e\u0928\u0941\u0937\u094d\u092f\u091c\u0928\u094d\u092e\u0915\u093e \u0916\u093e\u0938 \u0927\u094d\u092f\u0947\u092f \u0939\u0948\u0964 \u0907\u0938 \u0927\u094d\u092f\u0947\u092f\u0915\u0940 \u0938\u093f\u0926\u094d\u0927\u093f\u0915\u0947 \u0932\u093f\u092f\u0947 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u0906\u091c\u094d\u091e\u093e\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0939\u0940 \u0915\u093e\u092e \u0915\u0930\u0928\u093e \u0939\u0948\u0964\u0924\u0940\u0938\u0930\u0947 \u0914\u0930 \u091a\u094c\u0925\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u094b \u092c\u094d\u0930\u0939\u094d\u092e \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0915\u0930\u094d\u092e \u0905\u0927\u093f\u092d\u0942\u0924 \u0905\u0927\u093f\u0926\u0948\u0935 \u0914\u0930 \u0905\u0927\u093f\u092f\u091c\u094d\u091e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0939\u0948 \u0909\u0938\u0947 \u0938\u092e\u091d\u0928\u0947\u092e\u093e\u0924\u094d\u0930\u0915\u0947 \u0932\u093f\u092f\u0947 \u091c\u0932\u0915\u093e \u090f\u0915 \u0926\u0943\u0937\u094d\u091f\u093e\u0928\u094d\u0924 \u0926\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u091c\u0948\u0938\u0947 \u091c\u092c \u0906\u0915\u093e\u0936 \u0938\u094d\u0935\u091a\u094d\u091b \u0939\u094b\u0924\u093e \u0939\u0948 \u0924\u092c \u0939\u092e\u093e\u0930\u0947 \u0914\u0930 \u0938\u0942\u0930\u094d\u092f \u0915\u0947 \u092e\u0927\u094d\u092f \u092e\u0947\u0902 \u0915\u094b\u0908 \u092a\u0926\u093e\u0930\u094d\u0925 \u0928 \u0926\u0940\u0916\u0928\u0947\u092a\u0930 \u092d\u0940 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0935\u0939\u093e\u0901 \u092a\u0930\u092e\u093e\u0923\u0941\u0930\u0942\u092a\u0938\u0947 \u091c\u0932\u0924\u0924\u094d\u0924\u094d\u0935 \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u0935\u0939\u0940 \u091c\u0932\u0924\u0924\u094d\u0924\u094d\u0935 \u092d\u093e\u092a \u092c\u0928\u0924\u093e \u0939\u0948 \u0914\u0930 \u092d\u093e\u092a\u0915\u0947 \u0918\u0928\u0940\u092d\u0942\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092c\u093e\u0926\u0932 \u092c\u0928\u0924\u093e \u0939\u0948\u0964 \u092c\u093e\u0926\u0932\u092e\u0947\u0902 \u091c\u094b \u091c\u0932\u0915\u0923 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902 \u0909\u0928\u0915\u0947 \u092e\u093f\u0932\u0928\u0947\u0938\u0947 \u092c\u0942\u0901\u0926\u0947\u0902 \u092c\u0928 \u091c\u093e\u0924\u0940 \u0939\u0948\u0902\u0964 \u0909\u0928 \u092c\u0942\u0901\u0926\u094b\u0902\u092e\u0947\u0902 \u091c\u092c \u0920\u0923\u094d\u0921\u0915\u0915\u0947 \u0938\u0902\u092f\u094b\u0917\u0938\u0947 \u0918\u0928\u0924\u093e \u0906 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0924\u092c \u0935\u0947 \u0939\u0940 \u092c\u0942\u0901\u0926\u0947\u0902 \u0913\u0932\u0947 (\u092c\u0930\u094d\u092b) \u092c\u0928 \u091c\u093e\u0924\u0940 \u0939\u0948\u0902, \u092f\u0939 \u091c\u0932\u0924\u0924\u094d\u0924\u094d\u0935\u0915\u093e \u092c\u0939\u0941\u0924 \u0938\u094d\u0925\u0942\u0932 \u0930\u0942\u092a \u0939\u0941\u0906\u0964 \u0910\u0938\u0947 \u0939\u0940 \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092c\u094d\u0930\u0939\u094d\u092e \u092a\u0930\u092e\u093e\u0923\u0941\u0930\u0942\u092a\u0938\u0947 \u091c\u0932\u0924\u0924\u094d\u0924\u094d\u0935 \u0939\u0948 \u0905\u0927\u093f\u092f\u091c\u094d\u091e (\u0935\u094d\u092f\u093e\u092a\u0915 \u0935\u093f\u0937\u094d\u0923\u0941) \u092d\u093e\u092a\u0930\u0942\u092a\u0938\u0947 \u091c\u0932 \u0939\u0948 \u0905\u0927\u093f\u0926\u0948\u0935 (\u0939\u093f\u0930\u0923\u094d\u092f\u0917\u0930\u094d\u092d \u092c\u094d\u0930\u0939\u094d\u092e\u093e) \u092c\u093e\u0926\u0932\u0930\u0942\u092a\u0938\u0947 \u091c\u0932 \u0939\u0948 \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e (\u0905\u0928\u0928\u094d\u0924 \u091c\u0940\u0935) \u092c\u0942\u0901\u0926\u0947\u0902\u0930\u0942\u092a\u0938\u0947 \u091c\u0932 \u0939\u0948 \u0915\u0930\u094d\u092e (\u0938\u0943\u0937\u094d\u091f\u093f\u0930\u091a\u0928\u093e\u0930\u0942\u092a \u0915\u0930\u094d\u092e) \u0935\u0930\u094d\u0937\u093e\u0915\u0940 \u0915\u094d\u0930\u093f\u092f\u093e \u0939\u0948 \u0914\u0930,\u0905\u0927\u093f\u092d\u0942\u0924 (\u092d\u094c\u0924\u093f\u0915 \u0938\u0943\u0937\u094d\u091f\u093f\u092e\u093e\u0924\u094d\u0930) \u092c\u0930\u094d\u092b\u0930\u0942\u092a\u0938\u0947 \u091c\u0932 \u0939\u0948\u0964\n\u0907\u0938 \u0935\u0930\u094d\u0923\u0928\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u091c\u0948\u0938\u0947 \u090f\u0915 \u0939\u0940 \u091c\u0932 \u092a\u0930\u092e\u093e\u0923\u0941 \u092d\u093e\u092a \u092c\u093e\u0926\u0932 \u0935\u0930\u094d\u0937\u093e\u0915\u0940 \u0915\u094d\u0930\u093f\u092f\u093e \u092c\u0942\u0901\u0926\u0947\u0902 \u0914\u0930 \u0913\u0932\u0947(\u092c\u0930\u094d\u092b) \u0915\u0947 \u0930\u0942\u092a\u0938\u0947 \u092d\u093f\u0928\u094d\u0928\u092d\u093f\u0928\u094d\u0928 \u0926\u0940\u0916\u0924\u093e \u0939\u0948 \u092a\u0930 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0939\u0948 \u090f\u0915 \u0939\u0940\u0964 \u0907\u0938\u0940 \u092a\u094d\u0930\u0915\u093e\u0930 \u090f\u0915 \u0939\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935 \u092c\u094d\u0930\u0939\u094d\u092e \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e \u0915\u0930\u094d\u092e \u0905\u0927\u093f\u092d\u0942\u0924 \u0905\u0927\u093f\u0926\u0948\u0935 \u0914\u0930 \u0905\u0927\u093f\u092f\u091c\u094d\u091e\u0915\u0947 \u0930\u0942\u092a\u0938\u0947 \u092d\u093f\u0928\u094d\u0928\u092d\u093f\u0928\u094d\u0928 \u092a\u094d\u0930\u0924\u0940\u0924 \u0939\u094b\u0924\u0947 \u0939\u0941\u090f \u092d\u0940 \u0924\u0924\u094d\u0924\u094d\u0935\u0924\u0903 \u090f\u0915 \u0939\u0940 \u0939\u0948\u0964 \u0907\u0938\u0940\u0915\u094b \u0938\u093e\u0924\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u092e\u0947\u0902 '\u0938\u092e\u0917\u094d\u0930\u092e\u094d' (7\u0964 1) \u0914\u0930 '\u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0903 \u0938\u0930\u094d\u0935\u092e\u094d' (7\u0964 19) \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964\n\u0924\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u0924\u094b \u0938\u092c \u0915\u0941\u091b \u0935\u093e\u0938\u0941\u0926\u0947\u0935 \u0939\u0940 \u0939\u0948 (7\u0964 19)\u0964 \u0907\u0938\u092e\u0947\u0902 \u092d\u0940 \u091c\u092c \u0935\u093f\u0935\u0947\u0915\u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u0926\u0947\u0916\u0924\u0947 \u0939\u0948\u0902 \u0924\u092c \u0936\u0930\u0940\u0930\u0936\u0930\u0940\u0930\u0940 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092a\u0941\u0930\u0941\u0937, \u0910\u0938\u0947 \u0926\u094b \u092d\u0947\u0926 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0909\u092a\u093e\u0938\u0928\u093e\u0915\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u0926\u0947\u0916\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b \u0909\u092a\u093e\u0938\u094d\u092f (\u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e) \u0909\u092a\u093e\u0938\u0915 (\u091c\u0940\u0935) \u0914\u0930 \u0924\u094d\u092f\u093e\u091c\u094d\u092f (\u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0915\u093e \u0915\u093e\u0930\u094d\u092f, \u0938\u0902\u0938\u093e\u0930), \u092f\u0947 \u0924\u0940\u0928 \u092d\u0947\u0926 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0928 \u0924\u0940\u0928\u094b\u0902\u0915\u094b \u0938\u092e\u091d\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0939\u093e\u0901 \u0907\u0928 \u0915\u0947 \u091b\u0903 \u092d\u0947\u0926 \u0915\u093f\u092f\u0947 \u0917\u092f\u0947 \u0939\u0948\u0902, \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0947 \u0926\u094b \u092d\u0947\u0926, \u092c\u094d\u0930\u0939\u094d\u092e (\u0928\u093f\u0930\u094d\u0917\u0941\u0923) \u0914\u0930 \u0905\u0927\u093f\u092f\u091c\u094d\u091e (\u0938\u0917\u0941\u0923)\u0964\u091c\u0940\u0935\u0915\u0947 \u0926\u094b \u092d\u0947\u0926, \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e (\u0938\u093e\u092e\u093e\u0928\u094d\u092f \u091c\u0940\u0935 \u091c\u094b \u0915\u093f \u092c\u0926\u094d\u0927 \u0939\u0948\u0902) \u0914\u0930 \u0905\u0927\u093f\u0926\u0948\u0935 (\u0915\u093e\u0930\u0915 \u092a\u0941\u0930\u0941\u0937 \u091c\u094b \u0915\u093f \u092e\u0941\u0915\u094d\u0924 \u0939\u0948\u0902)\u0964\u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u0926\u094b \u092d\u0947\u0926, \u0915\u0930\u094d\u092e (\u091c\u094b \u0915\u093f \u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0928\u0915\u093e \u092a\u0941\u091e\u094d\u091c \u0939\u0948) \u0914\u0930 \u0905\u0927\u093f\u092d\u0942\u0924 (\u091c\u094b \u0915\u093f \u092a\u0926\u093e\u0930\u094d\u0925 \u0939\u0948\u0902)\u0964\n1. \u092c\u094d\u0930\u0939\u094d\u092e\n2. \u0905\u0927\u094d\u092f\u093e\u0924\u094d\u092e\n3. \u0915\u0930\u094d\u092e\n4. \u0905\u0927\u093f\u092d\u0942\u0924\n5. \u0905\u0927\u093f\u0926\u0948\u0935\n6. \u0905\u0927\u093f\u092f\u091c\u094d\u091e\n\u0935\u093f\u0936\u0947\u0937 \u092c\u093e\u0924\n(1)\u0938\u092c \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0935\u094d\u092f\u093e\u092a\u094d\u0924 \u0939\u0948\u0902,'\u092e\u092f\u093e \u0924\u0924\u092e\u093f\u0926\u0902 \u0938\u0930\u094d\u0935\u092e\u094d' (9\u0964 4) '\u092f\u0947\u0928 \u0938\u0930\u094d\u0935\u092e\u093f\u0926\u0902 \u0924\u0924\u092e\u094d' (18\u0964 46) \u0938\u092c \u0938\u0902\u0938\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u0939\u0948, '\u092e\u092f\u093f \u0938\u0930\u094d\u0935\u092e\u093f\u0926\u0902 \u092a\u094d\u0930\u094b\u0924\u092e\u094d' (7\u0964 7) \u0938\u092c \u0915\u0941\u091b \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902,'\u0935\u093e\u0938\u0941\u0926\u0947\u0935\u0903 \u0938\u0930\u094d\u0935\u092e\u094d' (7\u0964 19) \u0938\u092c \u0938\u0902\u0938\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0939\u0948,'\u0905\u0939\u0902 \u0939\u093f \u0938\u0930\u094d\u0935\u092f\u091c\u094d\u091e\u093e\u0928\u093e\u0902 \u092d\u094b\u0915\u094d\u0924\u093e \u091a \u092a\u094d\u0930\u092d\u0941\u0930\u0947\u0935 \u091a' (9\u0964 24) '\u092d\u094b\u0915\u094d\u0924\u093e\u0930\u0902 \u092f\u091c\u094d\u091e\u0924\u092a\u0938\u093e\u0902 \u0938\u0930\u094d\u0935\u0932\u094b\u0915\u092e\u0939\u0947\u0936\u094d\u0935\u0930\u092e\u094d' (5\u0964 29), \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0924\u0930\u0939\u0924\u0930\u0939\u0915\u0947 \u0935\u091a\u0928 \u0906\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0928 \u0938\u092c\u0915\u093e \u0938\u093e\u092e\u091e\u094d\u091c\u0938\u094d\u092f \u0915\u0948\u0938\u0947 \u0939\u094b \u0938\u092c\u0915\u0940 \u0938\u0902\u0917\u0924\u093f \u0915\u0948\u0938\u0947 \u092c\u0948\u0920\u0947 \u0907\u0938\u092a\u0930 \u0935\u093f\u091a\u093e\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964\n\u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u0947 \u0932\u093f\u092f\u0947 \u0905\u092a\u0928\u0947 \u0915\u0932\u094d\u092f\u093e\u0923\u0915\u0947 \u0932\u093f\u092f\u0947 \u0938\u093e\u0927\u0928\u093e \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0947 \u091c\u093f\u0924\u0928\u0947 \u092d\u0940 \u0938\u093e\u0927\u0915  \u0939\u0948\u0902 \u0935\u0947 \u0938\u092d\u0940 \u0938\u0902\u0938\u093e\u0930\u0938\u0947 \u091b\u0942\u091f\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u0938\u093e\u0925 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0930\u0916\u0928\u0947\u0938\u0947 \u0938\u0926\u093e \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0940 \u0936\u093e\u0928\u094d\u0924\u093f \u0914\u0930 \u0938\u0941\u0916 \u0928\u0939\u0940\u0902 \u092e\u093f\u0932 \u0938\u0915\u0924\u093e \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0938\u0926\u093e \u0905\u0936\u093e\u0928\u094d\u0924\u093f \u0914\u0930 \u0926\u0941\u0903\u0916 \u0939\u0940 \u092e\u093f\u0932\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948, \u0910\u0938\u093e \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u093e \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937 \u0905\u0928\u0941\u092d\u0935 \u0939\u0948\u0964 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0905\u0928\u0928\u094d\u0924 \u0906\u0928\u0928\u094d\u0926\u0915\u0947 \u0938\u094d\u0935\u0930\u0942\u092a \u0939\u0948\u0902 \u0935\u0939\u093e\u0901 \u0926\u0941\u0903\u0916\u0915\u093e \u0932\u0947\u0936 \u092d\u0940 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0910\u0938\u093e \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u094b\u0902\u0915\u093e \u0915\u0925\u0928 \u0939\u0948 \u0914\u0930 \u0938\u0928\u094d\u0924\u094b\u0902\u0915\u093e \u0905\u0928\u0941\u092d\u0935 \u0939\u0948\u0964\u0905\u092c \u0935\u093f\u091a\u093e\u0930 \u092f\u0939 \u0915\u0930\u0928\u093e \u0939\u0948 \u0915\u093f \u0938\u093e\u0927\u0915\u0915\u094b \u0938\u0902\u0938\u093e\u0930 \u0924\u094b \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937\u0930\u0942\u092a\u0938\u0947 \u0926\u0940\u0916\u0924\u093e \u0939\u0948 \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u094b \u0935\u0939 \u0915\u0947\u0935\u0932 \u092e\u093e\u0928\u0924\u093e \u0939\u0948 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u092a\u094d\u0930\u0924\u094d\u092f\u0915\u094d\u0937 \u0926\u0940\u0916\u0924\u0947 \u0928\u0939\u0940\u0902\u0964 \u0936\u093e\u0938\u094d\u0924\u094d\u0930 \u0914\u0930 \u0938\u0928\u094d\u0924 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0948\u0902 \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u0938\u0902\u0938\u093e\u0930 \u0939\u0948 \u0907\u0938\u0915\u094b \u092e\u093e\u0928\u0915\u0930 \u0938\u093e\u0927\u0915 \u0938\u093e\u0927\u0928 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u0909\u0938 \u0938\u093e\u0927\u0928\u093e\u092e\u0947\u0902 \u091c\u092c\u0924\u0915 \u0938\u0902\u0938\u093e\u0930\u0915\u0940 \u092e\u0941\u0916\u094d\u092f\u0924\u093e \u0930\u0939\u0924\u0940 \u0939\u0948 \u0924\u092c\u0924\u0915 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u092e\u093e\u0928\u094d\u092f\u0924\u093e \u0917\u094c\u0923 \u0930\u0939\u0924\u0940 \u0939\u0948\u0964 \u0938\u093e\u0927\u0928 \u0915\u0930\u0924\u0947\u0915\u0930\u0924\u0947 \u091c\u094d\u092f\u094b\u0902\u091c\u094d\u092f\u094b\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u0927\u093e\u0930\u0923\u093e (\u092e\u093e\u0928\u094d\u092f\u0924\u093e) \u092e\u0941\u0916\u094d\u092f \u0939\u094b\u0924\u0940 \u091a\u0932\u0940 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0924\u094d\u092f\u094b\u0902\u0939\u0940\u0924\u094d\u092f\u094b\u0902 \u0938\u0902\u0938\u093e\u0930\u0915\u0940 \u092e\u093e\u0928\u094d\u092f\u0924\u093e \u0917\u094c\u0923 \u0939\u094b\u0924\u0940 \u091a\u0932\u0940 \u091c\u093e\u0924\u0940 \u0939\u0948\u0964 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u0927\u093e\u0930\u0923\u093e \u0938\u0930\u094d\u0935\u0925\u093e \u092e\u0941\u0916\u094d\u092f \u0939\u094b\u0928\u0947 \u092a\u0930 \u0938\u093e\u0927\u0915\u0915\u094b \u092f\u0939 \u0938\u094d\u092a\u0937\u094d\u091f \u0926\u0940\u0916\u0928\u0947 \u0932\u0917 \u091c\u093e\u0924\u093e \u0939\u0948 \u0915\u093f \u0938\u0902\u0938\u093e\u0930 \u092a\u0939\u0932\u0947 \u0928\u0939\u0940\u0902 \u0925\u093e \u0914\u0930 \u092b\u093f\u0930 \u092c\u093e\u0926\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0930\u0939\u0947\u0917\u093e \u0924\u0925\u093e \u0935\u0930\u094d\u0924\u092e\u093e\u0928\u092e\u0947\u0902 \u091c\u094b \u0939\u0948 \u0930\u0942\u092a\u0938\u0947 \u0926\u0940\u0916\u0924\u093e \u0939\u0948 \u0935\u0939 \u092d\u0940 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0937\u0923 \u0905\u092d\u093e\u0935\u092e\u0947\u0902 \u091c\u093e \u0930\u0939\u093e \u0939\u0948\u0964 \u091c\u092c \u0938\u0902\u0938\u093e\u0930 \u0928\u0939\u0940\u0902 \u0925\u093e \u0924\u092c \u092d\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0925\u0947 \u091c\u092c \u0938\u0902\u0938\u093e\u0930 \u0928\u0939\u0940\u0902 \u0930\u0939\u0947\u0917\u093e \u0924\u092c \u092d\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0930\u0939\u0947\u0902\u0917\u0947 \u0914\u0930 \u0935\u0930\u094d\u0924\u092e\u093e\u0928\u092e\u0947\u0902 \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0937\u0923 \u0905\u092d\u093e\u0935\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0941\u090f \u092d\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u091c\u094d\u092f\u094b\u0902\u0915\u0947\u0924\u094d\u092f\u094b\u0902 \u0935\u093f\u0926\u094d\u092f\u092e\u093e\u0928 \u0939\u0948\u0902\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0938\u0902\u0938\u093e\u0930\u0915\u093e \u0938\u0926\u093e \u0905\u092d\u093e\u0935 \u0939\u0948 \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0938\u0926\u093e \u092d\u093e\u0935 \u0939\u0948\u0964 \u0907\u0938 \u0924\u0930\u0939 \u091c\u092c \u0938\u0902\u0938\u093e\u0930\u0915\u0940 \u0938\u094d\u0935\u0924\u0928\u094d\u0924\u094d\u0930 \u0938\u0924\u094d\u0924\u093e\u0915\u093e \u0938\u0930\u094d\u0935\u0925\u093e \u0905\u092d\u093e\u0935 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u0924\u092c \u0938\u0924\u094d\u092f\u0938\u094d\u0935\u0930\u0942\u092a\u0938\u0947 \u0938\u092c \u0915\u0941\u091b \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902, \u0910\u0938\u093e \u0935\u093e\u0938\u094d\u0924\u0935\u093f\u0915 \u0905\u0928\u0941\u092d\u0935 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u091c\u093f\u0938\u0915\u0947 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0938\u093e\u0927\u0915 \u0938\u093f\u0926\u094d\u0927 \u0915\u0939\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0948\u0902 \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u0938\u0902\u0938\u093e\u0930 \u0939\u0948, \u0910\u0938\u0940 \u092e\u093e\u0928\u094d\u092f\u0924\u093e \u0938\u0902\u0938\u093e\u0930\u0915\u0940 \u0938\u0924\u094d\u0924\u093e \u092e\u093e\u0928\u0928\u0947\u0938\u0947 \u0939\u0940 \u0939\u094b\u0924\u0940 \u0925\u0940 \u0914\u0930 \u0938\u0902\u0938\u093e\u0930\u0915\u0940 \u0938\u0924\u094d\u0924\u093e \u0938\u093e\u0927\u0915\u0915\u0947 \u0930\u093e\u0917\u0915\u0947 \u0915\u093e\u0930\u0923 \u0939\u0940 \u0926\u0940\u0916\u0924\u0940 \u0925\u0940\u0964 \u0924\u0924\u094d\u0924\u094d\u0935\u0924\u0903 \u0938\u092c \u0915\u0941\u091b \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902\u0964\n(2)\u0938\u0924\u094d \u0914\u0930 \u0905\u0938\u0924\u094d \u0938\u092c \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902,'\u0938\u0926\u0938\u091a\u094d\u091a\u093e\u0939\u092e\u094d' (9\u0964 19) \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0928 \u0938\u0924\u094d \u0915\u0939\u0947 \u091c\u093e \u0938\u0915\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0928 \u0905\u0938\u0924\u094d \u0915\u0939\u0947 \u091c\u093e \u0938\u0915\u0924\u0947 \u0939\u0948\u0902, '\u0928 \u0938\u0924\u094d\u0924\u0928\u094d\u0928\u093e\u0938\u0926\u0941\u091a\u094d\u092f\u0924\u0947' (13\u0964 12) \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u0924\u094d \u092d\u0940 \u0939\u0948\u0902 \u0905\u0938\u0924\u094d \u092d\u0940 \u0939\u0948\u0902 \u0914\u0930 \u0938\u0924\u094d\u0905\u0938\u0924\u094d \u0926\u094b\u0928\u094b\u0902 \u0938\u0947 \u092a\u0930\u0947 \u092d\u0940 \u0939\u0948\u0902,'\u0938\u0926\u0938\u0924\u094d\u0924\u0924\u094d\u092a\u0930\u0902 \u092f\u0924\u094d' (11\u0964 37)\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u092d\u093f\u0928\u094d\u0928\u092d\u093f\u0928\u094d\u0928 \u0935\u091a\u0928 \u0906\u0924\u0947 \u0939\u0948\u0902\u0964 \u0905\u092c \u0909\u0928\u0915\u0940 \u0938\u0902\u0917\u0924\u093f\u0915\u0947 \u0935\u093f\u0937\u092f \u092e\u0947\u0902 \u0935\u093f\u091a\u093e\u0930 \u0915\u093f\u092f\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964\u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0905\u0932\u094c\u0915\u093f\u0915 \u0914\u0930 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948\u0964 \u0909\u0938 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u094b\u0908 \u092d\u0940 \u0928\u0939\u0940\u0902 \u0915\u0930 \u0938\u0915\u0924\u093e\u0964 \u0909\u0938 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u094b \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0901 \u092e\u0928 \u0914\u0930 \u092c\u0941\u0926\u094d\u0927\u093f \u0928\u0939\u0940\u0902 \u092a\u0915\u0921\u093c \u0938\u0915\u0924\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0935\u0939 \u0924\u0924\u094d\u0924\u094d\u0935 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0901 \u092e\u0928 \u0914\u0930 \u092c\u0941\u0926\u094d\u0927\u093f\u0915\u0940 \u092a\u0930\u093f\u0927\u093f\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0906\u0924\u093e\u0964 \u0939\u093e\u0901 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0901 \u092e\u0928 \u0914\u0930 \u092c\u0941\u0926\u094d\u0927\u093f \u0909\u0938\u092e\u0947\u0902 \u0935\u093f\u0932\u0940\u0928 \u0939\u094b \u0938\u0915\u0924\u0947 \u0939\u0948\u0902\u0964 \u0938\u093e\u0927\u0915 \u0909\u0938 \u0924\u0924\u094d\u0924\u094d\u0935\u092e\u0947\u0902 \u0938\u094d\u0935\u092f\u0902 \u0932\u0940\u0928 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948 \u0909\u0938\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930 \u0938\u0915\u0924\u093e \u0939\u0948 \u092a\u0930 \u0909\u0938 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u094b \u0905\u092a\u0928\u0947 \u0915\u092c\u094d\u091c\u0947\u092e\u0947\u0902 \u0905\u092a\u0928\u0947 \u0905\u0927\u093f\u0915\u093e\u0930\u092e\u0947\u0902 \u0905\u092a\u0928\u0940 \u0938\u0940\u092e\u093e\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0932\u0947 \u0938\u0915\u0924\u093e\u0964\u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u091a\u093e\u0939\u0928\u0947 \u0935\u093e\u0932\u0947 \u0938\u093e\u0927\u0915 \u0926\u094b \u0924\u0930\u0939\u0915\u0947 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u090f\u0915 \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0914\u0930 \u090f\u0915 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u090f\u0915 \u092e\u0938\u094d\u0924\u093f\u0937\u094d\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948 \u0914\u0930 \u090f\u0915 \u0939\u0943\u0926\u092f\u092a\u094d\u0930\u0927\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915\u0915\u0947 \u092d\u0940\u0924\u0930 \u0935\u093f\u0935\u0947\u0915\u0915\u0940 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u091c\u093e\u0928\u0928\u0947\u0915\u0940 \u092e\u0941\u0916\u094d\u092f\u0924\u093e \u0930\u0939\u0924\u0940 \u0939\u0948 \u0914\u0930 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915\u0915\u0947 \u092d\u0940\u0924\u0930 \u092e\u093e\u0928\u0928\u0947\u0915\u0940 \u092e\u0941\u0916\u094d\u092f\u0924\u093e \u0930\u0939\u0924\u0940 \u0939\u0948\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0928\u0939\u0940\u0902 \u0939\u0948 \u0915\u093f \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915\u092e\u0947\u0902 \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0928\u0939\u0940\u0902 \u0930\u0939\u0924\u0940 \u0914\u0930 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915\u092e\u0947\u0902 \u0935\u093f\u0935\u0947\u0915 \u0928\u0939\u0940\u0902 \u0930\u0939\u0924\u093e \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u092f\u0939 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915\u092e\u0947\u0902 \u0935\u093f\u0935\u0947\u0915\u0915\u0940 \u092e\u0941\u0916\u094d\u092f\u0924\u093e \u0914\u0930 \u0938\u093e\u0925\u092e\u0947\u0902 \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0930\u0939\u0924\u0940 \u0939\u0948 \u0924\u0925\u093e \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915\u092e\u0947\u0902 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0915\u0940 \u092e\u0941\u0916\u094d\u092f\u0924\u093e \u0914\u0930 \u0938\u093e\u0925\u092e\u0947\u0902 \u0935\u093f\u0935\u0947\u0915 \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u0926\u0942\u0938\u0930\u0947 \u0936\u092c\u094d\u0926\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0928\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u092e\u0947\u0902 \u092e\u093e\u0928\u0928\u093e \u092d\u0940 \u0930\u0939\u0924\u093e \u0939\u0948 \u0914\u0930 \u092e\u093e\u0928\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0928\u0928\u093e \u092d\u0940 \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u091c\u093e\u0928\u0928\u0947 \u0935\u093e\u0932\u0947 \u091c\u093e\u0928\u0915\u0930 \u092e\u093e\u0928 \u0932\u0947\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092e\u093e\u0928\u0928\u0947\u0935\u093e\u0932\u0947 \u092e\u093e\u0928\u0915\u0930 \u091c\u093e\u0928 \u0932\u0947\u0924\u0947 \u0939\u0948\u0902\u0964 \u0905\u0924\u0903 \u0915\u093f\u0938\u0940 \u092d\u0940 \u0924\u0930\u0939\u0915\u0947 \u0938\u093e\u0927\u0915\u092e\u0947\u0902 \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u0915\u092e\u0940 \u0928\u0939\u0940\u0902 \u0930\u0939\u0924\u0940\u0964\u0938\u093e\u0927\u0915 \u091a\u093e\u0939\u0947 \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0939\u094b \u091a\u093e\u0939\u0947 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0939\u094b \u092a\u0930 \u0938\u093e\u0927\u0928\u092e\u0947\u0902 \u0909\u0938\u0915\u0940 \u0905\u092a\u0928\u0940 \u0930\u0941\u091a\u093f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0914\u0930 \u092f\u094b\u0917\u094d\u092f\u0924\u093e\u0915\u0940 \u092a\u094d\u0930\u0927\u093e\u0928\u0924\u093e \u0930\u0939\u0924\u0940 \u0939\u0948\u0964 \u0930\u0941\u091a\u093f \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0914\u0930 \u092f\u094b\u0917\u094d\u092f\u0924\u093e \u090f\u0915 \u0938\u093e\u0927\u0928\u092e\u0947\u0902 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0938\u093e\u0927\u0915 \u0909\u0938 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u094b \u091c\u0932\u094d\u0926\u0940 \u0938\u092e\u091d\u0924\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0930\u0941\u091a\u093f \u0914\u0930 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0935\u0948\u0938\u0940 \u092f\u094b\u0917\u094d\u092f\u0924\u093e \u0928 \u0939\u094b \u0905\u0925\u0935\u093e \u092f\u094b\u0917\u094d\u092f\u0924\u093e \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0935\u0948\u0938\u0940 \u0930\u0941\u091a\u093f \u0914\u0930 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0928 \u0939\u094b \u0924\u094b \u0938\u093e\u0927\u0915\u0915\u094b \u0909\u0938 \u0938\u093e\u0927\u0928\u092e\u0947\u0902 \u0915\u0920\u093f\u0928\u0924\u093e \u092a\u0921\u093c\u0924\u0940 \u0939\u0948\u0964 \u0930\u0941\u091a\u093f \u0939\u094b\u0928\u0947 \u0938\u0947 \u092e\u0928 \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0932\u0917 \u091c\u093e\u0924\u093e \u0939\u0948 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0939\u094b\u0928\u0947 \u0938\u0947 \u092c\u0941\u0926\u094d\u0927\u093f \u0938\u094d\u0935\u093e\u092d\u093e\u0935\u093f\u0915 \u0932\u0917 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0914\u0930 \u092f\u094b\u0917\u094d\u092f\u0924\u093e \u0939\u094b\u0928\u0947 \u0938\u0947 \u092c\u093e\u0924 \u0920\u0940\u0915 \u0938\u092e\u091d\u092e\u0947\u0902 \u0906 \u091c\u093e\u0924\u0940 \u0939\u0948\u0964\u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915 \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u0928\u093f\u0930\u093e\u0915\u093e\u0930\u0915\u094b \u092a\u0938\u0902\u0926 \u0915\u0930\u0924\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938\u0915\u0940 \u0930\u0941\u091a\u093f \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u0928\u093f\u0930\u093e\u0915\u093e\u0930\u092e\u0947\u0902 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915 \u0938\u0917\u0941\u0923\u0938\u093e\u0915\u093e\u0930\u0915\u094b \u092a\u0938\u0902\u0926 \u0915\u0930\u0924\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938\u0915\u0940 \u0930\u0941\u091a\u093f \u0938\u0917\u0941\u0923\u0938\u093e\u0915\u093e\u0930\u092e\u0947\u0902 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u091c\u094b \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u0928\u093f\u0930\u093e\u0915\u093e\u0930\u0915\u094b \u092a\u0938\u0902\u0926 \u0915\u0930\u0924\u093e \u0939\u0948 \u0935\u0939 \u092f\u0939 \u0915\u0939\u0924\u093e \u0939\u0948 \u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935 \u0928 \u0938\u0924\u094d \u0915\u0939\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0948 \u0914\u0930 \u0928 \u0905\u0938\u0924\u094d \u0915\u0939\u093e \u091c\u093e \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u091c\u094b \u0938\u0917\u0941\u0923\u0938\u093e\u0915\u093e\u0930\u0915\u094b \u092a\u0938\u0902\u0926 \u0915\u0930\u0924\u093e \u0939\u0948 \u0924\u094b \u0935\u0939 \u0915\u0939\u0924\u093e \u0939\u0948 \u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u0924\u094d \u092d\u0940 \u0939\u0948\u0902 \u0905\u0938\u0924\u094d \u092d\u0940 \u0939\u0948\u0902 \u0914\u0930 \u0938\u0924\u094d\u0905\u0938\u0924\u094d\u0938\u0947 \u092a\u0930\u0947 \u092d\u0940 \u0939\u0948\u0902\u0964\u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u091a\u093f\u0928\u094d\u092e\u092f\u0924\u0924\u094d\u0924\u094d\u0935 \u0924\u094b \u0939\u0930\u0926\u092e \u091c\u094d\u092f\u094b\u0902\u0915\u093e\u0924\u094d\u092f\u094b\u0902 \u0939\u0940 \u0930\u0939\u0924\u093e \u0939\u0948 \u0914\u0930 \u091c\u0921 \u0905\u0938\u0924\u094d \u0915\u0939\u0932\u093e\u0928\u0947\u0935\u093e\u0932\u093e \u0938\u0902\u0938\u093e\u0930 \u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u092c\u0926\u0932\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u091c\u092c \u092f\u0939 \u091a\u0947\u0924\u0928 \u091c\u0940\u0935 \u092c\u0926\u0932\u0924\u0947 \u0939\u0941\u090f \u0938\u0902\u0938\u093e\u0930\u0915\u094b \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0926\u0947\u0924\u093e \u0939\u0948 \u0909\u0938\u0915\u0947 \u0938\u093e\u0925 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u091c\u094b\u0921\u093c \u0932\u0947\u0924\u093e \u0939\u0948 \u0924\u092c \u092f\u0939 \u091c\u0928\u094d\u092e\u092e\u0930\u0923\u0915\u0947 \u091a\u0915\u094d\u0915\u0930\u092e\u0947\u0902 \u0918\u0942\u092e\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u091c\u092c \u092f\u0939 \u091c\u0921\u0924\u093e\u0938\u0947 \u0938\u0930\u094d\u0935\u0925\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0935\u093f\u091a\u094d\u091b\u0947\u0926 \u0915\u0930 \u0932\u0947\u0924\u093e \u0939\u0948 \u0924\u092c \u0907\u0938\u0915\u094b \u0938\u094d\u0935\u0924\u0903\u0938\u093f\u0926\u094d\u0927 \u091a\u093f\u0928\u094d\u092e\u092f\u0924\u0924\u094d\u0924\u094d\u0935\u0915\u093e \u0905\u0928\u0941\u092d\u0935 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915 \u0935\u093f\u0935\u0947\u0915\u0935\u093f\u091a\u093e\u0930\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u091c\u0921\u0924\u093e\u0915\u093e \u0924\u094d\u092f\u093e\u0917 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u091c\u0921\u0924\u093e\u0915\u093e \u0924\u094d\u092f\u093e\u0917 \u0939\u094b\u0928\u0947 \u092a\u0930 \u091a\u093f\u0928\u094d\u092e\u092f\u0924\u0924\u094d\u0924\u094d\u0935 \u0905\u0935\u0936\u0947\u0937 \u0930\u0939\u0924\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0928\u093f\u0924\u094d\u092f\u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u093e \u0905\u0928\u0941\u092d\u0935 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915 \u0915\u0947\u0935\u0932 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0939\u0940 \u0938\u092e\u094d\u092e\u0941\u0916 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u091c\u093f\u0938\u0938\u0947 \u0935\u0939 \u091c\u0921\u0924\u093e\u0938\u0947 \u0935\u093f\u092e\u0941\u0916 \u0939\u094b\u0915\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092a\u094d\u0930\u0947\u092e\u092a\u0942\u0930\u094d\u0935\u0915 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u0947\u0924\u093e \u0939\u0948\u0964 \u0935\u093f\u0935\u0947\u0915\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915 \u0924\u094b \u0938\u092e \u0936\u093e\u0928\u094d\u0924 \u0938\u0924\u094d\u0918\u0928 \u091a\u093f\u0924\u094d\u0918\u0928 \u0906\u0928\u0928\u094d\u0926\u0918\u0928 \u0924\u0924\u094d\u0924\u094d\u0935\u092e\u0947\u0902 \u0905\u091f\u0932 \u0938\u094d\u0925\u093f\u0924 \u0939\u094b\u0915\u0930 \u0905\u0916\u0923\u094d\u0921 \u0906\u0928\u0928\u094d\u0926\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948 \u092a\u0930 \u0936\u094d\u0930\u0926\u094d\u0927\u093e\u092a\u094d\u0930\u0927\u093e\u0928 \u0938\u093e\u0927\u0915 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u093e\u0925 \u0905\u092d\u093f\u0928\u094d\u0928 \u0939\u094b\u0915\u0930 \u092a\u094d\u0930\u0947\u092e\u0915\u0947 \u0905\u0928\u0928\u094d\u0924 \u092a\u094d\u0930\u0924\u093f\u0915\u094d\u0937\u0923 \u0935\u0930\u094d\u0927\u092e\u093e\u0928 \u0906\u0928\u0928\u094d\u0926\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930 \u0932\u0947\u0924\u093e \u0939\u0948\u0964\u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0926\u094b\u0928\u094b\u0902 \u0939\u0940 \u0938\u093e\u0927\u0915\u094b\u0902 \u0915\u094b \u091c\u0921\u0924\u093e\u0938\u0947 \u0938\u0930\u094d\u0935\u0925\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0935\u093f\u091a\u094d\u091b\u0947\u0926\u092a\u0942\u0930\u094d\u0935\u0915 \u091a\u093f\u0928\u094d\u092e\u092f\u0924\u0924\u094d\u0924\u094d\u0935\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948 \u0914\u0930,\u0938\u0924\u094d\u0905\u0938\u0924\u094d \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u092c \u0915\u0941\u091b \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902, \u0910\u0938\u093e \u0905\u0928\u0941\u092d\u0935 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964\n\t\u0938\u092e\u094d\u092c\u0928\u094d\u0927,\u0926\u0942\u0938\u0930\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u093e \u0938\u093e\u0924\u0935\u093e\u0901 \u092a\u094d\u0930\u0936\u094d\u0928 \u0925\u093e \u0915\u093f \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0906\u092a \u0915\u0948\u0938\u0947 \u091c\u093e\u0928\u0928\u0947\u092e\u0947\u0902 \u0906\u0924\u0947 \u0939\u0948\u0902 \u0907\u0938\u0915\u093e \u0909\u0924\u094d\u0924\u0930 \u092d\u0917\u0935\u093e\u0928\u094d \u0906\u0917\u0947\u0915\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0926\u0947\u0924\u0947 \u0939\u0948\u0902\u0964"},{text:"\u0905\u0928\u094d\u0924\u0915\u093e\u0932\u0947 \u091a \u092e\u093e\u092e\u0947\u0935 \u0938\u094d\u092e\u0930\u0928\u094d\u092e\u0941\u0915\u094d\u0924\u094d\u0935\u093e \u0915\u0932\u0947\u0935\u0930\u092e\u094d\u0964\n\u092f\u0903 \u092a\u094d\u0930\u092f\u093e\u0924\u093f \u0938 \u092e\u0926\u094d\u092d\u093e\u0935\u0902 \u092f\u093e\u0924\u093f \u0928\u093e\u0938\u094d\u0924\u094d\u092f\u0924\u094d\u0930 \u0938\u0902\u0936\u092f\u0903\u0964\u09648.5\u0964\u0964",translation:"\u0964\u09648.5\u0964\u0964 \u091c\u094b \u092e\u0928\u0941\u0937\u094d\u092f \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u092d\u0940 \u092e\u0947\u0930\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948, \u0935\u0939 \u092e\u0947\u0930\u0947 \u0938\u094d\u0935\u0930\u0941\u092a \u0915\u094b \u0939\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948, \u0907\u0938\u092e\u0947\u0902 \u0938\u0928\u094d\u0926\u0947\u0939 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 ",commentary:"\u0964\u09648.5\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0905\u0928\u094d\u0924\u0915\u093e\u0932\u0947 \u091a' '\u092e\u093e\u092e\u0947\u0935 \u09f7\u09f7. \u092f\u093e\u0924\u093f \u0928\u093e\u0938\u094d\u0924\u094d\u092f\u0924\u094d\u0930 \u0938\u0902\u0936\u092f\u0903', \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u092d\u0940 \u092e\u0947\u0930\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u091c\u094b \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948, \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0941\u0906 \u0915\u093f \u0907\u0938 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u094b \u091c\u0940\u0935\u0928\u092e\u0947\u0902 \u0938\u093e\u0927\u0928\u092d\u091c\u0928 \u0915\u0930\u0915\u0947 \u0905\u092a\u0928\u093e \u0909\u0926\u094d\u0927\u093e\u0930 \u0915\u0930\u0928\u0947\u0915\u093e \u0905\u0935\u0938\u0930 \u0926\u093f\u092f\u093e \u0925\u093e \u092a\u0930 \u0907\u0938\u0928\u0947 \u0915\u0941\u091b \u0915\u093f\u092f\u093e \u0939\u0940 \u0928\u0939\u0940\u0902\u0964 \u0905\u092c \u092c\u0947\u091a\u093e\u0930\u093e \u092f\u0939 \u092e\u0928\u0941\u0937\u094d\u092f \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0926\u0942\u0938\u0930\u093e \u0938\u093e\u0927\u0928 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u0905\u0938\u092e\u0930\u094d\u0925 \u0939\u0948 \u0907\u0938\u0932\u093f\u092f\u0947 \u092c\u0938 \u092e\u0947\u0930\u0947 \u0915\u094b \u092f\u093e\u0926 \u0915\u0930 \u0932\u0947 \u0924\u094b \u0907\u0938\u0915\u094b \u092e\u0947\u0930\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b \u091c\u093e\u092f\u0917\u0940\u0964'\u092e\u093e\u092e\u0947\u0935 \u0938\u094d\u092e\u0930\u0928\u094d' \u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0938\u0941\u0928\u0928\u0947 \u0938\u092e\u091d\u0928\u0947 \u0914\u0930 \u092e\u093e\u0928\u0928\u0947\u092e\u0947\u0902 \u091c\u094b \u0915\u0941\u091b \u0906\u0924\u093e \u0939\u0948 \u0935\u0939 \u0938\u092c \u092e\u0947\u0930\u093e \u0938\u092e\u0917\u094d\u0930\u0930\u0942\u092a \u0939\u0948\u0964 \u0905\u0924\u0903 \u091c\u094b \u0909\u0938\u0915\u094b \u092e\u0947\u0930\u093e \u0939\u0940 \u0938\u094d\u0935\u0930\u0942\u092a \u092e\u093e\u0928\u0947\u0917\u093e \u0909\u0938\u0915\u094b \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u092d\u0940 \u092e\u0947\u0930\u093e \u0939\u0940 \u091a\u093f\u0928\u094d\u0924\u0928 \u0939\u094b\u0917\u093e \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938\u0928\u0947 \u091c\u092c \u0938\u092c \u0915\u0941\u091b \u092e\u0947\u0930\u093e \u0939\u0940 \u0938\u094d\u0935\u0930\u0942\u092a \u092e\u093e\u0928 \u0932\u093f\u092f\u093e \u0924\u094b \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0909\u0938\u0915\u094b \u091c\u094b \u0915\u0941\u091b \u092f\u093e\u0926 \u0906\u092f\u0947\u0917\u093e \u0935\u0939 \u092e\u0947\u0930\u093e \u0939\u0940 \u0938\u094d\u0935\u0930\u0942\u092a \u0939\u094b\u0917\u093e \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u0939 \u0938\u094d\u092e\u0930\u0923 \u092e\u0947\u0930\u093e \u0939\u0940 \u0939\u094b\u0917\u093e\u0964 \u092e\u0947\u0930\u093e \u0938\u094d\u092e\u0930\u0923 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0909\u0938\u0915\u094b \u092e\u0947\u0930\u0940 \u0939\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0917\u0940\u0964'\u092e\u0926\u094d\u092d\u093e\u0935\u092e\u094d' \u0915\u0939\u0928\u0947 \u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0938\u093e\u0927\u0915\u0928\u0947 \u092e\u0947\u0930\u0947 \u0915\u094b \u091c\u093f\u0938\u0915\u093f\u0938\u0940 \u092d\u093f\u0928\u094d\u0928 \u0905\u0925\u0935\u093e \u0905\u092d\u093f\u0928\u094d\u0928 \u092d\u093e\u0935 \u0938\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u0917\u0941\u0923\u0928\u093f\u0930\u094d\u0917\u0941\u0923 \u0938\u093e\u0915\u093e\u0930\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u0926\u094d\u0935\u093f\u092d\u0941\u091c\u091a\u0924\u0941\u0930\u094d\u092d\u0941\u091c \u0924\u0925\u093e \u0928\u093e\u092e \u0932\u0940\u0932\u093e \u0927\u093e\u092e \u0930\u0942\u092a \u0906\u0926\u093f\u0938\u0947 \u0938\u094d\u0935\u0940\u0915\u093e\u0930 \u0915\u093f\u092f\u093e \u0939\u0948 \u092e\u0947\u0930\u0940 \u0909\u092a\u093e\u0938\u0928\u093e \u0915\u0940 \u0939\u0948 \u0905\u0928\u094d\u0924\u0938\u092e\u092f\u0915\u0947 \u0938\u094d\u092e\u0930\u0923\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0935\u0939 \u092e\u0947\u0930\u0947 \u0909\u0938\u0940 \u092d\u093e\u0935\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964\n\u091c\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0909\u092a\u093e\u0938\u0928\u093e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0935\u0947 \u0924\u094b \u0905\u0928\u094d\u0924\u0938\u092e\u092f\u092e\u0947\u0902 \u0909\u092a\u093e\u0938\u094d\u092f\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0909\u0938\u0940 \u0909\u092a\u093e\u0938\u094d\u092f\u0915\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092d\u0917\u0935\u0926\u094d\u092d\u093e\u0935\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u091c\u094b \u0909\u092a\u093e\u0938\u0928\u093e \u0928\u0939\u0940\u0902 \u0915\u0930\u0924\u0947 \u0909\u0928\u0915\u094b \u092d\u0940 \u0905\u0928\u094d\u0924\u0938\u092e\u092f\u092e\u0947\u0902 \u0915\u093f\u0938\u0940 \u0915\u093e\u0930\u0923\u0935\u0936\u093e\u0924\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0915\u093f\u0938\u0940 \u0928\u093e\u092e \u0930\u0942\u092a \u0932\u0940\u0932\u093e \u0927\u093e\u092e \u0906\u0926\u093f \u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0939\u094b \u091c\u093e\u092f \u0924\u094b \u0935\u0947 \u092d\u0940 \u0909\u0928 \u0909\u092a\u093e\u0938\u0915\u094b\u0902\u0915\u0940 \u0924\u0930\u0939 \u0909\u0938\u0940 \u092d\u0917\u0935\u0926\u094d\u092d\u093e\u0935\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u091c\u0948\u0938\u0947 \u0917\u0941\u0923\u094b\u0902\u092e\u0947\u0902 \u0938\u094d\u0925\u093f\u0924 \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0947\u0915\u0940 (\u0917\u0940\u0924\u093e 14\u0964 18) \u0914\u0930 \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u091c\u093f\u0938\u0915\u093f\u0938\u0940 \u0917\u0941\u0923\u0915\u0947 \u092c\u0922\u093c\u0928\u0947\u0935\u093e\u0932\u0947\u0915\u0940 \u0935\u0948\u0938\u0940 \u0939\u0940 \u0917\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948 (\u0917\u0940\u0924\u093e 14\u0964 14 15) \u0910\u0938\u0947 \u0939\u0940 \u091c\u093f\u0938\u0915\u094b \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d \u092f\u093e\u0926 \u0906 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0909\u0938\u0915\u0940 \u092d\u0940 \u0909\u092a\u093e\u0938\u0915\u094b\u0902\u0915\u0940 \u0924\u0930\u0939 \u0917\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948\u0964\u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u0917\u0941\u0923\u0928\u093f\u0930\u094d\u0917\u0941\u0923 \u0938\u093e\u0915\u093e\u0930\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u0906\u0926\u093f \u0905\u0928\u0947\u0915 \u0930\u0942\u092a\u094b\u0902\u0915\u093e \u0914\u0930 \u0928\u093e\u092e \u0932\u0940\u0932\u093e \u0927\u093e\u092e \u0906\u0926\u093f \u0915\u093e \u092d\u0947\u0926 \u0924\u094b \u0938\u093e\u0927\u0915\u094b\u0902\u0915\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u0939\u0948 \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u0938\u092c \u090f\u0915 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u0938\u092c \u090f\u0915 \u092e\u0926\u094d\u092d\u093e\u0935, \u092d\u0917\u0935\u0926\u094d\u092d\u093e\u0935\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u092e\u0917\u094d\u0930 \u0938\u094d\u0935\u0930\u0942\u092a \u090f\u0915 \u0939\u0940 \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0917\u0941\u0923\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0917\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u0947 \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u090f\u0915 \u0928\u0939\u0940\u0902 \u0939\u094b \u0938\u0915\u0924\u0947 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0924\u0940\u0928\u094b\u0902 \u0917\u0941\u0923 (\u0938\u0924\u094d\u0924\u094d\u0935 \u0930\u091c \u0924\u092e) \u0905\u0932\u0917\u0905\u0932\u0917 \u0939\u0948\u0902\u0964 \u0905\u0924\u0903 \u0917\u0941\u0923\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0909\u0928\u0915\u0940 \u0917\u0924\u093f\u092f\u093e\u0901 \u092d\u0940 \u0905\u0932\u0917\u0905\u0932\u0917 \u0939\u094b\u0924\u0940 \u0939\u0948\u0902\u0964\u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0915\u0947 \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u0915\u093e \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u093e\u0925 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0930\u0939\u0924\u093e \u0939\u0948 \u0914\u0930 \u0917\u0941\u0923\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u0915\u093e \u0917\u0941\u0923\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u092e\u094d\u092e\u0941\u0916 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0917\u0941\u0923\u094b\u0902\u0938\u0947 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0930\u0916\u0928\u0947\u0935\u093e\u0932\u0947 \u0917\u0941\u0923\u094b\u0902\u0915\u0947 \u0938\u092e\u094d\u092e\u0941\u0916 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0917\u0941\u0923\u094b\u0902\u0915\u0947 \u0915\u093e\u0930\u094d\u092f \u091c\u0928\u094d\u092e\u092e\u0930\u0923\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964\u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u090f\u0915 \u092f\u0939 \u0935\u093f\u0936\u0947\u0937 \u091b\u0942\u091f \u0926\u0940 \u0939\u0941\u0908 \u0939\u0948 \u0915\u093f \u092e\u0930\u0923\u093e\u0938\u0928\u094d\u0928 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0915\u0947 \u0915\u0948\u0938\u0947 \u0939\u0940 \u0906\u091a\u0930\u0923 \u0930\u0939\u0947 \u0939\u094b\u0902 \u0915\u0948\u0938\u0947 \u0939\u0940 \u092d\u093e\u0935 \u0930\u0939\u0947 \u0939\u094b\u0902 \u0915\u093f\u0938\u0940 \u092d\u0940 \u0924\u0930\u0939\u0915\u093e \u091c\u0940\u0935\u0928 \u092c\u0940\u0924\u093e \u0939\u094b \u092a\u0930 \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0935\u0939 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092f\u093e\u0926 \u0915\u0930 \u0932\u0947 \u0924\u094b \u0909\u0938\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u092f\u0917\u093e\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u091c\u0940\u0935\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u0909\u0938\u0915\u094b \u092e\u0928\u0941\u0937\u094d\u092f\u0936\u0930\u0940\u0930 \u0926\u093f\u092f\u093e \u0939\u0948 \u0914\u0930 \u091c\u0940\u0935\u0928\u0947 \u0909\u0938 \u092e\u0928\u0941\u0937\u094d\u092f\u0936\u0930\u0940\u0930\u0915\u094b \u0938\u094d\u0935\u0940\u0915\u093e\u0930 \u0915\u093f\u092f\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u091c\u0940\u0935\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u092f \u0924\u092d\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0907\u0938 \u091c\u0940\u0935\u0915\u094b \u092e\u0928\u0941\u0937\u094d\u092f\u0936\u0930\u0940\u0930 \u0926\u0947\u0928\u093e \u0914\u0930 \u091c\u0940\u0935\u0915\u093e \u092e\u0928\u0941\u0937\u094d\u092f\u0936\u0930\u0940\u0930 \u0932\u0947\u0928\u093e \u0938\u092b\u0932 \u0939\u094b\u0917\u093e\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0935\u0939 \u0905\u092a\u0928\u093e \u0909\u0926\u094d\u0927\u093e\u0930 \u0915\u093f\u092f\u0947 \u092c\u093f\u0928\u093e \u0939\u0940 \u0906\u091c \u0926\u0941\u0928\u093f\u092f\u093e\u0938\u0947 \u0935\u093f\u0926\u093e \u0939\u094b \u0930\u0939\u093e \u0939\u0948 \u0907\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u092d\u0948\u092f\u093e \u0924\u0947\u0930\u0940 \u0914\u0930 \u092e\u0947\u0930\u0940 \u0926\u094b\u0928\u094b\u0902\u0915\u0940 \u0907\u091c\u094d\u091c\u0924 \u0930\u0939 \u091c\u093e\u092f \u0907\u0938\u0932\u093f\u092f\u0947 \u0905\u092c \u091c\u093e\u0924\u0947\u091c\u093e\u0924\u0947 (\u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902) \u092d\u0940 \u0924\u0942 \u092e\u0947\u0930\u0947 \u0915\u094b \u092f\u093e\u0926 \u0915\u0930 \u0932\u0947 \u0924\u094b \u0924\u0947\u0930\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u092f \u0905\u0924\u0903 \u0939\u0930\u0947\u0915 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u0947 \u0932\u093f\u092f\u0947 \u0938\u093e\u0935\u0927\u093e\u0928 \u0939\u094b\u0928\u0947\u0915\u0940 \u091c\u0930\u0942\u0930\u0924 \u0939\u0948 \u0915\u093f \u0935\u0939 \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0947 \u0915\u094b\u0908 \u0938\u092e\u092f \u0916\u093e\u0932\u0940 \u0928 \u091c\u093e\u0928\u0947 \u0926\u0947 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u0915\u093e \u092a\u0924\u093e \u0928\u0939\u0940\u0902 \u0939\u0948 \u0915\u093f \u0915\u092c \u0906 \u091c\u093e\u092f\u0964 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0938\u092c \u0938\u092e\u092f \u0905\u0928\u094d\u0924\u0915\u093e\u0932 \u0939\u0940 \u0939\u0948\u0964 \u092f\u0939 \u092c\u093e\u0924 \u0924\u094b \u0939\u0948 \u0928\u0939\u0940\u0902 \u0915\u093f \u0907\u0924\u0928\u0947 \u0935\u0930\u094d\u0937 \u0907\u0924\u0928\u0947 \u092e\u0939\u0940\u0928\u0947 \u0914\u0930 \u0907\u0924\u0928\u0947 \u0926\u093f\u0928\u094b\u0902\u0915\u0947 \u092c\u093e\u0926 \u092e\u0943\u0924\u094d\u092f\u0941 \u0939\u094b\u0917\u0940\u0964 \u0926\u0947\u0916\u0928\u0947\u092e\u0947\u0902 \u0924\u094b \u092f\u0939\u0940 \u0906\u0924\u093e \u0939\u0948 \u0915\u093f \u0917\u0930\u094d\u092d\u092e\u0947\u0902 \u0939\u0940 \u0915\u0908 \u092c\u093e\u0932\u0915 \u092e\u0930 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0915\u0908 \u091c\u0928\u094d\u092e\u0924\u0947 \u0939\u0940 \u092e\u0930 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0915\u0908 \u0915\u0941\u091b \u0926\u093f\u0928\u094b\u0902\u092e\u0947\u0902 \u092e\u0939\u0940\u0928\u094b\u0902\u092e\u0947\u0902 \u0935\u0930\u094d\u0937\u094b\u0902\u092e\u0947\u0902 \u092e\u0930 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u092e\u0930\u0928\u0947\u0915\u0940 \u091a\u093e\u0932 \u0939\u0930\u0926\u092e \u091a\u0932 \u0939\u0940 \u0930\u0939\u0940 \u0939\u0948\u0964 \u0905\u0924\u0903 \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092f\u093e\u0926 \u0930\u0916\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u0914\u0930 \u092f\u0939\u0940 \u0938\u092e\u091d\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u0915\u093f \u092c\u0938 \u092f\u0939\u0940 \u0905\u0928\u094d\u0924\u0915\u093e\u0932 \u0939\u0948 \u0928\u0940\u0924\u093f\u092e\u0947\u0902 \u092f\u0939 \u092c\u093e\u0924 \u0906\u0924\u0940 \u0939\u0948 \u0915\u093f \u0905\u0917\u0930 \u0927\u0930\u094d\u092e \u0915\u093e \u0906\u091a\u0930\u0923 \u0915\u0930\u0928\u093e \u0939\u094b \u0915\u0932\u094d\u092f\u093e\u0923 \u0915\u0930\u0928\u093e \u0939\u094b \u0924\u094b \u092e\u0943\u0924\u094d\u092f\u0941\u0928\u0947 \u092e\u0947\u0930\u0947 \u0915\u0947\u0936 \u092a\u0915\u0921\u093c\u0947 \u0939\u0941\u090f \u0939\u0948\u0902 \u091d\u091f\u0915\u093e \u0926\u093f\u092f\u093e \u0915\u093f \u0916\u0924\u094d\u092e \u0910\u0938\u093e \u0935\u093f\u091a\u093e\u0930 \u0939\u0930\u0926\u092e \u0930\u0939\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947, '\u0917\u0943\u0939\u0940\u0924 \u0907\u0935 \u0915\u0947\u0936\u0947\u0937\u0941 \u092e\u0943\u0924\u094d\u092f\u0941\u0928\u093e \u0927\u0930\u094d\u092e\u092e\u093e\u091a\u0930\u0947\u0924\u094d'\u0964\n\u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0909\u092a\u0930\u094d\u092f\u0941\u0915\u094d\u0924 \u091b\u0942\u091f\u0938\u0947 \u092e\u0928\u0941\u0937\u094d\u092f\u092e\u093e\u0924\u094d\u0930\u0915\u094b \u0935\u093f\u0936\u0947\u0937 \u0932\u093e\u092d \u0932\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0915\u0939\u0940\u0902 \u0915\u094b\u0908 \u092d\u0940 \u0935\u094d\u092f\u093e\u0927\u093f\u0917\u094d\u0930\u0938\u094d\u0924 \u092e\u0930\u0923\u093e\u0938\u0928\u094d\u0928 \u0935\u094d\u092f\u0915\u094d\u0924\u093f \u0939\u094b \u0924\u094b \u0909\u0938\u0915\u0947 \u0907\u0937\u094d\u091f\u0915\u0947 \u091a\u093f\u0924\u094d\u0930 \u092f\u093e \u092e\u0942\u0930\u094d\u0924\u093f\u0915\u094b \u0909\u0938\u0947 \u0926\u093f\u0916\u093e\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u091c\u0948\u0938\u0940 \u0909\u0938\u0915\u0940 \u0909\u092a\u093e\u0938\u0928\u093e \u0939\u0948 \u0914\u0930 \u091c\u093f\u0938 \u092d\u0917\u0935\u0928\u094d\u0928\u093e\u092e\u092e\u0947\u0902 \u0909\u0938\u0915\u0940 \u0930\u0941\u091a\u093f \u0939\u094b \u091c\u093f\u0938\u0915\u093e \u0935\u0939 \u091c\u092a \u0915\u0930\u0924\u093e \u0939\u094b \u0935\u0939\u0940 \u092d\u0917\u0935\u0928\u094d\u0928\u093e\u092e \u0909\u0938\u0915\u094b \u0938\u0941\u0928\u093e\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u091c\u093f\u0938 \u0938\u094d\u0935\u0930\u0942\u092a\u092e\u0947\u0902 \u0909\u0938\u0915\u0940 \u0936\u094d\u0930\u0926\u094d\u0927\u093e \u0914\u0930 \u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0939\u094b \u0909\u0938\u0915\u0940 \u092f\u093e\u0926 \u0926\u093f\u0932\u093e\u0928\u0940 \u091a\u093e\u0939\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092e\u0939\u093f\u092e\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u0917\u0940\u0924\u093e\u0915\u0947 \u0936\u094d\u0932\u094b\u0915 \u0938\u0941\u0928\u093e\u0928\u0947 \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0905\u0917\u0930 \u0935\u0939 \u092c\u0947\u0939\u094b\u0936 \u0939\u094b \u091c\u093e\u092f \u0924\u094b \u0909\u0938\u0915\u0947 \u092a\u093e\u0938 \u092d\u0917\u0935\u0928\u094d\u0928\u093e\u092e\u0915\u093e \u091c\u092a\u0915\u0940\u0930\u094d\u0924\u0928 \u0915\u0930\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u091c\u093f\u0938\u0938\u0947 \u0909\u0938 \u092e\u0930\u0923\u093e\u0938\u0928\u094d\u0928 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0915\u0947 \u0938\u093e\u092e\u0928\u0947 \u092d\u0917\u0935\u0924\u094d\u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940 \u0935\u093e\u092f\u0941\u092e\u0923\u094d\u0921\u0932 \u092c\u0928\u093e \u0930\u0939\u0947\u0964 \u092d\u0917\u0935\u0924\u094d\u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940 \u0935\u093e\u092f\u0941\u092e\u0923\u094d\u0921\u0932 \u0930\u0939\u0928\u0947\u0938\u0947 \u0935\u0939\u093e\u0901 \u092f\u092e\u0930\u093e\u091c\u0915\u0947 \u0926\u0942\u0924 \u0928\u0939\u0940\u0902 \u0906 \u0938\u0915\u0924\u0947\u0964 \u0905\u091c\u093e\u092e\u093f\u0932\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092e\u0943\u0924\u094d\u092f\u0941\u0915\u0947 \u0938\u092e\u092f \u0928\u093e\u0930\u093e\u092f\u0923 \u0928\u093e\u092e\u0915\u093e \u0909\u091a\u094d\u091a\u093e\u0930\u0923 \u0915\u0930\u0928\u0947\u0938\u0947,\u0935\u0939\u093e\u0901 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u092a\u093e\u0930\u094d\u0937\u0926 \u0906 \u0917\u092f\u0947 \u0914\u0930 \u092f\u092e\u0926\u0942\u0924 \u092d\u093e\u0917\u0915\u0930 \u092f\u092e\u0930\u093e\u091c\u0915\u0947 \u092a\u093e\u0938\u092e\u0947\u0902 \u0917\u092f\u0947 \u0924\u094b \u092f\u092e\u0930\u093e\u091c\u0928\u0947 \u0905\u092a\u0928\u0947 \u0926\u0942\u0924\u094b\u0902\u0938\u0947 \u0915\u0939\u093e \u0915\u093f \u091c\u0939\u093e\u0901 \u092d\u0917\u0935\u0928\u094d\u0928\u093e\u092e\u0915\u093e \u091c\u092a \u0915\u0940\u0930\u094d\u0924\u0928 \u0915\u0925\u093e \u0906\u0926\u093f \u0939\u094b\u0924\u0947 \u0939\u094b\u0902 \u0935\u0939\u093e\u0901 \u0924\u0941\u092e\u0932\u094b\u0917 \u0915\u092d\u0940 \u092e\u0924 \u091c\u093e\u0928\u093e \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0939\u093e\u0901 \u0939\u092e\u093e\u0930\u093e \u0930\u093e\u091c\u094d\u092f \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0910\u0938\u093e \u0915\u0939 \u0915\u0930 \u092f\u092e\u0930\u093e\u091c\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0915\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u0915\u094d\u0937\u092e\u093e \u092e\u093e\u0901\u0917\u0940 \u0915\u093f \u092e\u0947\u0930\u0947 \u0926\u0942\u0924\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u091c\u094b \u0905\u092a\u0930\u093e\u0927 \u0939\u0941\u0906 \u0939\u0948 \u0909\u0938\u0915\u094b \u0906\u092a \u0915\u094d\u0937\u092e\u093e \u0915\u0930\u0947\u0902\u0964 \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0938\u094d\u092e\u0930\u0923\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0909\u0938\u0928\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u091c\u094b \u0938\u094d\u0935\u0930\u0942\u092a \u092e\u093e\u0928 \u0930\u0916\u093e \u0939\u0948 \u0909\u0938\u0915\u0940 \u092f\u093e\u0926 \u0906 \u091c\u093e\u092f \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938\u0928\u0947 \u092a\u0939\u0932\u0947 \u0930\u093e\u092e \u0915\u0943\u0937\u094d\u0923 \u0935\u093f\u0937\u094d\u0923\u0941 \u0936\u093f\u0935 \u0936\u0915\u094d\u0924\u093f \u0917\u0923\u0947\u0936 \u0938\u0942\u0930\u094d\u092f \u0938\u0930\u094d\u0935\u0935\u094d\u092f\u093e\u092a\u0915 \u0935\u093f\u0936\u094d\u0935\u0930\u0942\u092a \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0906\u0926\u093f \u092e\u0947\u0902\u0938\u0947 \u091c\u093f\u0938 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u094b \u092e\u093e\u0928 \u0930\u0916\u093e \u0939\u0948 \u0909\u0938 \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u0947 \u0928\u093e\u092e \u0930\u0942\u092a \u0932\u0940\u0932\u093e \u0927\u093e\u092e \u0917\u0941\u0923 \u092a\u094d\u0930\u092d\u093e\u0935 \u0906\u0926\u093f\u0915\u0940 \u092f\u093e\u0926 \u0906 \u091c\u093e\u092f\u0964 \u0909\u0938\u0915\u0940 \u092f\u093e\u0926 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0936\u0930\u0940\u0930\u0915\u094b \u091b\u094b\u0921\u093c\u0915\u0930 \u091c\u093e\u0928\u0947\u0938\u0947 \u0935\u0939 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u0939\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092f\u093e\u0926 \u0906\u0928\u0947\u0938\u0947 \u092e\u0948\u0902 \u0936\u0930\u0940\u0930 \u0939\u0942\u0901 \u0914\u0930 \u0936\u0930\u0940\u0930 \u092e\u0947\u0930\u093e \u0939\u0948, \u0907\u0938\u0915\u0940 \u092f\u093e\u0926 \u0928\u0939\u0940\u0902 \u0930\u0939\u0924\u0940 \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0915\u0947\u0935\u0932 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u0939\u0940 \u092f\u093e\u0926 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0936\u0930\u0940\u0930 \u091b\u0942\u091f \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0909\u0938\u0915\u0947 \u0932\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u0915\u0947 \u0905\u0924\u093f\u0930\u093f\u0915\u094d\u0924 \u0914\u0930 \u0915\u094b\u0908 \u0917\u0941\u0902\u091c\u093e\u0907\u0936 \u0939\u0940 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\n\u092f\u0939\u093e\u0901 \u0936\u0919\u094d\u0915\u093e \u0939\u094b\u0924\u0940 \u0939\u0948 \u0915\u093f \u091c\u093f\u0938 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0928\u0947 \u0909\u092e\u094d\u0930\u092d\u0930\u092e\u0947\u0902 \u092d\u091c\u0928\u0938\u094d\u092e\u0930\u0923 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e \u0915\u094b\u0908 \u0938\u093e\u0927\u0928 \u0928\u0939\u0940\u0902 \u0915\u093f\u092f\u093e \u0938\u0930\u094d\u0935\u0925\u093e \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u0935\u093f\u092e\u0941\u0916 \u0930\u0939\u093e \u0909\u0938\u0915\u094b \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0948\u0938\u0947 \u0939\u094b\u0917\u093e \u0914\u0930 \u0909\u0938\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0915\u0948\u0938\u0947 \u0939\u094b\u0917\u093e \u0907\u0938\u0915\u093e \u0938\u092e\u093e\u0927\u093e\u0928 \u0939\u0948 \u0915\u093f \u0905\u0928\u094d\u0924\u0938\u092e\u092f\u092e\u0947\u0902 \u0909\u0938 \u092a\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0915\u094b\u0908 \u0935\u093f\u0936\u0947\u0937 \u0915\u0943\u092a\u093e \u0939\u094b \u091c\u093e\u092f \u0905\u0925\u0935\u093e \u0909\u0938\u0915\u094b \u0915\u093f\u0938\u0940 \u0938\u0928\u094d\u0924\u0915\u0947 \u0926\u0930\u094d\u0936\u0928 \u0939\u094b \u091c\u093e\u092f\u0901 \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0939\u094b\u0915\u0930 \u0909\u0938\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0909\u0938\u0915\u0947 \u0915\u0932\u094d\u092f\u093e\u0923\u0915\u0947 \u0932\u093f\u092f\u0947 \u0915\u094b\u0908 \u0938\u093e\u0927\u0915 \u0909\u0938\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0928\u093e\u092e \u0932\u0940\u0932\u093e \u091a\u0930\u093f\u0924\u094d\u0930 \u0938\u0941\u0928\u093e\u092f\u0947 \u092a\u0926 \u0917\u093e\u092f\u0947 \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0909\u0938\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0905\u0917\u0930 \u092e\u0930\u0923\u093e\u0938\u0928\u094d\u0928 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0915\u094b \u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u0930\u0941\u091a\u093f \u0939\u094b \u0924\u094b \u0909\u0938\u0915\u094b \u0917\u0940\u0924\u093e\u0915\u093e \u0906\u0920\u0935\u093e\u0901 \u0905\u0927\u094d\u092f\u093e\u092f \u0938\u0941\u0928\u093e\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0907\u0938 \u0905\u0927\u094d\u092f\u093e\u092f\u092e\u0947\u0902 \u091c\u0940\u0935\u0915\u0940 \u0938\u0926\u094d\u0917\u0924\u093f\u0915\u093e \u0935\u093f\u0936\u0947\u0937\u0924\u093e \u0938\u0947 \u0935\u0930\u094d\u0923\u0928 \u0906\u092f\u093e \u0939\u0948\u0964 \u0907\u0938\u0915\u094b \u0938\u0941\u0928\u0928\u0947\u0938\u0947 \u0909\u0938\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u092e\u0943\u0924\u093f \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0939\u0940 \u0905\u0902\u0936 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0909\u0938\u0915\u093e \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0947 \u0938\u093e\u0925 \u0938\u094d\u0935\u0924\u0903 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0939\u0948 \u0939\u0940\u0964 \u0905\u0917\u0930 \u0905\u092f\u094b\u0927\u094d\u092f\u093e \u092e\u0925\u0941\u0930\u093e \u0939\u0930\u093f\u0926\u094d\u0935\u093e\u0930 \u0915\u093e\u0936\u0940 \u0906\u0926\u093f \u0915\u093f\u0938\u0940 \u0924\u0940\u0930\u094d\u0925\u0938\u094d\u0925\u0932\u092e\u0947\u0902 \u0909\u0938\u0915\u0947 \u092a\u094d\u0930\u093e\u0923 \u091b\u0942\u091f \u091c\u093e\u092f\u0901 \u0924\u094b \u0909\u0938 \u0924\u0940\u0930\u094d\u0925\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935 \u0938\u0947 \u0909\u0938\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u092e\u0943\u0924\u093f \u0939\u094b \u091c\u093e\u092f\u0917\u0940\u0964 \u0910\u0938\u0947 \u0939\u0940 \u091c\u093f\u0938 \u091c\u0917\u0939 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0928\u093e\u092e\u0915\u093e \u091c\u092a \u0915\u0940\u0930\u094d\u0924\u0928 \u0915\u0925\u093e \u0938\u0924\u094d\u0938\u0902\u0917 \u0906\u0926\u093f \u0939\u094b\u0924\u093e \u0939\u0948 \u0909\u0938 \u091c\u0917\u0939 \u0909\u0938\u0915\u0940 \u092e\u0943\u0924\u094d\u092f\u0941 \u0939\u094b \u091c\u093e\u092f \u0924\u094b \u0935\u0939\u093e\u0901\u0915\u0947 \u092a\u0935\u093f\u0924\u094d\u0930 \u0935\u093e\u092f\u0941\u092e\u0923\u094d\u0921\u0932\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935 \u0938\u0947 \u0909\u0938\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u092e\u0943\u0924\u093f \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948\u0964 \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0915\u094b\u0908 \u092d\u092f\u0902\u0915\u0930 \u0938\u094d\u0925\u093f\u0924\u093f \u0906\u0928\u0947\u0938\u0947 \u092d\u092f\u092d\u0940\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u092f\u093e\u0926 \u0906 \u0938\u0915\u0924\u0940 \u0939\u0948\u0964 \u0936\u0930\u0940\u0930 \u091b\u0942\u091f\u0924\u0947 \u0938\u092e\u092f \u0936\u0930\u0940\u0930 \u0915\u0941\u091f\u0941\u092e\u094d\u092c \u0930\u0941\u092a\u092f\u0947 \u0906\u0926\u093f\u0915\u0940 \u0906\u0936\u093e\u092e\u092e\u0924\u093e \u091b\u0942\u091f \u091c\u093e\u092f \u0914\u0930 \u092f\u0939 \u092d\u093e\u0935 \u0939\u094b \u091c\u093e\u092f \u0915\u093f \u0939\u0947 \u0928\u093e\u0925 \u0906\u092a\u0915\u0947 \u092c\u093f\u0928\u093e \u092e\u0947\u0930\u093e \u0915\u094b\u0908 \u0928\u0939\u0940\u0902 \u0939\u0948 \u0915\u0947\u0935\u0932 \u0906\u092a \u0939\u0940 \u092e\u0947\u0930\u0947 \u0939\u0948\u0902 \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0938\u094d\u092e\u0943\u0924\u093f \u0939\u094b\u0928\u0947 \u0938\u0947 \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0910\u0938\u0947 \u0939\u0940 \u0915\u093f\u0938\u0940 \u0915\u093e\u0930\u0923\u0938\u0947 \u0905\u091a\u093e\u0928\u0915 \u0905\u092a\u0928\u0947 \u0915\u0932\u094d\u092f\u093e\u0923\u0915\u093e \u092d\u093e\u0935 \u092c\u0928 \u091c\u093e\u092f \u0924\u094b \u092d\u0940 \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u0910\u0938\u0947 \u0939\u0940 \u0915\u094b\u0908 \u0938\u093e\u0927\u0915 \u0915\u093f\u0938\u0940 \u092a\u094d\u0930\u093e\u0923\u0940 \u091c\u0940\u0935\u091c\u0928\u094d\u0924\u0941\u0915\u0947 \u092e\u0943\u0924\u094d\u092f\u0941\u0938\u092e\u092f\u092e\u0947\u0902 \u0909\u0938\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u092f \u0907\u0938 \u092d\u093e\u0935 \u0938\u0947 \u0909\u0938\u0915\u094b \u092d\u0917\u0935\u0928\u094d\u0928\u093e\u092e \u0938\u0941\u0928\u093e\u0924\u093e \u0939\u0948 \u0924\u094b \u0909\u0938 \u092d\u0917\u0935\u0928\u094d\u0928\u093e\u092e\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935 \u0938\u0947 \u0909\u0938 \u092a\u094d\u0930\u093e\u0923\u0940\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u094b\u0902\u092e\u0947\u0902 \u0924\u094b \u0938\u0928\u094d\u0924\u092e\u0939\u093e\u092a\u0941\u0930\u0941\u0937\u094b\u0902\u0915\u0947 \u092a\u094d\u0930\u092d\u093e\u0935\u0915\u0940 \u0935\u093f\u091a\u093f\u0924\u094d\u0930 \u092c\u093e\u0924\u0947\u0902 \u0906\u0924\u0940 \u0939\u0948\u0902 \u0915\u093f \u092f\u0926\u093f \u0938\u0928\u094d\u0924\u092e\u0939\u093e\u092a\u0941\u0930\u0941\u0937 \u0915\u093f\u0938\u0940 \u092e\u0930\u0923\u093e\u0938\u0928\u094d\u0928 \u0935\u094d\u092f\u0915\u094d\u0924\u093f\u0915\u094b \u0926\u0947\u0916 \u0932\u0947\u0902 \u0905\u0925\u0935\u093e \u0909\u0938\u0915\u0947 \u092e\u0943\u0924 \u0936\u0930\u0940\u0930(\u092e\u0941\u0930\u094d\u0926\u0947) \u0915\u094b \u0926\u0947\u0916 \u0932\u0947\u0902 \u0905\u0925\u0935\u093e \u0909\u0938\u0915\u0940 \u091a\u093f\u0924\u093e\u0915\u0947 \u0927\u0941\u090f\u0901\u0915\u094b \u0926\u0947\u0916 \u0932\u0947\u0902 \u0905\u0925\u0935\u093e \u091a\u093f\u0924\u093e\u0915\u0940 \u092d\u0938\u094d\u092e\u0915\u094b \u0926\u0947\u0916 \u0932\u0947\u0902 \u0924\u094b \u092d\u0940 \u0909\u0938 \u091c\u0940\u0935\u0915\u093e \u0915\u0932\u094d\u092f\u093e\u0923 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 "},{text:"\u092f\u0902 \u092f\u0902 \u0935\u093e\u092a\u093f \u0938\u094d\u092e\u0930\u0928\u094d\u092d\u093e\u0935\u0902 \u0924\u094d\u092f\u091c\u0924\u094d\u092f\u0928\u094d\u0924\u0947 \u0915\u0932\u0947\u0935\u0930\u092e\u094d\u0964\n\u0924\u0902 \u0924\u092e\u0947\u0935\u0948\u0924\u093f \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u0938\u0926\u093e \u0924\u0926\u094d\u092d\u093e\u0935\u092d\u093e\u0935\u093f\u0924\u0903\u0964\u09648.6\u0964\u0964",translation:"\u0964\u09648.6\u0964\u0964 \u0939\u0947 \u0915\u0941\u0928\u094d\u0924\u0940\u092a\u0941\u0924\u094d\u0930 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u092e\u0928\u0941\u0937\u094d\u092f \u0905\u0928\u094d\u0924\u0915\u093e\u0932 \u092e\u0947\u0902 \u091c\u093f\u0938-\u091c\u093f\u0938 \u092d\u0940 \u092d\u093e\u0935\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0924\u093e \u0939\u0948 \u0935\u0939 \u0909\u0938 (\u0905\u0928\u094d\u0924\u0915\u093e\u0932\u0915\u0947) \u092d\u093e\u0935 \u0938\u0947 \u0938\u0926\u093e \u092d\u093e\u0935\u093f\u0924 \u0939\u094b\u0924\u093e \u0939\u0941\u0906 \u0909\u0938-\u0909\u0938\u0915\u094b \u0939\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938-\u0909\u0938 \u092f\u094b\u0928\u093f\u092e\u0947\u0902 \u0939\u0940 \u091a\u0932\u093e \u091c\u093e\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.6\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092f\u0902 \u092f\u0902 \u0935\u093e\u092a\u093f \u0938\u094d\u092e\u0930\u0928\u094d\u092d\u093e\u0935\u0902 \u09f7\u09f7. \u0938\u0926\u093e \u0924\u0926\u094d\u092d\u093e\u0935\u092d\u093e\u0935\u093f\u0924\u0903',\u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0907\u0938 \u0928\u093f\u092f\u092e\u092e\u0947\u0902 \u0926\u092f\u093e\u0938\u0947 \u092d\u0930\u0940 \u0939\u0941\u0908 \u090f\u0915 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u092c\u093e\u0924 \u092c\u0924\u093e\u092f\u0940 \u0939\u0948 \u0915\u093f \u0905\u0928\u094d\u0924\u093f\u092e \u091a\u093f\u0928\u094d\u0924\u0928\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u094b \u0909\u0938\u0909\u0938 \u092f\u094b\u0928\u093f\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948 \u091c\u092c \u092f\u0939 \u0928\u093f\u092f\u092e \u0939\u0948 \u0924\u094b \u092e\u0947\u0930\u0940 \u0938\u094d\u092e\u0943\u0924\u093f\u0938\u0947 \u092e\u0947\u0930\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0917\u0940 \u0939\u0940 \u092a\u0930\u092e \u0926\u092f\u093e\u0932\u0941 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0905\u092a\u0928\u0947 \u0932\u093f\u092f\u0947 \u0905\u0932\u0917 \u0915\u094b\u0908 \u0935\u093f\u0936\u0947\u0937 \u0928\u093f\u092f\u092e \u0928\u0939\u0940\u0902 \u092c\u0924\u093e\u092f\u093e \u0939\u0948 \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u0928\u093f\u092f\u092e\u092e\u0947\u0902 \u0939\u0940 \u0905\u092a\u0928\u0947\u0915\u094b \u0936\u093e\u092e\u093f\u0932 \u0915\u0930 \u0926\u093f\u092f\u093e \u0939\u0948\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0926\u092f\u093e\u0915\u0940 \u092f\u0939 \u0915\u093f\u0924\u0928\u0940 \u0935\u093f\u0932\u0915\u094d\u0937\u0923\u0924\u093e \u0939\u0948 \u0915\u093f \u091c\u093f\u0924\u0928\u0947 \u092e\u0942\u0932\u094d\u092f\u092e\u0947\u0902 \u0915\u0941\u0924\u094d\u0924\u0947\u0915\u0940 \u092f\u094b\u0928\u093f \u092e\u093f\u0932\u0947 \u0909\u0924\u0928\u0947 \u0939\u0940 \u092e\u0942\u0932\u094d\u092f\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d \u092e\u093f\u0932 \u091c\u093e\u092f\u0901\xa0"},{text:"\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u0915\u093e\u0932\u0947\u0937\u0941 \u092e\u093e\u092e\u0928\u0941\u0938\u094d\u092e\u0930 \u092f\u0941\u0927\u094d\u092f \u091a\u0964\n\u092e\u092f\u094d\u092f\u0930\u094d\u092a\u093f\u0924\u092e\u0928\u094b\u092c\u0941\u0926\u094d\u0927\u093f\u0930\u094d\u092e\u093e\u092e\u0947\u0935\u0948\u0937\u094d\u092f\u0938\u094d\u092f\u0938\u0902\u0936\u092f\u092e\u094d\u0964\u09648.7\u0964\u0964",translation:"\u0964\u09648.7\u0964\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0924\u0942 \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u092e\u0947\u0930\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930 \u0914\u0930 \u092f\u0941\u0926\u094d\u0927 \u092d\u0940 \u0915\u0930\u0964 \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u092e\u0928 \u0914\u0930 \u092c\u0941\u0926\u094d\u0927\u093f \u0905\u0930\u094d\u092a\u093f\u0924 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u093e \u0924\u0942 \u0928\u093f\u0903\u0938\u0928\u094d\u0926\u0947\u0939 \u092e\u0947\u0930\u0947 \u0915\u094b \u0939\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0917\u093e\u0964 ",commentary:"\u0964\u09648.7\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u0915\u093e\u0932\u0947\u0937\u0941 \u092e\u093e\u092e\u0928\u0941\u0938\u094d\u092e\u0930 \u092f\u0941\u0927\u094d\u092f \u091a',\u092f\u0939\u093e\u0901 '\u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u0915\u093e\u0932\u0947\u0937\u0941' \u092a\u0926\u094b\u0902\u0915\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0915\u0947\u0935\u0932 \u0938\u094d\u092e\u0930\u0923\u0938\u0947 \u0939\u0940 \u0939\u0948 \u092f\u0941\u0926\u094d\u0927 \u0938\u0947 \u0928\u0939\u0940\u0902 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u092f\u0941\u0926\u094d\u0927 \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0939\u094b \u0939\u0940 \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e\u0964 \u0915\u094b\u0908 \u092d\u0940 \u0915\u094d\u0930\u093f\u092f\u093e \u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0928\u0939\u0940\u0902 \u0939\u094b \u0938\u0915\u0924\u0940 \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u0938\u092e\u092f\u0938\u092e\u092f\u092a\u0930 \u0939\u0940 \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092a\u094d\u0930\u0924\u094d\u092f\u0947\u0915 \u0915\u094d\u0930\u093f\u092f\u093e\u0915\u093e \u0906\u0930\u092e\u094d\u092d \u0914\u0930 \u0938\u092e\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948, \u092f\u0939 \u092c\u093e\u0924 \u0938\u092c\u0915\u0947 \u0905\u0928\u0941\u092d\u0935\u0915\u0940 \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092d\u0917\u0935\u0924\u094d\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u093e \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f \u0939\u094b\u0928\u0947 \u0938\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u093e \u0938\u094d\u092e\u0930\u0923 \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u0939\u094b\u0924\u093e \u0939\u0948 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f\u0915\u0940 \u091c\u093e\u0917\u0943\u0924\u093f \u0939\u0930\u0926\u092e \u0930\u0939\u0924\u0940 \u0939\u0948\u0964\u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u0915\u0939\u0928\u0947 \u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092a\u094d\u0930\u0924\u094d\u092f\u0947\u0915 \u0915\u093e\u0930\u094d\u092f\u092e\u0947\u0902 \u0938\u092e\u092f\u0915\u093e \u0935\u093f\u092d\u093e\u0917 \u0939\u094b\u0924\u093e \u0939\u0948 \u091c\u0948\u0938\u0947, \u092f\u0939 \u0938\u092e\u092f \u0938\u094b\u0928\u0947\u0915\u093e \u0914\u0930 \u092f\u0939 \u0938\u092e\u092f \u091c\u0917\u0928\u0947\u0915\u093e \u0939\u0948 \u092f\u0939 \u0938\u092e\u092f \u0928\u093f\u0924\u094d\u092f\u0915\u0930\u094d\u092e\u0915\u093e \u0939\u0948 \u092f\u0939 \u0938\u092e\u092f \u091c\u0940\u0935\u093f\u0915\u093e\u0915\u0947 \u0932\u093f\u092f\u0947 \u0915\u093e\u092e\u0927\u0902\u0927\u093e \u0915\u0930\u0928\u0947\u0915\u093e \u0939\u0948 \u092f\u0939 \u0938\u092e\u092f \u092d\u094b\u091c\u0928\u0915\u093e \u0939\u0948 \u0906\u0926\u093f\u0906\u0926\u093f\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0938\u094d\u092e\u0930\u0923\u092e\u0947\u0902 \u0938\u092e\u092f\u0915\u093e \u0935\u093f\u092d\u093e\u0917 \u0928\u0939\u0940\u0902 \u0939\u094b\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u0924\u094b \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u0939\u0940 \u092f\u093e\u0926 \u0930\u0916\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964,"},{text:"\u0905\u092d\u094d\u092f\u093e\u0938\u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u0947\u0928 \u091a\u0947\u0924\u0938\u093e \u0928\u093e\u0928\u094d\u092f\u0917\u093e\u092e\u093f\u0928\u093e\u0964\n\u092a\u0930\u092e\u0902 \u092a\u0941\u0930\u0941\u0937\u0902 \u0926\u093f\u0935\u094d\u092f\u0902 \u092f\u093e\u0924\u093f \u092a\u093e\u0930\u094d\u0925\u093e\u0928\u0941\u091a\u093f\u0928\u094d\u0924\u092f\u0928\u094d\u0964\u09648.8\u0964\u0964",translation:"\u0964\u09648.8\u0964\u0964 \u0939\u0947 \u092a\u0943\u0925\u093e\u0928\u0928\u094d\u0926\u0928 ! \u0905\u092d\u094d\u092f\u093e\u0938\u092f\u094b\u0917\u0938\u0947 \u092f\u0941\u0915\u094d\u0924 \u0914\u0930 \u0905\u0928\u094d\u092f\u0915\u093e \u091a\u093f\u0928\u094d\u0924\u0928 \u0928 \u0915\u0930\u0928\u0947 \u0935\u093e\u0932\u0947 \u091a\u093f\u0924\u094d\u0924\u0938\u0947 \u092a\u0930\u092e \u0926\u093f\u0935\u094d\u092f \u092a\u0941\u0930\u0941\u0937\u0915\u093e \u091a\u093f\u0928\u094d\u0924\u0928 \u0915\u0930\u0924\u093e \u0939\u0941\u0906 (\u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0928\u0947\u0935\u093e\u0932\u093e \u092e\u0928\u0941\u0937\u094d\u092f) \u0909\u0938\u0940\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.8\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,[\u0938\u093e\u0924\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0905\u091f\u094d\u0920\u093e\u0908\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u094b \u0938\u0917\u0941\u0923\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0925\u093e \u0909\u0938\u0940\u0915\u094b \u092f\u0939\u093e\u0901 \u0906\u0920\u0935\u0947\u0902 \u0928\u0935\u0947\u0902 \u0914\u0930 \u0926\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0935\u093f\u0938\u094d\u0924\u093e\u0930\u0938\u0947 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964]\n'\u0905\u092d\u094d\u092f\u093e\u0938\u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u0947\u0928', \u0907\u0938 \u092a\u0926\u092e\u0947\u0902 \u0905\u092d\u094d\u092f\u093e\u0938 \u0914\u0930 \u092f\u094b\u0917, \u092f\u0947 \u0926\u094b \u0936\u092c\u094d\u0926 \u0906\u092f\u0947 \u0939\u0948\u0902\u0964 \u0938\u0902\u0938\u093e\u0930\u0938\u0947 \u092e\u0928 \u0939\u091f\u093e\u0915\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u092c\u093e\u0930\u092c\u093e\u0930 \u092e\u0928 \u0932\u0917\u093e\u0928\u0947\u0915\u093e \u0928\u093e\u092e \u0905\u092d\u094d\u092f\u093e\u0938 \u0939\u0948 \u0914\u0930 \u0938\u092e\u0924\u093e\u0915\u093e \u0928\u093e\u092e \u092f\u094b\u0917 \u0939\u0948, '\u0938\u092e\u0924\u094d\u0935\u0902 \u092f\u094b\u0917 \u0909\u091a\u094d\u092f\u0924\u0947' (\u0917\u0940\u0924\u093e 2\u0964 48)\u0964 \u0905\u092d\u094d\u092f\u093e\u0938\u092e\u0947\u0902 \u092e\u0928 \u0932\u0917\u0928\u0947\u0938\u0947 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e \u0939\u094b\u0924\u0940 \u0939\u0948 \u0914\u0930 \u092e\u0928 \u0928 \u0932\u0917\u0928\u0947\u0938\u0947 \u0916\u093f\u0928\u094d\u0928\u0924\u093e \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u092f\u0939 \u0905\u092d\u094d\u092f\u093e\u0938 \u0924\u094b \u0939\u0948 \u092a\u0930 \u0905\u092d\u094d\u092f\u093e\u0938\u092f\u094b\u0917 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0905\u092d\u094d\u092f\u093e\u0938\u092f\u094b\u0917 \u0924\u092d\u0940 \u0939\u094b\u0917\u093e \u091c\u092c \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e \u0914\u0930 \u0916\u093f\u0928\u094d\u0928\u0924\u093e, \u0926\u094b\u0928\u094b\u0902 \u0939\u0940 \u0928 \u0939\u094b\u0902\u0964 \u0905\u0917\u0930 \u091a\u093f\u0924\u094d\u0924\u092e\u0947\u0902 \u092a\u094d\u0930\u0938\u0928\u094d\u0928\u0924\u093e \u0914\u0930 \u0916\u093f\u0928\u094d\u0928\u0924\u093e \u0939\u094b \u092d\u0940 \u091c\u093e\u092f\u0901 \u0924\u094b \u092d\u0940 \u0909\u0928\u0915\u094b \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928 \u0926\u0947 \u0915\u0947\u0935\u0932 \u0905\u092a\u0928\u0947 \u0932\u0915\u094d\u0937\u094d\u092f\u0915\u094b \u0939\u0940 \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0926\u0947\u0964 \u0905\u092a\u0928\u0947 \u0932\u0915\u094d\u0937\u094d\u092f\u092a\u0930 \u0926\u0943\u0922\u093c \u0930\u0939\u0928\u093e \u092d\u0940 \u092f\u094b\u0917 \u0939\u0948\u0964 \u0910\u0938\u0947 \u092f\u094b\u0917\u0938\u0947 \u092f\u0941\u0915\u094d\u0924 \u091a\u093f\u0924\u094d\u0924 \u0939\u094b\u0964"},{text:"\u0915\u0935\u093f\u0902 \u092a\u0941\u0930\u093e\u0923\u092e\u0928\u0941\u0936\u093e\u0938\u093f\u0924\u093e\u0930\n\u092e\u0923\u094b\u0930\u0923\u0940\u092f\u093e\u0902\u0938\u092e\u0928\u0941\u0938\u094d\u092e\u0930\u0947\u0926\u094d\u092f\u0903\u0964\n\u0938\u0930\u094d\u0935\u0938\u094d\u092f \u0927\u093e\u0924\u093e\u0930\u092e\u091a\u093f\u0928\u094d\u0924\u094d\u092f\u0930\u0942\u092a\n\u092e\u093e\u0926\u093f\u0924\u094d\u092f\u0935\u0930\u094d\u0923\u0902 \u0924\u092e\u0938\u0903 \u092a\u0930\u0938\u094d\u0924\u093e\u0924\u094d\u0964\u09648.9\u0964\u0964",translation:"\u0964\u09648.9\u0964\u0964 \u091c\u094b \u0938\u0930\u094d\u0935\u091c\u094d\u091e, \u092a\u0941\u0930\u093e\u0923, \u0936\u093e\u0938\u0928 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u093e, \u0938\u0942\u0915\u094d\u0937\u094d\u092e-\u0938\u0947-\u0938\u0942\u0915\u094d\u0937\u094d\u092e, \u0938\u092c\u0915\u093e \u0927\u093e\u0930\u0923-\u092a\u094b\u0937\u0923 \u0915\u0930\u0928\u0947\u0935\u093e\u0932\u093e, \u0905\u091c\u094d\u091e\u093e\u0928\u0938\u0947 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u092a\u0930\u0947, \u0938\u0942\u0930\u094d\u092f\u0915\u0940 \u0924\u0930\u0939 \u092a\u094d\u0930\u0915\u093e\u0936\u0938\u094d\u0935\u0930\u0942\u092a, \u0910\u0938\u0947 \u0905\u091a\u093f\u0928\u094d\u0924\u094d\u092f \u0938\u094d\u0935\u0930\u0942\u092a\u0915\u093e \u091a\u093f\u0928\u094d\u0924\u0928 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.9\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0915\u0935\u093f\u092e\u094d', \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u094b \u0914\u0930 \u0909\u0928\u0915\u0947 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0936\u0941\u092d\u093e\u0936\u0941\u092d \u0915\u0930\u094d\u092e\u094b\u0902\u0915\u094b \u091c\u093e\u0928\u0928\u0947 \u0935\u093e\u0932\u0947 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0909\u0928 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0928\u093e\u092e '\u0915\u0935\u093f' \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u0930\u094d\u0935\u091c\u094d\u091e \u0939\u0948\u0964"},{text:"\u092a\u094d\u0930\u092f\u093e\u0923\u0915\u093e\u0932\u0947 \u092e\u0928\u0938\u093e\u093d\u091a\u0932\u0947\u0928\n\u092d\u0915\u094d\u0924\u094d\u092f\u093e \u092f\u0941\u0915\u094d\u0924\u094b \u092f\u094b\u0917\u092c\u0932\u0947\u0928 \u091a\u0948\u0935\u0964\n\u092d\u094d\u0930\u0941\u0935\u094b\u0930\u094d\u092e\u0927\u094d\u092f\u0947 \u092a\u094d\u0930\u093e\u0923\u092e\u093e\u0935\u0947\u0936\u094d\u092f \u0938\u092e\u094d\u092f\u0915\u094d\n\u0938 \u0924\u0902 \u092a\u0930\u0902 \u092a\u0941\u0930\u0941\u0937\u092e\u0941\u092a\u0948\u0924\u093f \u0926\u093f\u0935\u094d\u092f\u092e\u094d\u0964\u09648.10\u0964\u0964",translation:"\u0964\u09648.10\u0964\u0964 \u0935\u0939 \u092d\u0915\u094d\u0924\u093f\u092f\u0941\u0915\u094d\u0924 \u092e\u0928\u0941\u0937\u094d\u092f \u0905\u0928\u094d\u0924\u0938\u092e\u092f\u092e\u0947\u0902 \u0905\u091a\u0932 \u092e\u0928\u0938\u0947 \u0914\u0930 \u092f\u094b\u0917\u092c\u0932\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092d\u0943\u0915\u0941\u091f\u0940\u0915\u0947 \u092e\u0927\u094d\u092f \u092e\u0947\u0902 \u092a\u094d\u0930\u093e\u0923\u094b\u0902\u0915\u094b \u0905\u091a\u094d\u091b\u0940 \u0924\u0930\u0939 \u0938\u0947 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0915\u0930\u0915\u0947 (\u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0928\u0947\u092a\u0930) \u0909\u0938 \u092a\u0930\u092e \u0926\u093f\u0935\u094d\u092f \u092a\u0941\u0930\u0941\u0937\u0915\u094b \u0939\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.10\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,\u092a\u094d\u0930\u092f\u093e\u0923\u0915\u093e\u0932\u0947 \u092e\u0928\u0938\u093e\u091a\u0932\u0947\u0928 \u09f7\u09f7. \u0938 \u0924\u0902 \u092a\u0930\u0902 \u092a\u0941\u0930\u0941\u0937\u092e\u0941\u092a\u0948\u0924\u093f \u0926\u093f\u0935\u094d\u092f\u092e\u094d,\u092f\u0939\u093e\u0901 \u092d\u0915\u094d\u0924\u093f \u0928\u093e\u092e \u092a\u094d\u0930\u093f\u092f\u0924\u093e\u0915\u093e \u0939\u0948; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0909\u0938 \u0924\u0924\u094d\u0924\u094d\u0935\u092e\u0947\u0902 \u092a\u094d\u0930\u093f\u092f\u0924\u093e (\u0906\u0915\u0930\u094d\u0937\u0923) \u0939\u094b\u0928\u0947 \u0938\u0947 \u0939\u0940 \u092e\u0928 \u0905\u091a\u0932 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0935\u0939 \u092d\u0915\u094d\u0924\u093f \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u094d\u0930\u093f\u092f\u0924\u093e \u0938\u094d\u0935\u092f\u0902\u0938\u0947 \u0939\u094b\u0924\u0940 \u0939\u0948, \u092e\u0928-\u092c\u0941\u0926\u094d\u0927\u093f \u0906\u0926\u093f\u0938\u0947 \u0928\u0939\u0940\u0902\u0964 \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0915\u0935\u093f, \u092a\u0941\u0930\u093e\u0923, \u0905\u0928\u0941\u0936\u093e\u0938\u093f\u0924\u093e \u0906\u0926\u093f \u0935\u093f\u0936\u0947\u0937\u0923\u094b\u0902\u0938\u0947 (\u092a\u0940\u091b\u0947\u0915\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902) \u0915\u0939\u0947 \u0939\u0941\u090f \u0938\u0917\u0941\u0923-\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u092d\u0915\u094d\u0924\u093f\u092f\u0941\u0915\u094d\u0924 \u092e\u0928\u0941\u0937\u094d\u092f \u0915\u093e \u092e\u0928 \u0938\u094d\u0925\u093f\u0930 \u0939\u094b \u091c\u093e\u0928\u093e \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u0917\u0941\u0923-\u0928\u093f\u0930\u093e\u0915\u093e\u0930-\u0938\u094d\u0935\u0930\u0942\u092a\u092e\u0947\u0902 \u0906\u0926\u0930\u092a\u0942\u0930\u094d\u0935\u0915 \u0926\u0943\u0922\u093c \u0939\u094b \u091c\u093e\u0928\u093e \u0939\u0940 \u092e\u0928\u0915\u093e \u0905\u091a\u0932 \u0939\u094b\u0928\u093e \u0939\u0948\u0964\u092a\u0939\u0932\u0947 \u092a\u094d\u0930\u093e\u0923\u093e\u092f\u093e\u092e\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092a\u094d\u0930\u093e\u0923\u094b\u0902\u0915\u094b \u0930\u094b\u0915\u0928\u0947\u0915\u093e \u091c\u094b \u0905\u0927\u093f\u0915\u093e\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u093f\u092f\u093e \u0939\u0948, \u0909\u0938\u0915\u093e \u0928\u093e\u092e '\u092f\u094b\u0917\u092c\u0932' \u0939\u0948\u0964 \u0909\u0938 \u092f\u094b\u0917\u092c\u0932\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0926\u094b\u0928\u094b\u0902 \u092d\u094d\u0930\u0941\u0935\u094b\u0902\u0915\u0947 \u092e\u0927\u094d\u092f\u092d\u093e\u0917\u092e\u0947\u0902 \u0938\u094d\u0925\u093f\u0924 \u091c\u094b \u0926\u094d\u0935\u093f\u0926\u0932 \u091a\u0915\u094d\u0930 \u0939\u0948, \u0909\u0938\u092e\u0947\u0902 \u0938\u094d\u0925\u093f\u0924 \u0938\u0941\u0937\u0941\u092e\u094d\u0923\u093e \u0928\u093e\u0921\u093c\u0940\u092e\u0947\u0902 \u092a\u094d\u0930\u093e\u0923\u094b\u0902 \u0915\u093e,\u0905\u091a\u094d\u091b\u0940 \u0924\u0930\u0939 \u0938\u0947 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0915\u0947 \u0935\u0939 (\u0936\u0931\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u0926\u0938\u0935\u0947\u0902 \u0926\u094d\u0935\u093e\u0930\u0938\u0947 \u0939\u094b\u0915\u0930) \u0926\u093f\u0935\u094d\u092f \u092a\u0930\u092e \u092a\u0941\u0930\u0941\u0937\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964"},{text:"\u092f\u0926\u0915\u094d\u0937\u0930\u0902 \u0935\u0947\u0926\u0935\u093f\u0926\u094b \u0935\u0926\u0928\u094d\u0924\u093f\n\u0935\u093f\u0936\u0928\u094d\u0924\u093f \u092f\u0926\u094d\u092f\u0924\u092f\u094b \u0935\u0940\u0924\u0930\u093e\u0917\u093e\u0903\u0964\n\u092f\u0926\u093f\u091a\u094d\u091b\u0928\u094d\u0924\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u091a\u0930\u094d\u092f\u0902 \u091a\u0930\u0928\u094d\u0924\u093f\n\u0924\u0924\u094d\u0924\u0947 \u092a\u0926\u0902 \u0938\u0902\u0917\u094d\u0930\u0939\u0947\u0923 \u092a\u094d\u0930\u0935\u0915\u094d\u0937\u094d\u092f\u0947\u0964\u09648.11\u0964\u0964",translation:"\u0964\u09648.11\u0964\u0964 \u0935\u0947\u0926\u0935\u0947\u0924\u094d\u0924\u093e \u0932\u094b\u0917 \u091c\u093f\u0938\u0915\u094b \u0905\u0915\u094d\u0937\u0930 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902, \u0935\u0940\u0924\u0930\u093e\u0917 \u092f\u0924\u093f \u091c\u093f\u0938\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0938\u093e\u0927\u0915 \u091c\u093f\u0938\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u0940 \u0907\u091a\u094d\u091b\u093e \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u092c\u094d\u0930\u0939\u094d\u092e\u091a\u0930\u094d\u092f\u0915\u093e \u092a\u093e\u0932\u0928 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902, \u0935\u0939 \u092a\u0926 \u092e\u0948\u0902 \u0924\u0947\u0930\u0947 \u0932\u093f\u092f\u0947 \u0938\u0902\u0915\u094d\u0937\u0947\u092a\u0938\u0947 \u0915\u0939\u0942\u0901\u0917\u093e\u0964 ",commentary:"\u0964\u09648.11\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,[\u0938\u093e\u0924\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0909\u0928\u0924\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u094b \u0928\u093f\u0930\u094d\u0917\u0941\u0923-\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0925\u093e, \u0909\u0938\u0940\u0915\u094b \u092f\u0939\u093e\u0901 \u0917\u094d\u092f\u093e\u0930\u0939\u0935\u0947\u0902, \u092c\u093e\u0930\u0939\u0935\u0947\u0902 \u0914\u0930 \u0924\u0947\u0930\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0935\u093f\u0938\u094d\u0924\u093e\u0930\u0938\u0947 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964]"},{text:"\u0938\u0930\u094d\u0935\u0926\u094d\u0935\u093e\u0930\u093e\u0923\u093f \u0938\u0902\u092f\u092e\u094d\u092f \u092e\u0928\u094b \u0939\u0943\u0926\u093f \u0928\u093f\u0930\u0941\u0927\u094d\u092f \u091a\u0964\n\u092e\u0942\u0930\u094d\u0927\u094d\u0928\u094d\u092f\u093e\u0927\u093e\u092f\u093e\u0924\u094d\u092e\u0928\u0903 \u092a\u094d\u0930\u093e\u0923\u092e\u093e\u0938\u094d\u0925\u093f\u0924\u094b \u092f\u094b\u0917\u0927\u093e\u0930\u0923\u093e\u092e\u094d\u0964\u09648.12\u0964\u0964",translation:"\u0964\u09648.12, 8.13\u0964\u0964 (\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u0947) \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u094d\u0935\u093e\u0930\u094b\u0902\u0915\u094b \u0930\u094b\u0915\u0915\u0930 \u092e\u0928\u0915\u093e \u0939\u0943\u0926\u092f \u092e\u0947\u0902 \u0928\u093f\u0930\u094b\u0927 \u0915\u0930\u0915\u0947 \u0914\u0930 \u0905\u092a\u0928\u0947 \u092a\u094d\u0930\u093e\u0923\u094b\u0902\u0915\u094b \u092e\u0938\u094d\u0924\u0915\u092e\u0947\u0902 \u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u0930\u0915\u0947 \u092f\u094b\u0917\u0927\u093e\u0930\u0923\u093e\u092e\u0947\u0902 \u0938\u092e\u094d\u092f\u0915\u094d \u092a\u094d\u0930\u0915\u093e\u0930 \u0938\u0947 \u0938\u094d\u0925\u093f\u0924 \u0939\u0941\u0906 \u091c\u094b '\u090a\u0901' \u0907\u0938 \u090f\u0915 \u0905\u0915\u094d\u0937\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u0915\u093e\xa0 \u0909\u091a\u094d\u091a\u093e\u0930\u0923 \u0914\u0930 \u092e\u0947\u0930\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0924\u093e \u0939\u0941\u0906 \u0936\u0930\u0940\u0930\u0915\u094b \u091b\u094b\u0921\u093c\u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948, \u0935\u0939 \u092a\u0930\u092e\u0917\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964",commentary:"\u0964\u09648.12\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0938\u0930\u094d\u0935\u0926\u094d\u0935\u093e\u0930\u093e\u0923\u093f \u0938\u0902\u092f\u092e\u094d\u092f',(\u0905\u0928\u094d\u0924\u0938\u092e\u092f\u092e\u0947\u0902) \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u094b\u0902\u0915\u093e \u0938\u0902\u092f\u092e \u0915\u0930 \u0932\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0936\u092c\u094d\u0926, \u0938\u094d\u092a\u0930\u094d\u0936, \u0930\u0942\u092a, \u0930\u0938 \u0914\u0930 \u0917\u0928\u094d\u0927, \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u0935\u093f\u0937\u092f\u094b\u0902\u0938\u0947 \u0936\u094d\u0930\u094b\u0924\u094d\u0930, \u0924\u094d\u0935\u091a\u093e, \u0928\u0947\u0924\u094d\u0930, \u0930\u0938\u0928\u093e \u0914\u0930 \u0928\u093e\u0938\u093f\u0915\u093e, \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u091c\u094d\u091e\u093e\u0928\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u094b \u0924\u0925\u093e \u092c\u094b\u0932\u0928\u093e, \u0917\u094d\u0930\u0939\u0923 \u0915\u0930\u0928\u093e, \u0917\u092e\u0928 \u0915\u0930\u0928\u093e, \u092e\u0942\u0924\u094d\u0930-\u0924\u094d\u092f\u093e\u0917 \u0914\u0930 \u092e\u0932-\u0924\u094d\u092f\u093e\u0917, \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902\u0938\u0947 \u0935\u093e\u0923\u0940, \u0939\u093e\u0925, \u091a\u0930\u0923, \u0909\u092a\u0938\u094d\u0925 \u0914\u0930 \u0917\u0941\u0926\u093e,\u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u0915\u0930\u094d\u092e\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u094b \u0938\u0930\u094d\u0935\u0925\u093e \u0939\u091f\u093e \u0932\u0947\u0964 \u0907\u0938\u0938\u0947 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0901 \u0905\u092a\u0928\u0947 \u0938\u094d\u0925\u093e\u0928\u092e\u0947\u0902 \u0930\u0939\u0947\u0902\u0917\u0940\u0964"},{text:"\u0913\u092e\u093f\u0924\u094d\u092f\u0947\u0915\u093e\u0915\u094d\u0937\u0930\u0902 \u092c\u094d\u0930\u0939\u094d\u092e \u0935\u094d\u092f\u093e\u0939\u0930\u0928\u094d\u092e\u093e\u092e\u0928\u0941\u0938\u094d\u092e\u0930\u0928\u094d\u0964\n\u092f\u0903 \u092a\u094d\u0930\u092f\u093e\u0924\u093f \u0924\u094d\u092f\u091c\u0928\u094d\u0926\u0947\u0939\u0902 \u0938 \u092f\u093e\u0924\u093f \u092a\u0930\u092e\u093e\u0902 \u0917\u0924\u093f\u092e\u094d\u0964\u09648.13\u0964\u0964",translation:"\u0964\u09648.12, 8.13\u0964\u0964 (\u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u0947) \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0926\u094d\u0935\u093e\u0930\u094b\u0902\u0915\u094b \u0930\u094b\u0915\u0915\u0930 \u092e\u0928\u0915\u093e \u0939\u0943\u0926\u092f \u092e\u0947\u0902 \u0928\u093f\u0930\u094b\u0927 \u0915\u0930\u0915\u0947 \u0914\u0930 \u0905\u092a\u0928\u0947 \u092a\u094d\u0930\u093e\u0923\u094b\u0902\u0915\u094b \u092e\u0938\u094d\u0924\u0915\u092e\u0947\u0902 \u0938\u094d\u0925\u093e\u092a\u093f\u0924 \u0915\u0930\u0915\u0947 \u092f\u094b\u0917\u0927\u093e\u0930\u0923\u093e\u092e\u0947\u0902 \u0938\u092e\u094d\u092f\u0915\u094d \u092a\u094d\u0930\u0915\u093e\u0930 \u0938\u0947 \u0938\u094d\u0925\u093f\u0924 \u0939\u0941\u0906 \u091c\u094b \u0938\u093e\u0927\u0915\xa0 '\u090a\u0901' \u0907\u0938 \u090f\u0915 \u0905\u0915\u094d\u0937\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u0915\u093e \u0909\u091a\u094d\u091a\u093e\u0930\u0923 \u0914\u0930 \u092e\u0947\u0930\u093e \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0924\u093e \u0939\u0941\u0906 \u0936\u0930\u0940\u0930\u0915\u094b \u091b\u094b\u0921\u093c\u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948, \u0935\u0939 \u092a\u0930\u092e\u0917\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964",commentary:"\u0964\u09648.13\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0938\u0930\u094d\u0935\u0926\u094d\u0935\u093e\u0930\u093e\u0923\u093f \u0938\u0902\u092f\u092e\u094d\u092f',(\u0905\u0928\u094d\u0924\u0938\u092e\u092f\u092e\u0947\u0902) \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u094b\u0902\u0915\u093e \u0938\u0902\u092f\u092e \u0915\u0930 \u0932\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0936\u092c\u094d\u0926, \u0938\u094d\u092a\u0930\u094d\u0936, \u0930\u0942\u092a, \u0930\u0938 \u0914\u0930 \u0917\u0928\u094d\u0927, \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u0935\u093f\u0937\u092f\u094b\u0902\u0938\u0947 \u0936\u094d\u0930\u094b\u0924\u094d\u0930, \u0924\u094d\u0935\u091a\u093e, \u0928\u0947\u0924\u094d\u0930, \u0930\u0938\u0928\u093e \u0914\u0930 \u0928\u093e\u0938\u093f\u0915\u093e, \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u091c\u094d\u091e\u093e\u0928\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u094b \u0924\u0925\u093e \u092c\u094b\u0932\u0928\u093e, \u0917\u094d\u0930\u0939\u0923 \u0915\u0930\u0928\u093e, \u0917\u092e\u0928 \u0915\u0930\u0928\u093e, \u092e\u0942\u0924\u094d\u0930-\u0924\u094d\u092f\u093e\u0917 \u0914\u0930 \u092e\u0932-\u0924\u094d\u092f\u093e\u0917, \u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902\u0938\u0947 \u0935\u093e\u0923\u0940, \u0939\u093e\u0925, \u091a\u0930\u0923, \u0909\u092a\u0938\u094d\u0925 \u0914\u0930 \u0917\u0941\u0926\u093e,\u0907\u0928 \u092a\u093e\u0901\u091a\u094b\u0902 \u0915\u0930\u094d\u092e\u0947\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u094b\u0902\u0915\u094b \u0938\u0930\u094d\u0935\u0925\u093e \u0939\u091f\u093e \u0932\u0947\u0964 \u0907\u0938\u0938\u0947 \u0907\u0928\u094d\u0926\u094d\u0930\u093f\u092f\u093e\u0901 \u0905\u092a\u0928\u0947 \u0938\u094d\u0925\u093e\u0928\u092e\u0947\u0902 \u0930\u0939\u0947\u0902\u0917\u0940\u0964"},{text:"\u0905\u0928\u0928\u094d\u092f\u091a\u0947\u0924\u093e\u0903 \u0938\u0924\u0924\u0902 \u092f\u094b \u092e\u093e\u0902 \u0938\u094d\u092e\u0930\u0924\u093f \u0928\u093f\u0924\u094d\u092f\u0936\u0903\u0964\n\u0924\u0938\u094d\u092f\u093e\u0939\u0902 \u0938\u0941\u0932\u092d\u0903 \u092a\u093e\u0930\u094d\u0925 \u0928\u093f\u0924\u094d\u092f\u092f\u0941\u0915\u094d\u0924\u0938\u094d\u092f \u092f\u094b\u0917\u093f\u0928\u0903\u0964\u09648.14\u0964\u0964",translation:"\u0964\u09648.14\u0964\u0964\u0939\u0947 \u092a\u0943\u0925\u093e\u0928\u0928\u094d\u0926\u0928 ! \u0905\u0928\u0928\u094d\u092f\u091a\u093f\u0924\u094d\u0924\u0935\u093e\u0932\u093e \u091c\u094b \u092e\u0928\u0941\u0937\u094d\u092f \u092e\u0947\u0930\u093e \u0928\u093f\u0924\u094d\u092f-\u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0938\u094d\u092e\u0930\u0923 \u0915\u0930\u0924\u093e \u0939\u0948, \u0909\u0938 \u0928\u093f\u0924\u094d\u092f\u092f\u0941\u0915\u094d\u0924 \u092f\u094b\u0917\u0940\u0915\u0947 \u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0938\u0941\u0932\u092d \u0939\u0942\u0901 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0938\u0915\u094b \u0938\u0941\u0932\u092d\u0924\u093e\u0938\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0942\u0901\u0964 ",commentary:"\u0964\u09648.14\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,[\u0938\u093e\u0924\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0924\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u094b \u0938\u0917\u0941\u0923-\u0938\u093e\u0915\u093e\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0941\u0906 \u0925\u093e, \u0909\u0938\u0940\u0915\u094b \u092f\u0939\u093e\u0901 \u091a\u094c\u0926\u0939\u0935\u0947\u0902, \u092a\u0902\u0926\u094d\u0930\u0939\u0935\u0947\u0902 \u0914\u0930 \u0938\u094b\u0932\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0935\u093f\u0938\u094d\u0924\u093e\u0930\u0938\u0947 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964]"},{text:"\u092e\u093e\u092e\u0941\u092a\u0947\u0924\u094d\u092f \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u0926\u0941\u0903\u0916\u093e\u0932\u092f\u092e\u0936\u093e\u0936\u094d\u0935\u0924\u092e\u094d\u0964\n\u0928\u093e\u092a\u094d\u0928\u0941\u0935\u0928\u094d\u0924\u093f \u092e\u0939\u093e\u0924\u094d\u092e\u093e\u0928\u0903 \u0938\u0902\u0938\u093f\u0926\u094d\u0927\u093f\u0902 \u092a\u0930\u092e\u093e\u0902 \u0917\u0924\u093e\u0903\u0964\u09648.15\u0964\u0964",translation:"\u0964\u09648.15\u0964\u0964 \u092e\u0939\u093e\u0924\u094d\u092e\u093e\u0932\u094b\u0917 \u092e\u0941\u091d\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0915\u0947 \u0926\u0941\u0903\u0916\u093e\u0932\u092f \u0914\u0930 \u0905\u0936\u093e\u0936\u094d\u0935\u0924 \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u0947; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0947 \u092a\u0930\u092e\u0938\u093f\u0926\u094d\u0927\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u0917\u092f\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0928\u0915\u094b \u092a\u0930\u092e \u092a\u094d\u0930\u0947\u092e\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b \u0917\u092f\u0940 \u0939\u0948\u0964 ",commentary:"\u0964\u09648.15\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092e\u093e\u092e\u0941\u092a\u0947\u0924\u094d\u092f \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u09f7\u09f7. \u0938\u0902\u0938\u093f\u0926\u094d\u0927\u093f\u0902 \u092a\u0930\u092e\u093e\u0902 \u0917\u0924\u093e\u0903','\u092e\u093e\u092e\u0941\u092a\u0947\u0924\u094d\u092f'\xa0\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0926\u0930\u094d\u0936\u0928 \u0915\u0930 \u0932\u0947, \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u0924\u0924\u094d\u0924\u094d\u0935\u0938\u0947 \u091c\u093e\u0928 \u0932\u0947 \u0905\u0925\u0935\u093e \u092d\u0917\u0935\u093e\u0928\u094d\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u093f\u0937\u094d\u091f \u0939\u094b \u091c\u093e\u092f \u0924\u094b \u092b\u093f\u0930 \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e\u0915\u093e \u0905\u0930\u094d\u0925 \u0939\u0948,\u092b\u093f\u0930 \u0936\u0930\u0940\u0930 \u0927\u093e\u0930\u0923 \u0915\u0930\u0928\u093e\u0964 \u0935\u0939 \u0936\u0930\u0940\u0930 \u091a\u093e\u0939\u0947 \u092e\u0928\u0941\u0937\u094d\u092f \u0915\u093e \u0939\u094b, \u091a\u093e\u0939\u0947 \u092a\u0936\u0941-\u092a\u0915\u094d\u0937\u0940 \u0906\u0926\u093f \u0915\u093f\u0938\u0940 \u092a\u094d\u0930\u093e\u0923\u0940\u0915\u093e \u0939\u094b, \u092a\u0930 \u0909\u0938\u0947 \u0927\u093e\u0930\u0923 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u0926\u0941\u0903\u0916-\u0939\u0940-\u0926\u0941\u0903\u0916 \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e\u0915\u094b \u0926\u0941\u0903\u0916\u093e\u0932\u092f \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0926\u0941\u0903\u0916\u094b\u0902\u0915\u093e \u0918\u0930 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964\u092e\u0930\u0928\u0947\u0915\u0947 \u092c\u093e\u0926 \u092f\u0939 \u092a\u094d\u0930\u093e\u0923\u0940 \u0905\u092a\u0928\u0947 \u0915\u0930\u094d\u092e\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u091c\u093f\u0938 \u092f\u094b\u0928\u093f\u092e\u0947\u0902 \u091c\u0928\u094d\u092e \u0932\u0947\u0924\u093e \u0939\u0948, \u0935\u0939\u093e\u0901 \u091c\u0928\u094d\u092e-\u0915\u093e\u0932\u092e\u0947\u0902 \u091c\u0947\u0930\u0938\u0947 \u092c\u093e\u0939\u0930 \u0906\u0924\u0947 \u0938\u092e\u092f \u0909\u0938\u0915\u094b \u0935\u0948\u0938\u093e \u0915\u0937\u094d\u091f \u0939\u094b\u0924\u093e \u0939\u0948 \u091c\u0948\u0938\u093e \u0915\u0937\u094d\u091f \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u094b \u0936\u0930\u0940\u0930\u0915\u0940 \u091a\u092e\u0921\u093c\u0940 \u0909\u0924\u093e\u0930\u0924\u0947 \u0938\u092e\u092f \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0909\u0938 \u0938\u092e\u092f \u0935\u0939 \u0905\u092a\u0928\u093e \u0915\u0937\u094d\u091f, \u0926\u0941\u0903\u0916 \u0915\u093f\u0938\u0940\u0915\u094b \u092c\u0924\u093e \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e, \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0939 \u0909\u0938 \u0905\u0935\u0938\u094d\u0925\u093e\u092e\u0947\u0902 \u092e\u0939\u093e\u0928\u094d \u0905\u0938\u092e\u0930\u094d\u0925 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u091c\u0928\u094d\u092e\u0915\u0947 \u092c\u093e\u0926 \u092c\u093e\u0932\u0915 \u0938\u0930\u094d\u0935\u0925\u093e \u092a\u0930\u0924\u0928\u094d\u0924\u094d\u0930 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0915\u094b\u0908 \u092d\u0940 \u0915\u0937\u094d\u091f \u0939\u094b\u0928\u0947 \u092a\u0930 \u0935\u0939 \u0930\u094b\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948, \u092a\u0930 \u092c\u0924\u093e \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e\u0964 \u0925\u094b\u0921\u093c\u093e \u092c\u0921\u093c\u093e \u0939\u094b\u0928\u0947 \u092a\u0930 \u0909\u0938\u0915\u094b \u0916\u093e\u0928\u0947-\u092a\u0940\u0928\u0947\u0915\u0940 \u091a\u0940\u091c\u0947\u0902, \u0916\u093f\u0932\u094c\u0928\u0947 \u0906\u0926\u093f\u0915\u0940 \u0907\u091a\u094d\u091b\u093e \u0939\u094b\u0924\u0940 \u0939\u0948 \u0914\u0930 \u0909\u0928\u0915\u0940 \u092a\u0942\u0930\u094d\u0924\u093f \u0928 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092c\u0921\u093c\u093e \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u092a\u0922\u093c\u093e\u0908\u0915\u0947 \u0938\u092e\u092f \u0936\u093e\u0938\u0928\u092e\u0947\u0902 \u0930\u0939\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948\u0964 \u0930\u093e\u0924\u094b\u0902 \u091c\u093e\u0917\u0915\u0930 \u0905\u092d\u094d\u092f\u093e\u0938 \u0915\u0930\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948 \u0924\u094b \u0915\u0937\u094d\u091f \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0935\u093f\u0926\u094d\u092f\u093e \u092d\u0942\u0932 \u091c\u093e\u0924\u0940 \u0939\u0948 \u0924\u0925\u093e \u092a\u0942\u091b\u0928\u0947\u092a\u0930 \u0909\u0924\u094d\u0924\u0930 \u0928\u0939\u0940\u0902 \u0906\u0924\u093e \u0924\u094b \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0906\u092a\u0938\u092e\u0947\u0902 \u0908\u0930\u094d\u0937\u094d\u092f\u093e, \u0926\u094d\u0935\u0947\u0937, \u0921\u093e\u0939, \u0905\u092d\u093f\u092e\u093e\u0928 \u0906\u0926\u093f\u0915\u0947 \u0915\u093e\u0930\u0923 \u0939\u0943\u0926\u092f \u092e\u0947\u0902 \u091c\u0932\u0928 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u092a\u0930\u0940\u0915\u094d\u0937\u093e\u092e\u0947\u0902 \u092b\u0947\u0932 \u0939\u094b \u091c\u093e\u092f \u0924\u094b \u092e\u0942\u0930\u094d\u0916\u0924\u093e\u0915\u0947 \u0915\u093e\u0930\u0923 \u0909\u0938\u0915\u093e \u0907\u0924\u0928\u093e \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u093e \u0939\u0948 \u0915\u093f \u0915\u0908 \u0906\u0924\u094d\u092e\u0939\u0924\u094d\u092f\u093e\u0924\u0915 \u0915\u0930 \u0932\u0947\u0924\u0947 \u0939\u0948\u0902\u0964\u091c\u0935\u093e\u0928 \u0939\u094b\u0928\u0947 \u092a\u0930 \u0905\u092a\u0928\u0940 \u0907\u091a\u094d\u091b\u093e \u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0935\u093f\u0935\u093e\u0939 \u0906\u0926\u093f \u0928 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0935\u093f\u0935\u093e\u0939 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u0924\u094b \u092a\u0924\u094d\u0928\u0940 \u0905\u0925\u0935\u093e \u092a\u0924\u093f \u0905\u0928\u0941\u0915\u0942\u0932 \u0928 \u092e\u093f\u0932\u0928\u0947\u0938\u0947 \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u092c\u093e\u0932-\u092c\u091a\u094d\u091a\u0947 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b \u0909\u0928\u0915\u093e \u092a\u093e\u0932\u0928-\u092a\u094b\u0937\u0923 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u0915\u0937\u094d\u091f \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0932\u0921\u093c\u0915\u093f\u092f\u093e\u0901 \u092c\u0921\u093c\u0940 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0902 \u0924\u094b \u0909\u0928\u0915\u093e \u091c\u0932\u094d\u0926\u0940 \u0935\u093f\u0935\u093e\u0939 \u0928 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092e\u093e\u0901-\u092c\u093e\u092a\u0915\u0940 \u0928\u0940\u0902\u0926 \u0909\u0921\u093c \u091c\u093e\u0924\u0940 \u0939\u0948, \u0916\u093e\u0928\u093e-\u092a\u0940\u0928\u093e \u0905\u091a\u094d\u091b\u093e \u0928\u0939\u0940\u0902 \u0932\u0917\u0924\u093e, \u0939\u0930\u0926\u092e \u092c\u0947\u091a\u0948\u0928\u0940 \u0930\u0939\u0924\u0940 \u0939\u0948\u0964\u0935\u0943\u0926\u094d\u0927\u093e\u0935\u0938\u094d\u0925\u093e \u0906\u0928\u0947\u092a\u0930 \u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u0905\u0938\u092e\u0930\u094d\u0925\u0924\u093e \u0906 \u091c\u093e\u0924\u0940 \u0939\u0948\u0964 \u0905\u0928\u0947\u0915 \u092a\u094d\u0930\u0915\u093e\u0930 \u0915\u0947 \u0930\u094b\u0917\u094b\u0902\u0915\u093e \u0906\u0915\u094d\u0930\u092e\u0923 \u0939\u094b\u0928\u0947 \u0932\u0917\u0924\u093e \u0939\u0948\u0964 \u0938\u0941\u0916\u0938\u0947 \u0909\u0920\u0928\u093e-\u092c\u0948\u0920\u0928\u093e, \u091a\u0932\u0928\u093e-\u092b\u093f\u0930\u0928\u093e, \u0916\u093e\u0928\u093e-\u092a\u0940\u0928\u093e \u0906\u0926\u093f \u092d\u0940 \u0915\u0920\u093f\u0928 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0918\u0930\u0935\u093e\u0932\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0924\u093f\u0930\u0938\u094d\u0915\u093e\u0930 \u0939\u094b\u0928\u0947 \u0932\u0917\u0924\u093e \u0939\u0948\u0964 \u0909\u0928\u0915\u0947 \u0905\u092a\u0936\u092c\u094d\u0926 \u0938\u0941\u0928\u0928\u0947 \u092a\u0921\u093c\u0924\u0947 \u0939\u0948\u0902\u0964 \u0930\u093e\u0924\u092e\u0947\u0902 \u0916\u093e\u0901\u0938\u0940 \u0906\u0924\u0940 \u0939\u0948\u0964 \u0928\u0940\u0902\u0926 \u0928\u0939\u0940\u0902 \u0906\u0924\u0940\u0964 \u092e\u0930\u0928\u0947\u0915\u0947 \u0938\u092e\u092f \u092d\u0940 \u092c\u0921\u093c\u0947 \u092d\u092f\u0902\u0915\u0930 \u0915\u0937\u094d\u091f \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u0910\u0938\u0947 \u0926\u0941\u0903\u0916 \u0915\u0939\u093e\u0901\u0924\u0915 \u0915\u0939\u0947\u0902? \u0909\u0928\u0915\u093e \u0915\u094b\u0908 \u0905\u0928\u094d\u0924 \u0928\u0939\u0940\u0902\u0964\u092e\u0928\u0941\u0937\u094d\u092f-\u091c\u0948\u0938\u093e \u0939\u0940 \u0915\u0937\u094d\u091f \u092a\u0936\u0941-\u092a\u0915\u094d\u0937\u0940 \u0906\u0926\u093f\u0915\u094b \u092d\u0940 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0909\u0928\u0915\u094b \u0936\u0940\u0924-\u0918\u093e\u092e, \u0935\u0930\u094d\u0937\u093e-\u0939\u0935\u093e \u0906\u0926\u093f\u0938\u0947 \u0915\u0937\u094d\u091f \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u092c\u0939\u0941\u0924-\u0938\u0947 \u091c\u0902\u0917\u0932\u0940 \u091c\u093e\u0928\u0935\u0930 \u0909\u0928\u0915\u0947 \u091b\u094b\u091f\u0947 \u092c\u091a\u094d\u091a\u094b\u0902\u0915\u094b \u0916\u093e \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b \u0909\u0928\u0915\u094b \u092c\u0921\u093c\u093e \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0938\u092d\u0940 \u092f\u094b\u0928\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0905\u0928\u0947\u0915 \u0924\u0930\u0939\u0915\u0947 \u0926\u0941\u0903\u0916 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902\u0964 \u0910\u0938\u0947 \u0939\u0940 \u0928\u0930\u0915\u094b\u0902\u092e\u0947\u0902 \u0914\u0930 \u091a\u094c\u0930\u093e\u0938\u0940 \u0932\u093e\u0916 \u092f\u094b\u0928\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0926\u0941\u0903\u0916 \u092d\u094b\u0917\u0928\u0947 \u092a\u0921\u093c\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e\u0915\u094b '\u0926\u0941\u0903\u0916\u093e\u0932\u092f' \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964"},{text:"\u0906\u092c\u094d\u0930\u0939\u094d\u092e\u092d\u0941\u0935\u0928\u093e\u0932\u094d\u0932\u094b\u0915\u093e\u0903 \u092a\u0941\u0928\u0930\u093e\u0935\u0930\u094d\u0924\u093f\u0928\u094b\u093d\u0930\u094d\u091c\u0941\u0928\u0964\n\u092e\u093e\u092e\u0941\u092a\u0947\u0924\u094d\u092f \u0924\u0941 \u0915\u094c\u0928\u094d\u0924\u0947\u092f \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u0928 \u0935\u093f\u0926\u094d\u092f\u0924\u0947\u0964\u09648.16\u0964\u0964",translation:"\u0964\u09648.16\u0964\u0964 \u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0924\u0915 \u0938\u092d\u0940 \u0932\u094b\u0915 \u092a\u0941\u0928\u0930\u093e\u0935\u0930\u094d\u0924\u0940 \u0939\u0948; \u092a\u0930\u0928\u094d\u0924\u0941 \u0939\u0947 \u0915\u094c\u0928\u094d\u0924\u0947\u092f ! \u092e\u0941\u091d\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092a\u0941\u0928\u0930\u094d\u091c\u0928\u094d\u092e \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 ",commentary:"\u0964\u09648.16\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e, '\u0906\u092c\u094d\u0930\u0939\u094d\u092e\u092d\u0941\u0935\u0928\u093e\u0932\u094d\u0932\u094b\u0915\u093e\u0903 \u092a\u0941\u0928\u0930\u093e\u0935\u0930\u094d\u0924\u093f\u0928\u094b\u093d\u0930\u094d\u091c\u0941\u0928',\u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0932\u094b\u0915\u0915\u094b \u0932\u0947\u0915\u0930 \u0938\u092d\u0940 \u0932\u094b\u0915 \u092a\u0941\u0928\u0930\u093e\u0935\u0930\u094d\u0924\u0940 \u0939\u0948\u0902, \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u0914\u0930 \u0909\u0938\u0938\u0947 \u0928\u0940\u091a\u0947\u0915\u0947 \u091c\u093f\u0924\u0928\u0947 \u0932\u094b\u0915 (\u0938\u0941\u0916\u092d\u094b\u0917-\u092d\u0942\u092e\u093f\u092f\u093e\u0901) \u0939\u0948\u0902, \u0909\u0928\u092e\u0947\u0902 \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0947 \u0938\u092d\u0940 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u094b \u0909\u0928-\u0909\u0928 \u0932\u094b\u0915\u094b\u0902\u0915\u0947 \u092a\u094d\u0930\u093e\u092a\u0915 \u092a\u0941\u0923\u094d\u092f \u0938\u092e\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0928\u0947\u092a\u0930 \u0932\u094c\u091f\u0915\u0930 \u0906\u0928\u093e \u0939\u0940 \u092a\u0921\u093c\u0924\u093e \u0939\u0948\u0964\u091c\u093f\u0924\u0928\u0940 \u092d\u0940 \u092d\u094b\u0917-\u092d\u0942\u092e\u093f\u092f\u093e\u0901 \u0939\u0948\u0902, \u0909\u0928 \u0938\u092c\u092e\u0947\u0902 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0915\u094b \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u092c\u0924\u093e\u092f\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u092e\u093e\u0924\u094d\u0930 \u092a\u0943\u0925\u094d\u0935\u0940\u092e\u0923\u094d\u0921\u0932\u0915\u093e \u0930\u093e\u091c\u093e \u0939\u094b \u0914\u0930 \u0909\u0938\u0915\u093e \u0927\u0928\u0927\u093e\u0928\u094d\u092f\u0938\u0947 \u0938\u092e\u094d\u092a\u0928\u094d\u0928 \u0930\u093e\u091c\u094d\u092f \u0939\u094b, \u0938\u094d\u0924\u094d\u0930\u0940-\u092a\u0941\u0930\u0941\u0937, \u092a\u0930\u093f\u0935\u093e\u0930 \u0906\u0926\u093f \u0938\u092d\u0940 \u0909\u0938\u0915\u0947 \u0905\u0928\u0941\u0915\u0942\u0932 \u0939\u094b\u0902, \u0909\u0938\u0915\u0940 \u092f\u0941\u0935\u093e\u0935\u0938\u094d\u0925\u093e \u0939\u094b \u0924\u0925\u093e \u0936\u0930\u0940\u0930 \u0928\u0940\u0930\u094b\u0917 \u0939\u094b,\u092f\u0939 \u092e\u0943\u0924\u094d\u092f\u0941-\u0932\u094b\u0915\u0915\u093e \u092a\u0942\u0930\u094d\u0923 \u0938\u0941\u0916 \u092e\u093e\u0928\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u092e\u0943\u0924\u094d\u092f\u0941\u0932\u094b\u0915\u0915\u0947 \u0938\u0941\u0916\u0938\u0947 \u0938\u094c \u0917\u0941\u0923\u093e \u0905\u0927\u093f\u0915 \u0938\u0941\u0916 \u092e\u0930\u094d\u0924\u094d\u092f \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u093e \u0939\u0948\u0964 \u092e\u0930\u094d\u0924\u094d\u092f \u0926\u0947\u0935\u0924\u093e \u0909\u0928\u0915\u094b \u0915\u0939\u0924\u0947 \u0939\u0948\u0902, \u091c\u094b \u092a\u0941\u0923\u094d\u092f\u0915\u0930\u094d\u092e \u0915\u0930\u0915\u0947 \u0926\u0947\u0935\u0932\u094b\u0915\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0926\u0947\u0935\u0932\u094b\u0915\u0915\u0947 \u092a\u094d\u0930\u093e\u092a\u0915 \u092a\u0941\u0923\u094d\u092f \u0915\u094d\u0937\u0940\u0923 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092a\u0941\u0928\u0903 \u092e\u0943\u0924\u094d\u092f\u0941\u0932\u094b\u0915\u092e\u0947\u0902 \u0906 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 (\u0917\u0940\u0924\u093e 9\u0964 21)\u0964 \u0907\u0928 \u092e\u0930\u094d\u0924\u094d\u092f \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0938\u0947 \u0938\u094c \u0917\u0941\u0923\u093e \u0905\u0927\u093f\u0915 \u0938\u0941\u0916 \u0906\u091c\u093e\u0928 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0915\u093e \u0939\u0948\u0964 \u0906\u091c\u093e\u0928 \u0926\u0947\u0935\u0924\u093e \u0935\u0947 \u0915\u0939\u0932\u093e\u0924\u0947 \u0939\u0948\u0902, \u091c\u094b \u0915\u0932\u094d\u092a\u0915\u0947 \u0906\u0926\u093f \u092e\u0947\u0902 \u0926\u0947\u0935\u0924\u093e \u092c\u0928\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0915\u0932\u094d\u092a\u0915\u0947 \u0905\u0928\u094d\u0924\u0924\u0915 \u0926\u0947\u0935\u0924\u093e \u092c\u0928\u0947 \u0930\u0939\u0947\u0902\u0917\u0947\u0964 \u0907\u0928 \u0906\u091c\u093e\u0928 \u0926\u0947\u0935\u0924\u093e\u0913\u0902\u0938\u0947 \u0938\u094c \u0917\u0941\u0923\u093e \u0905\u0927\u093f\u0915 \u0938\u0941\u0916 \u0907\u0928\u094d\u0926\u094d\u0930\u0915\u093e \u092e\u093e\u0928\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u0907\u0928\u094d\u0926\u094d\u0930\u0915\u0947 \u0938\u0941\u0916\u0938\u0947 \u0938\u094c \u0917\u0941\u0923\u093e \u0905\u0927\u093f\u0915 \u0938\u0941\u0916 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0915\u093e \u092e\u093e\u0928\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u0907\u0938 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0915\u0947 \u0938\u0941\u0916\u0938\u0947 \u092d\u0940 \u0905\u0928\u0928\u094d\u0924 \u0917\u0941\u0923\u093e \u0905\u0927\u093f\u0915 \u0938\u0941\u0916 \u092d\u0917\u0935\u0924\u094d\u092a\u094d\u0930\u093e\u092a\u094d\u0924, \u0924\u0924\u094d\u0924\u094d\u0935\u091c\u094d\u091e, \u091c\u0940\u0935\u0928\u094d\u092e\u0941\u0915\u094d\u0924 \u092e\u0939\u093e\u092a\u0941\u0930\u0941\u0937\u0915\u093e \u092e\u093e\u0928\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0948 \u0915\u093f \u092a\u0943\u0925\u094d\u0935\u0940\u092e\u0923\u094d\u0921\u0932\u0938\u0947 \u0932\u0947\u0915\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0924\u0915\u0915\u093e \u0938\u0941\u0916 \u0938\u0940\u092e\u093f\u0924, \u092a\u0930\u093f\u0935\u0930\u094d\u0924\u0928\u0936\u0940\u0932 \u0914\u0930 \u0935\u093f\u0928\u093e\u0936\u0940 \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092d\u0917\u0935\u0924\u094d\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u093e \u0938\u0941\u0916 \u0905\u0928\u0928\u094d\u0924 \u0939\u0948, \u0905\u092a\u093e\u0930 \u0939\u0948, \u0905\u0917\u093e\u0927 \u0939\u0948\u0964 \u092f\u0939 \u0938\u0941\u0916 \u0915\u092d\u0940 \u0928\u0937\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u0905\u0928\u0928\u094d\u0924 \u092c\u094d\u0930\u0939\u094d\u092e\u093e \u0914\u0930 \u0905\u0928\u0928\u094d\u0924 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0923\u094d\u0921 \u0938\u092e\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u092f\u0901, \u0924\u094b \u092d\u0940 \u092f\u0939 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u093e \u0938\u0941\u0916 \u0915\u092d\u0940 \u0928\u0937\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e, \u0938\u0926\u093e \u092c\u0928\u093e \u0930\u0939\u0924\u093e \u0939\u0948\u0964"},{text:"\u0938\u0939\u0938\u094d\u0930\u092f\u0941\u0917\u092a\u0930\u094d\u092f\u0928\u094d\u0924\u092e\u0939\u0930\u094d\u092f\u0926\u094d\u092c\u094d\u0930\u0939\u094d\u092e\u0923\u094b \u0935\u093f\u0926\u0941\u0903\u0964\n\u0930\u093e\u0924\u094d\u0930\u093f\u0902 \u092f\u0941\u0917\u0938\u0939\u0938\u094d\u0930\u093e\u0928\u094d\u0924\u093e\u0902 \u0924\u0947\u093d\u0939\u094b\u0930\u093e\u0924\u094d\u0930\u0935\u093f\u0926\u094b \u091c\u0928\u093e\u0903\u0964\u09648.17\u0964\u0964",translation:"\u0964\u09648.17\u0964\u0964 \u091c\u094b \u092e\u0928\u0941\u0937\u094d\u092f \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0915\u0947 \u090f\u0915 \u0939\u095b\u093e\u0930 \u091a\u0924\u0941\u0930\u094d\u092f\u0941\u0917\u0940\u0935\u093e\u0932\u0947 \u090f\u0915 \u0926\u093f\u0928\u0915\u094b \u0914\u0930 \u0938\u0939\u0938\u094d\u0924\u094d\u0930 \u091a\u0924\u0941\u0930\u094d\u092f\u0941\u0917\u0940\u092a\u0930\u094d\u092f\u0928\u094d\u0924 \u090f\u0915 \u0930\u093e\u0924\u0915\u094b \u091c\u093e\u0928\u0924\u0947 \u0939\u0948\u0902, \u0935\u0947 \u092e\u0928\u0941\u0937\u094d\u092f \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0915\u0947 \u0926\u093f\u0928 \u0914\u0930 \u0930\u093e\u0924\u0915\u094b \u091c\u093e\u0928\u0928\u0947 \u0935\u093e\u0932\u0947 \u0939\u0948\u0902\u0964 ",commentary:"\u0964\u09648.17\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,\u0938\u0939\u0938\u094d\u0930\u092f\u0941\u0917\u092a\u0930\u094d\u092f\u0928\u094d\u0924\u092e\u094d \u09f7\u09f7. \u0924\u0947\u093d\u0939\u094b\u0930\u093e\u0924\u094d\u0930\u0935\u093f\u0926\u094b \u091c\u0928\u093e\u0903,\u0938\u0924\u094d\u092f, \u0924\u094d\u0930\u0947\u0924\u093e, \u0926\u094d\u0935\u093e\u092a\u0930 \u0914\u0930 \u0915\u0932\u093f,\u092e\u0943\u0924\u094d\u092f\u0941\u0932\u094b\u0915\u0915\u0947 \u0907\u0928 \u091a\u093e\u0930 \u092f\u0941\u0917\u094b\u0902\u0915\u094b \u090f\u0915 \u091a\u0924\u0941\u0930\u094d\u092f\u0941\u0917\u0940 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0910\u0938\u0940 \u090f\u0915 \u0939\u091c\u093e\u0930 \u091a\u0924\u0941\u0930\u094d\u092f\u0941\u0917\u0940 \u092c\u0940\u0924\u0928\u0947\u092a\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u093e \u090f\u0915 \u0926\u093f\u0928 \u0939\u094b\u0924\u093e \u0939\u0948 \u0914\u0930 \u090f\u0915 \u0939\u091c\u093e\u0930 \u091a\u0924\u0941\u0930\u094d\u092f\u0941\u0917\u0940 \u092c\u0940\u0924\u0928\u0947\u092a\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0940 \u090f\u0915 \u0930\u093e\u0924 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u0926\u093f\u0928-\u0930\u093e\u0924\u0915\u0940 \u0907\u0938\u0940 \u0917\u0923\u0928\u093e\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0938\u094c \u0935\u0930\u094d\u0937\u094b\u0902\u0915\u0940 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0940 \u0906\u092f\u0941 \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0940 \u0906\u092f\u0941\u0915\u0947 \u0938\u094c \u0935\u0930\u094d\u0937 \u092c\u0940\u0924\u0928\u0947\u092a\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0909\u0928\u0915\u093e \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u092d\u0940 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u092e\u0947\u0902 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948 \u0924\u0925\u093e \u092a\u094d\u0930\u0915\u0943\u0924\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u092e\u0947\u0902 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964\n\u0915\u093f\u0924\u0928\u0940 \u0939\u0940 \u092c\u0921\u093c\u0940 \u0906\u092f\u0941 \u0915\u094d\u092f\u094b\u0902 \u0928 \u0939\u094b, \u0935\u0939 \u092d\u0940 \u0915\u093e\u0932\u0915\u0940 \u0905\u0935\u0927\u093f\u0935\u093e\u0932\u0940 \u0939\u0940 \u0939\u0948\u0964 \u090a\u0901\u091a\u0947-\u0938\u0947-\u090a\u0901\u091a\u0947 \u0915\u0939\u0947 \u091c\u093e\u0928\u0947\u0935\u093e\u0932\u0947 \u091c\u094b \u092d\u094b\u0917 \u0939\u0948\u0902, \u0935\u0947 \u092d\u0940 \u0938\u0902\u092f\u094b\u0917\u091c\u0928\u094d\u092f \u0939\u094b\u0928\u0947 \u0938\u0947 \u0926\u0941\u0903\u0916\u094b\u0902\u0915\u0947 \u0939\u0940 \u0915\u093e\u0930\u0923 \u0939\u0948\u0902,'\u092f\u0947 \u0939\u093f \u0938\u0902\u0938\u094d\u092a\u0930\u094d\u0936\u091c\u093e \u092d\u094b\u0917\u093e \u0926\u0941\u0903\u0916\u092f\u094b\u0928\u092f \u090f\u0935 \u0924\u0947' (\u0917\u0940\u0924\u093e 5\u0964 22) \u0914\u0930 \u0915\u093e\u0932\u0915\u0940 \u0905\u0935\u0927\u093f\u0935\u093e\u0932\u0947 \u0939\u0948\u0902\u0964 \u0915\u0947\u0935\u0932 \u092d\u0917\u0935\u093e\u0928\u094d \u0939\u0940 \u0915\u093e\u0932\u093e\u0924\u0940\u0924 \u0939\u0948\u0902\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0915\u093e\u0932\u0915\u0947 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u094b \u091c\u093e\u0928\u0928\u0947 \u0935\u093e\u0932\u0947 \u092e\u0928\u0941\u0937\u094d\u092f \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0924\u0915\u0915\u0947 \u0926\u093f\u0935\u094d\u092f \u092d\u094b\u0917\u094b\u0902\u0915\u094b \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928\u0939\u0940\u0902 \u0926\u0947\u0924\u0947\u0964\n\t\u0938\u092e\u094d\u092c\u0928\u094d\u0927,\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0926\u093f\u0928 \u0914\u0930 \u0930\u093e\u0924\u0915\u094b \u0932\u0947\u0915\u0930 \u091c\u094b \u0938\u0930\u094d\u0917 \u0914\u0930 \u092a\u094d\u0930\u0932\u092f \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0909\u0938\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0905\u092c \u0906\u0917\u0947\u0915\u0947 \u0926\u094b \u0936\u094d\u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964"},{text:"\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0926\u094d\u0935\u094d\u092f\u0915\u094d\u0924\u092f\u0903 \u0938\u0930\u094d\u0935\u093e\u0903 \u092a\u094d\u0930\u092d\u0935\u0928\u094d\u0924\u094d\u092f\u0939\u0930\u093e\u0917\u092e\u0947\u0964\n\u0930\u093e\u0924\u094d\u0930\u094d\u092f\u093e\u0917\u092e\u0947 \u092a\u094d\u0930\u0932\u0940\u092f\u0928\u094d\u0924\u0947 \u0924\u0924\u094d\u0930\u0948\u0935\u093e\u0935\u094d\u092f\u0915\u094d\u0924\u0938\u0902\u091c\u094d\u091e\u0915\u0947\u0964\u09648.18\u0964\u0964",translation:"\u0964\u09648.18\u0964\u0964 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0926\u093f\u0928\u0915\u0947 \u0906\u0930\u092e\u094d\u092d\u0915\u093e\u0932\u092e\u0947\u0902 \u0905\u0935\u094d\u092f\u0915\u094d\u0924- (\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e-\u0936\u0930\u0940\u0930-) \u0938\u0947 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u0940 \u092a\u0948\u0926\u093e \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0940 \u0930\u093e\u0924\u0915\u0947 \u0906\u0930\u092e\u094d\u092d\u0915\u093e\u0932\u092e\u0947\u0902 \u0909\u0938\u0940 \u0905\u0935\u094d\u092f\u0915\u094d\u0924\u092e\u0947\u0902 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u0940 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 ",commentary:"\u0964\u09648.18\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0926\u094d\u0935\u094d\u092f\u0915\u094d\u0924\u092f\u0903 \u09f7\u09f7. \u0924\u0924\u094d\u0930\u0948\u0935\u093e\u0935\u094d\u092f\u0915\u094d\u0924\u0938\u0902\u091c\u094d\u091e\u0915\u0947',\u092e\u093e\u0924\u094d\u0930 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u091c\u093f\u0924\u0928\u0947 \u0936\u0930\u0940\u0930 \u0939\u0948\u0902, \u0909\u0928\u0915\u094b \u092f\u0939\u093e\u0901\xa0'\u0935\u094d\u092f\u0915\u094d\u0924\u092f\u0903'\u0914\u0930 \u091a\u094c\u0926\u0939\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u091a\u094c\u0925\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u092e\u0942\u0930\u094d\u0924\u092f\u0903' \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u091c\u0948\u0938\u0947, \u091c\u0940\u0935\u0915\u0943\u0924 \u0938\u0943\u0937\u094d\u091f\u093f \u0905\u0930\u094d\u0925\u093e\u0924\u094d '\u092e\u0948\u0902' \u0914\u0930 '\u092e\u0947\u0930\u093e\u092a\u0928' \u0915\u094b \u0932\u0947\u0915\u0930 \u091c\u0940\u0935\u0915\u0940 \u091c\u094b \u0938\u0943\u0937\u094d\u091f\u093f \u0939\u0948, \u091c\u0940\u0935\u0915\u0947 \u0928\u0940\u0902\u0926\u0938\u0947 \u091c\u0917\u0928\u0947\u092a\u0930 \u0935\u0939 \u0938\u0943\u0937\u094d\u091f\u093f \u091c\u0940\u0935\u0938\u0947 \u0939\u0940 \u092a\u0948\u0926\u093e \u0939\u094b\u0924\u0940 \u0939\u0948 \u0914\u0930 \u0928\u0940\u0902\u0926\u0915\u0947 \u0906 \u091c\u093e\u0928\u0947\u092a\u0930 \u0935\u0939 \u0938\u0943\u0937\u094d\u091f\u093f \u091c\u0940\u0935\u092e\u0947\u0902 \u0939\u0940 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964 \u0910\u0938\u0947 \u0939\u0940 \u091c\u094b \u092f\u0939 \u0938\u094d\u0925\u0942\u0932 \u0938\u092e\u0937\u094d\u091f\u093f \u0938\u0943\u0937\u094d\u091f\u093f \u0926\u0940\u0916\u0924\u0940 \u0939\u0948, \u0935\u0939 \u0938\u092c-\u0915\u0940-\u0938\u092c \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u091c\u0917\u0928\u0947\u092a\u0930 \u0909\u0928\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u0938\u0947 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0938\u0947 \u092a\u0948\u0926\u093e \u0939\u094b\u0924\u0940 \u0939\u0948 \u0914\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u094b\u0928\u0947\u092a\u0930 \u0909\u0928\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u0939\u0940 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0940 \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u091c\u0917\u0928\u0947\u092a\u0930 \u0924\u094b '\u0938\u0930\u094d\u0917' \u0939\u094b\u0924\u093e \u0939\u0948 \u0914\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u094b\u0928\u0947\u092a\u0930 '\u092a\u094d\u0930\u0932\u092f' \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u091c\u092c \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0940 \u0938\u094c \u0935\u0930\u094d\u0937\u0915\u0940 \u0906\u092f\u0941 \u092c\u0940\u0924 \u091c\u093e\u0924\u0940 \u0939\u0948, \u0924\u092c '\u092e\u0939\u093e\u092a\u094d\u0930\u0932\u092f' \u0939\u094b\u0924\u093e \u0939\u0948, \u091c\u093f\u0938\u092e\u0947\u0902 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940 \u092d\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u092e\u0947\u0902 \u0932\u0940\u0928 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0940 \u091c\u093f\u0924\u0928\u0940 \u0906\u092f\u0941 \u0939\u094b\u0924\u0940 \u0939\u0948, \u0909\u0924\u0928\u093e \u0939\u0940 \u092e\u0939\u093e\u092a\u094d\u0930\u0932\u092f\u0915\u093e \u0938\u092e\u092f \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u092e\u0939\u093e\u092a\u094d\u0930\u0932\u092f\u0915\u093e \u0938\u092e\u092f \u092c\u0940\u0924\u0928\u0947\u092a\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940 \u092d\u0917\u0935\u093e\u0928\u094d\u0938\u0947 \u092a\u094d\u0930\u0915\u091f \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0924\u094b '\u092e\u0939\u093e\u0938\u0930\u094d\u0917' \u0915\u093e \u0906\u0930\u092e\u094d\u092d \u0939\u094b\u0924\u093e \u0939\u0948 (\u0917\u0940\u0924\u093e 9\u0964 7 8)\u0964"},{text:"\u092d\u0942\u0924\u0917\u094d\u0930\u093e\u092e\u0903 \u0938 \u090f\u0935\u093e\u092f\u0902 \u092d\u0942\u0924\u094d\u0935\u093e \u092d\u0942\u0924\u094d\u0935\u093e \u092a\u094d\u0930\u0932\u0940\u092f\u0924\u0947\u0964\n\u0930\u093e\u0924\u094d\u0930\u094d\u092f\u093e\u0917\u092e\u0947\u093d\u0935\u0936\u0903 \u092a\u093e\u0930\u094d\u0925 \u092a\u094d\u0930\u092d\u0935\u0924\u094d\u092f\u0939\u0930\u093e\u0917\u092e\u0947\u0964\u09648.19\u0964\u0964",translation:"\u0964\u09648.19\u0964\u0964 \u0939\u0947 \u092a\u093e\u0930\u094d\u0925 ! \u0935\u0939\u0940 \u092f\u0939 \u092a\u094d\u0930\u093e\u0923\u093f\u0938\u092e\u0941\u0926\u093e\u092f \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b-\u0939\u094b\u0915\u0930 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0915\u0947 \u092a\u0930\u0935\u0936 \u0939\u0941\u0906 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0915\u0947 \u0926\u093f\u0928\u0915\u0947 \u0938\u092e\u092f \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b\u0924\u093e \u0939\u0948 \u0914\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u0915\u0940 \u0930\u093e\u0924\u094d\u0930\u093f\u0915\u0947 \u0938\u092e\u092f \u0932\u0940\u0928 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.19\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092d\u0942\u0924\u0917\u094d\u0930\u093e\u092e\u0903 \u0938 \u090f\u0935\u093e\u092f\u092e\u094d',\u0905\u0928\u093e\u0926\u093f\u0915\u093e\u0932\u0938\u0947 \u091c\u0928\u094d\u092e-\u092e\u0930\u0923\u0915\u0947 \u091a\u0915\u094d\u0915\u0930\u092e\u0947\u0902 \u092a\u0921\u093c\u093e \u0939\u0941\u0906 \u092f\u0939 \u092a\u094d\u0930\u093e\u0923\u093f\u0938\u092e\u0941\u0926\u093e\u092f \u0935\u0939\u0940 \u0939\u0948, \u091c\u094b \u0915\u093f \u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d \u092e\u0947\u0930\u093e \u0905\u0902\u0936, \u092e\u0947\u0930\u093e \u0938\u094d\u0935\u0930\u0942\u092a \u0939\u0948\u0964 \u092e\u0947\u0930\u093e \u0938\u0928\u093e\u0924\u0928 \u0905\u0902\u0936 \u0939\u094b\u0928\u0947 \u0938\u0947 \u092f\u0939 \u0928\u093f\u0924\u094d\u092f \u0939\u0948\u0964 \u0938\u0930\u094d\u0917 \u0914\u0930 \u092a\u094d\u0930\u0932\u092f \u0924\u0925\u093e \u092e\u0939\u093e\u0938\u0930\u094d\u0917 \u0914\u0930 \u092e\u0939\u093e\u092a\u094d\u0930\u0932\u092f\u092e\u0947\u0902 \u092d\u0940 \u092f\u0939\u0940 \u0925\u093e \u0914\u0930 \u0906\u0917\u0947 \u092d\u0940 \u092f\u0939\u0940 \u0930\u0939\u0947\u0917\u093e\u0964 \u0907\u0938\u0915\u093e \u0928 \u0915\u092d\u0940 \u0905\u092d\u093e\u0935 \u0939\u0941\u0906 \u0939\u0948 \u0914\u0930 \u0928 \u0906\u0917\u0947 \u0915\u092d\u0940 \u0907\u0938\u0915\u093e \u0905\u092d\u093e\u0935 \u0939\u094b\u0917\u093e\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u092f\u0939 \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u0939\u0948, \u0907\u0938\u0915\u093e \u0915\u092d\u0940 \u0935\u093f\u0928\u093e\u0936 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092d\u0942\u0932\u0938\u0947 \u092f\u0939 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0915\u0947 \u0938\u093e\u0925 \u0905\u092a\u0928\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u092e\u093e\u0928 \u0932\u0947\u0924\u093e \u0939\u0948\u0964 \u092a\u094d\u0930\u093e\u0915\u0943\u0924 \u092a\u0926\u093e\u0930\u094d\u0925 (\u0936\u0930\u0940\u0930 \u0906\u0926\u093f) \u0924\u094b \u092c\u0926\u0932\u0924\u0947 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902, \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0914\u0930 \u0928\u0937\u094d\u091f \u0939\u094b\u0924\u0947 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902, \u092a\u0930 \u092f\u0939 \u0909\u0928\u0915\u0947 \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u092a\u0915\u0921\u093c\u0947 \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u092f\u0939 \u0915\u093f\u0924\u0928\u0947 \u0906\u0936\u094d\u091a\u0930\u094d\u092f\u0915\u0940 \u092c\u093e\u0924 \u0939\u0948 \u0915\u093f \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0940 (\u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u092a\u0926\u093e\u0930\u094d\u0925) \u0924\u094b \u0928\u0939\u0940\u0902 \u0930\u0939\u0924\u0947, \u092a\u0930 \u0909\u0928\u0915\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0930\u0939\u0924\u093e \u0939\u0948; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0909\u0938 \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u0938\u094d\u0935\u092f\u0902\u0928\u0947 \u092a\u0915\u0921\u093c\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u092f\u0939 \u0938\u094d\u0935\u092f\u0902 \u091c\u092c\u0924\u0915 \u0909\u0938 \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u0928\u0939\u0940\u0902 \u091b\u094b\u0921\u093c\u0924\u093e, \u0924\u092c\u0924\u0915 \u0909\u0938\u0915\u094b \u0926\u0942\u0938\u0930\u093e \u0915\u094b\u0908 \u091b\u0941\u0921\u093c\u093e \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e\u0964 \u0909\u0938 \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u091b\u094b\u0921\u093c\u0928\u0947\u092e\u0947\u0902 \u092f\u0939 \u0938\u094d\u0935\u0924\u0928\u094d\u0924\u094d\u0930 \u0939\u0948, \u0938\u092c\u0932 \u0939\u0948\u0964 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u092f\u0939 \u0909\u0938 \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u0930\u0916\u0928\u0947\u092e\u0947\u0902 \u0938\u0926\u093e \u092a\u0930\u0924\u0928\u094d\u0924\u094d\u0930 \u0939\u0948; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0935\u0947 \u092a\u0926\u093e\u0930\u094d\u0925 \u0924\u094b \u0939\u0930\u0926\u092e \u092c\u0926\u0932\u0924\u0947 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902, \u092a\u0930 \u092f\u0939 \u0928\u092f\u093e-\u0928\u092f\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u092a\u0915\u0921\u093c\u0924\u093e \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u091c\u0948\u0938\u0947, \u092c\u093e\u0932\u0915\u092a\u0928\u0915\u094b \u0907\u0938\u0928\u0947 \u0928\u0939\u0940\u0902 \u091b\u094b\u0921\u093c\u093e \u0914\u0930 \u0928 \u091b\u094b\u0921\u093c\u0928\u093e \u091a\u093e\u0939\u093e, \u092a\u0930 \u0935\u0939 \u091b\u0942\u091f \u0917\u092f\u093e\u0964 \u0910\u0938\u0947 \u0939\u0940 \u091c\u0935\u093e\u0928\u0940\u0915\u094b \u0907\u0938\u0928\u0947 \u0928\u0939\u0940\u0902 \u091b\u094b\u0921\u093c\u093e, \u092a\u0930 \u0935\u0939 \u091b\u0942\u091f \u0917\u092f\u0940\u0964 \u0914\u0930 \u0924\u094b \u0915\u094d\u092f\u093e, \u092f\u0939 \u0936\u0930\u0940\u0930\u0915\u094b \u092d\u0940 \u091b\u094b\u0921\u093c\u0928\u093e \u0928\u0939\u0940\u0902 \u091a\u093e\u0939\u0924\u093e, \u092a\u0930 \u0935\u0939 \u092d\u0940 \u091b\u0942\u091f \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092a\u094d\u0930\u093e\u0915\u0943\u0924 \u092a\u0926\u093e\u0930\u094d\u0925 \u0924\u094b \u091b\u0942\u091f\u0924\u0947 \u0939\u0940 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902, \u092a\u0930 \u092f\u0939 \u091c\u0940\u0935 \u0909\u0928 \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u0905\u092a\u0928\u0947 \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u092c\u0928\u093e\u092f\u0947 \u0930\u0916\u0924\u093e \u0939\u0948, \u091c\u093f\u0938\u0938\u0947,\u0907\u0938\u0915\u094b \u092c\u093e\u0930-\u092c\u093e\u0930 \u0936\u0930\u0940\u0930 \u0927\u093e\u0930\u0923 \u0915\u0930\u0928\u0947 \u092a\u0921\u093c\u0924\u0947 \u0939\u0948\u0902, \u092c\u093e\u0930-\u092c\u093e\u0930 \u091c\u0928\u094d\u092e\u0928\u093e-\u092e\u0930\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948\u0964 \u091c\u092c\u0924\u0915 \u092f\u0939 \u0909\u0938 \u092e\u093e\u0928\u0947 \u0939\u0941\u090f \u0938\u092e\u094d\u092c\u0928\u094d\u0927\u0915\u094b \u0928\u0939\u0940\u0902 \u091b\u094b\u0921\u093c\u0947\u0917\u093e \u0924\u092c\u0924\u0915 \u092f\u0939 \u091c\u0928\u094d\u092e\u092e\u0930\u0923\u0915\u0940 \u092a\u0930\u092e\u094d\u092a\u0930\u093e \u091a\u0932\u0924\u0940 \u0939\u0940 \u0930\u0939\u0947\u0917\u0940, \u0915\u092d\u0940 \u092e\u093f\u091f\u0947\u0917\u0940 \u0928\u0939\u0940\u0902\u0964"},{text:"\u092a\u0930\u0938\u094d\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0924\u0941 \u092d\u093e\u0935\u094b\u093d\u0928\u094d\u092f\u094b\u093d\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0924\u094d\u0938\u0928\u093e\u0924\u0928\u0903\u0964\n\u092f\u0903 \u0938 \u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u092d\u0942\u0924\u0947\u0937\u0941 \u0928\u0936\u094d\u092f\u0924\u094d\u0938\u0941 \u0928 \u0935\u093f\u0928\u0936\u094d\u092f\u0924\u093f\u0964\u09648.20\u0964\u0964",translation:"\u0964\u09648.20\u0964\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0909\u0938 \u0905\u0935\u094d\u092f\u0915\u094d\u0924- (\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e-\u0936\u0930\u0940\u0930-) \u0938\u0947 \u0905\u0928\u094d\u092f \u0905\u0928\u093e\u0926\u093f \u0938\u0930\u094d\u0935\u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u092d\u093e\u0935\u0930\u0942\u092a \u091c\u094b \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0939\u0948, \u0909\u0938\u0915\u093e \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0928\u0937\u094d\u091f \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0928\u093e\u0936 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 ",commentary:"\u0964\u09648.20\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092a\u0930\u0938\u094d\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0924\u0941 \u092d\u093e\u0935\u094b\u093d\u0928\u094d\u092f\u094b\u093d\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0924\u094d\u0938\u0928\u093e\u0924\u0928\u0903', \u0938\u094b\u0932\u0939\u0935\u0947\u0902\u0938\u0947 \u0909\u0928\u094d\u0928\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u0924\u0925\u093e \u0909\u0938\u0938\u0947 \u0928\u0940\u091a\u0947\u0915\u0947 \u0932\u094b\u0915\u094b\u0902\u0915\u094b \u092a\u0941\u0928\u0930\u093e\u0935\u0930\u094d\u0924\u0940 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935 \u0909\u0928\u0938\u0947 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948, \u092f\u0939 \u092c\u0924\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u0939\u093e\u0901 '\u0924\u0941' \u092a\u0926 \u0926\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948\u0964\u092f\u0939\u093e\u0901 '\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0924\u094d' \u092a\u0926 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u0915\u093e \u0939\u0940 \u0935\u093e\u091a\u0915 \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0907\u0938\u0938\u0947 \u092a\u0939\u0932\u0947 \u0905\u0920\u093e\u0930\u0939\u0935\u0947\u0902-\u0909\u0928\u094d\u0928\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u0938\u0930\u094d\u0917\u0915\u0947 \u0906\u0926\u093f \u092e\u0947\u0902 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u0938\u0947 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u092a\u0948\u0926\u093e \u0939\u094b\u0928\u0947\u0915\u0940 \u0914\u0930 \u092a\u094d\u0930\u0932\u092f\u092e\u0947\u0902 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u092e\u0947\u0902 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0932\u0940\u0928 \u0939\u094b\u0928\u0947\u0915\u0940 \u092c\u093e\u0924 \u0915\u0939\u0940 \u0917\u092f\u0940 \u0939\u0948\u0964 \u0907\u0938 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0906\u092f\u093e '\u0924\u0938\u094d\u092e\u093e\u0924\u094d' \u092a\u0926 \u092d\u0940 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0909\u0938 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u0915\u093e \u0926\u094d\u092f\u094b\u0924\u0928 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u0910\u0938\u093e \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u092f\u0939\u093e\u0901 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930-(\u0938\u092e\u0937\u094d\u091f\u093f \u092e\u0928, \u092c\u0941\u0926\u094d\u0927\u093f \u0914\u0930 \u0905\u0939\u0902\u0915\u093e\u0930-) \u0938\u0947 \u092d\u0940 \u092a\u0930 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u091c\u094b \u092d\u093e\u0935\u0930\u0942\u092a \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948, \u0935\u0939 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e-\u0936\u0930\u0940\u0930\u0915\u0947 \u0938\u093e\u0925-\u0938\u093e\u0925 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0915\u093e\u0930\u0923-\u0936\u0930\u0940\u0930- (\u092e\u0942\u0932 \u092a\u094d\u0930\u0915\u0943\u0924\u093f-) \u0938\u0947 \u092d\u0940 \u0905\u0924\u094d\u092f\u0928\u094d\u0924 \u0935\u093f\u0932\u0915\u094d\u0937\u0923 \u0939\u0948\u0964\u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u0938\u0947 \u092a\u0930 \u0926\u094b \u0924\u0924\u094d\u0924\u094d\u0935 \u0939\u0948\u0902,\u092e\u0942\u0932 \u092a\u094d\u0930\u0915\u0943\u0924\u093f \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0964 \u092f\u0939\u093e\u0901 \u092a\u094d\u0930\u0938\u0919\u094d\u0917 \u092e\u0942\u0932 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0915\u093e \u0928\u0939\u0940\u0902 \u0939\u0948, \u092a\u094d\u0930\u0924\u094d\u092f\u0941\u0924 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u0907\u0938 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u094b \u0939\u0940 \u092a\u0930 \u0914\u0930 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948, \u091c\u094b \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0928\u0937\u094d\u091f \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0928\u0937\u094d\u091f \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u0906\u0917\u0947\u0915\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092d\u0940 '\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0915\u094d\u0937\u0930' \u0906\u0926\u093f \u092a\u0926\u094b\u0902\u0938\u0947 \u0909\u0938 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0939\u0940 \u0935\u0930\u094d\u0923\u0928 \u0906\u092f\u093e \u0939\u0948\u0964\n\u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0905\u092a\u094d\u0930\u0915\u091f \u0939\u094b\u0928\u0947\u0915\u094b \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948,'\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u093e\u0926\u0940\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f' (2\u0964 28); \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u0942\u0915\u094d\u0937\u094d\u092e\u0936\u0930\u0940\u0930\u0915\u094b \u092d\u0940 \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948 (8\u0964 18) \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0915\u094b \u092d\u0940 \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948,'\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u092e\u0947\u0935 \u091a' (13\u0964 5) \u0906\u0926\u093f\u0964 \u0909\u0928 \u0938\u092c\u0938\u0947 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0938\u094d\u0935\u0930\u0942\u092a \u0935\u093f\u0932\u0915\u094d\u0937\u0923, \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u0948, \u091a\u093e\u0939\u0947 \u0935\u0939 \u0938\u094d\u0935\u0930\u0942\u092a \u0935\u094d\u092f\u0915\u094d\u0924 \u0939\u094b, \u091a\u093e\u0939\u0947 \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0939\u094b\u0964 \u0935\u0939 \u092d\u093e\u0935\u0930\u0942\u092a \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0915\u093f\u0938\u0940 \u092d\u0940 \u0915\u093e\u0932\u092e\u0947\u0902 \u0909\u0938\u0915\u093e \u0905\u092d\u093e\u0935 \u0939\u0941\u0906 \u0928\u0939\u0940\u0902, \u0939\u094b\u0917\u093e \u0928\u0939\u0940\u0902 \u0914\u0930 \u0939\u094b \u0938\u0915\u0924\u093e \u092d\u0940 \u0928\u0939\u0940\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0935\u0939 \u0938\u0928\u093e\u0924\u0928 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0935\u0939 \u0938\u0926\u093e\u0938\u0947 \u0939\u0948 \u0914\u0930 \u0938\u0926\u093e \u0939\u0940 \u0930\u0939\u0947\u0917\u093e\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u0939 \u092a\u0930 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u0930\u094d\u0935\u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u0948\u0964 \u0909\u0938\u0938\u0947 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0915\u094b\u0908 \u0939\u094b \u0939\u0940 \u0928\u0939\u0940\u0902 \u0938\u0915\u0924\u093e \u0914\u0930 \u0939\u094b\u0928\u0947\u0915\u0940 \u0938\u092e\u094d\u092d\u093e\u0935\u0928\u093e \u092d\u0940 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964"},{text:"\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0915\u094d\u0937\u0930 \u0907\u0924\u094d\u092f\u0941\u0915\u094d\u0924\u0938\u094d\u0924\u092e\u093e\u0939\u0941\u0903 \u092a\u0930\u092e\u093e\u0902 \u0917\u0924\u093f\u092e\u094d\u0964\n\u092f\u0902 \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928 \u0928\u093f\u0935\u0930\u094d\u0924\u0928\u094d\u0924\u0947 \u0924\u0926\u094d\u0927\u093e\u092e \u092a\u0930\u092e\u0902 \u092e\u092e\u0964\u09648.21\u0964\u0964",translation:"\u0964\u09648.21\u0964\u0964 \u0909\u0938\u0940\u0915\u094b \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0914\u0930 \u0905\u0915\u094d\u0937\u0930 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948 \u0914\u0930 \u0909\u0938\u0940\u0915\u094b \u092a\u0930\u092e\u0917\u0924\u093f \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948 \u0924\u0925\u093e \u091c\u093f\u0938\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u091c\u0940\u0935 \u092b\u093f\u0930 \u0932\u094c\u091f\u0915\u0930 \u0928\u0939\u0940\u0902 \u0906\u0924\u0947, \u0935\u0939 \u092e\u0947\u0930\u093e \u092a\u0930\u092e\u0927\u093e\u092e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.21\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u094b\u093d\u0915\u094d\u0937\u0930 \u09f7\u09f7. \u0924\u0926\u094d\u0927\u093e\u092e \u092a\u0930\u092e\u0902 \u092e\u092e',\u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0938\u093e\u0924\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0905\u091f\u094d\u0920\u093e\u0908\u0938\u0935\u0947\u0902, \u0909\u0928\u094d\u0924\u0940\u0938\u0935\u0947\u0902 \u0914\u0930 \u0924\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u093f\u0938\u0915\u094b '\u092e\u093e\u092e\u094d', \u0915\u0939\u093e \u0939\u0948 \u0924\u0925\u093e \u0906\u0920\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0924\u0940\u0938\u0930\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u0905\u0915\u094d\u0937\u0930\u0902 \u092c\u094d\u0930\u0939\u094d\u092e', \u091a\u094c\u0925\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u0905\u0927\u093f\u092f\u091c\u094d\u091e\u0903', \u092a\u093e\u0901\u091a\u0935\u0947\u0902 \u0914\u0930 \u0938\u093e\u0924\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u092e\u093e\u092e\u094d', \u0906\u0920\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u092a\u0930\u092e\u0902 \u092a\u0941\u0930\u0941\u0937\u0902 \u0926\u093f\u0935\u094d\u092f\u092e\u094d', \u0928\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u0915\u0935\u093f\u0902 \u092a\u0941\u0930\u093e\u0923\u092e\u0928\u0941\u0936\u093e\u0938\u093f\u0924\u093e\u0930\u092e\u094d' \u0906\u0926\u093f, \u0924\u0947\u0930\u0939\u0935\u0947\u0902, \u091a\u094c\u0926\u0939\u0935\u0947\u0902, \u092a\u0928\u094d\u0926\u094d\u0930\u0939\u0935\u0947\u0902 \u0914\u0930 \u0938\u094b\u0932\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u092e\u093e\u092e\u094d', \u092c\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902,'\u0905\u0935\u094d\u092f\u0915\u094d\u0924\u0903' \u0914\u0930 '\u0938\u0928\u093e\u0924\u0928\u0903' \u0915\u0939\u093e \u0939\u0948, \u0909\u0928 \u0938\u092c\u0915\u0940 \u090f\u0915\u0924\u093e \u0915\u0930\u0924\u0947 \u0939\u0941\u090f \u092d\u0917\u0935\u093e\u0928\u094d \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u0909\u0938\u0940\u0915\u094b \u0905\u0935\u094d\u092f\u0915\u094d\u0924 \u0914\u0930 \u0905\u0915\u094d\u0937\u0930 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0924\u0925\u093e \u0909\u0938\u0940\u0915\u094b \u092a\u0930\u092e\u0917\u0924\u093f \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0938\u0930\u094d\u0935\u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0917\u0924\u093f \u0915\u0939\u0924\u0947 \u0939\u0948\u0902; \u0914\u0930 \u091c\u093f\u0938\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u091c\u0940\u0935 \u092b\u093f\u0930 \u0932\u094c\u091f\u0915\u0930 \u0928\u0939\u0940\u0902 \u0906\u0924\u0947, \u0935\u0939 \u092e\u0947\u0930\u093e \u092a\u0930\u092e\u0927\u093e\u092e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092e\u0947\u0930\u093e \u0938\u0930\u094d\u0935\u094b\u0924\u094d\u0915\u0943\u0937\u094d\u091f \u0938\u094d\u0935\u0930\u0942\u092a \u0939\u0948\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u091c\u093f\u0938 \u092a\u094d\u0930\u093e\u092a\u0923\u0940\u092f \u0935\u0938\u094d\u0924\u0941\u0915\u094b \u0905\u0928\u0947\u0915 \u0930\u0942\u092a\u094b\u0902\u092e\u0947\u0902 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948, \u0909\u0938\u0915\u0940 \u092f\u0939\u093e\u0901 \u090f\u0915\u0924\u093e \u0915\u0940 \u0917\u092f\u0940 \u0939\u0948\u0964 \u0910\u0938\u0947 \u0939\u0940 \u091a\u094c\u0926\u0939\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0938\u0924\u094d\u0924\u093e\u0908\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092d\u0940 '\u092c\u094d\u0930\u0939\u094d\u092e, \u0905\u0935\u093f\u0928\u093e\u0936\u0940, \u0905\u092e\u0943\u0924, \u0936\u093e\u0936\u094d\u0935\u0924 \u0927\u0930\u094d\u092e \u0914\u0930 \u0910\u0915\u093e\u0928\u094d\u0924\u093f\u0915 \u0938\u0941\u0916\u0915\u093e \u0906\u0936\u094d\u0930\u092f \u092e\u0948\u0902 \u0939\u0942\u0901' \u0910\u0938\u093e \u0915\u0939 \u0915\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092a\u094d\u0930\u093e\u092a\u0923\u0940\u092f \u0935\u0938\u094d\u0924\u0941\u0915\u0940 \u090f\u0915\u0924\u093e \u0915\u0940 \u0939\u0948\u0964\u0932\u094b\u0917\u094b\u0902\u0915\u0940 \u0910\u0938\u0940 \u0927\u093e\u0930\u0923\u093e \u0930\u0939\u0924\u0940 \u0939\u0948 \u0915\u093f \u0938\u0917\u0941\u0923-\u0909\u092a\u093e\u0938\u0928\u093e\u0915\u093e \u092b\u0932 \u0926\u0942\u0938\u0930\u093e \u0939\u0948 \u0914\u0930 \u0928\u093f\u0930\u094d\u0917\u0941\u0923-\u0909\u092a\u093e\u0938\u0928\u093e\u0915\u093e \u092b\u0932 \u0926\u0942\u0938\u0930\u093e \u0939\u0948\u0964,\u0907\u0938 \u0927\u093e\u0930\u0923\u093e\u0915\u094b \u0926\u0942\u0930 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u0907\u0938 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0938\u092c\u0915\u0940 \u090f\u0915\u0924\u093e\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u0940 \u0930\u0941\u091a\u093f, \u0935\u093f\u0936\u094d\u0935\u093e\u0938 \u0914\u0930 \u092f\u094b\u0917\u094d\u092f\u0924\u093e\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0909\u092a\u093e\u0938\u0928\u093e\u0915\u0947 \u092d\u093f\u0928\u094d\u0928-\u092d\u093f\u0928\u094d\u0928 \u092a\u094d\u0930\u0915\u093e\u0930 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u092a\u0930 \u0909\u0928\u0915\u0947 \u0905\u0928\u094d\u0924\u093f\u092e \u092b\u0932\u092e\u0947\u0902 \u0915\u094b\u0908 \u092b\u0930\u0915 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u0938\u092c\u0915\u093e \u092a\u094d\u0930\u093e\u092a\u0923\u0940\u092f \u0924\u0924\u094d\u0924\u094d\u0935 \u090f\u0915 \u0939\u0940 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u091c\u0948\u0938\u0947 \u092d\u094b\u091c\u0928\u0915\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0928 \u0939\u094b\u0928\u0947 \u092a\u0930 \u0905\u092d\u093e\u0935\u0915\u0940 \u0914\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u0924\u0943\u092a\u094d\u0924\u093f\u0915\u0940 \u090f\u0915\u0924\u093e \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u092d\u094b\u091c\u0928\u0915\u0947 \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u092e\u0947\u0902 \u092d\u093f\u0928\u094d\u0928\u0924\u093e \u0930\u0939\u0924\u0940 \u0939\u0948, \u0910\u0938\u0947 \u0939\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0928 \u0939\u094b\u0928\u0947 \u092a\u0930 \u0905\u092d\u093e\u0935\u0915\u0940 \u0914\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092a\u0942\u0930\u094d\u0923\u0924\u093e\u0915\u0940 \u090f\u0915\u0924\u093e \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0909\u092a\u093e\u0938\u0928\u093e\u0913\u0902\u092e\u0947\u0902 \u092d\u093f\u0928\u094d\u0928\u0924\u093e \u0930\u0939\u0924\u0940 \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u0909\u0938 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u094b \u091a\u093e\u0939\u0947 \u0938\u0917\u0941\u0923-\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092e\u093e\u0928\u0915\u0930 \u0909\u092a\u093e\u0938\u0928\u093e \u0915\u0930\u0947\u0902, \u091a\u093e\u0939\u0947 \u0928\u093f\u0930\u094d\u0917\u0941\u0923-\u0928\u093f\u0930\u093e\u0915\u093e\u0930 \u092e\u093e\u0928\u0915\u0930 \u0909\u092a\u093e\u0938\u0928\u093e \u0915\u0930\u0947\u0902 \u0914\u0930 \u091a\u093e\u0939\u0947 \u0938\u0917\u0941\u0923-\u0938\u093e\u0915\u093e\u0930 \u092e\u093e\u0928\u0915\u0930 \u0909\u092a\u093e\u0938\u0928\u093e \u0915\u0930\u0947\u0902, \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u0938\u092c\u0915\u094b \u090f\u0915 \u0939\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948\u0964"},{text:"\u092a\u0941\u0930\u0941\u0937\u0903 \u0938 \u092a\u0930\u0903 \u092a\u093e\u0930\u094d\u0925 \u092d\u0915\u094d\u0924\u094d\u092f\u093e \u0932\u092d\u094d\u092f\u0938\u094d\u0924\u094d\u0935\u0928\u0928\u094d\u092f\u092f\u093e\u0964\n\u092f\u0938\u094d\u092f\u093e\u0928\u094d\u0924\u0903\u0938\u094d\u0925\u093e\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u092f\u0947\u0928 \u0938\u0930\u094d\u0935\u092e\u093f\u0926\u0902 \u0924\u0924\u092e\u094d\u0964\u09648.22\u0964\u0964",translation:"\u0964\u09648.22\u0964\u0964 \u0939\u0947 \u092a\u0943\u0925\u093e\u0928\u0928\u094d\u0926\u0928 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u0940 \u091c\u093f\u0938\u0915\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u0917\u0924 \u0939\u0948\u0902 \u0914\u0930 \u091c\u093f\u0938\u0938\u0947 \u092f\u0939 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0902\u0938\u093e\u0930 \u0935\u094d\u092f\u093e\u092a\u094d\u0924 \u0939\u0948, \u0935\u0939 \u092a\u0930\u092e \u092a\u0941\u0930\u0941\u0937 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0924\u094b \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f\u0938\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947\u092f\u094b\u0917\u094d\u092f \u0939\u0948\u0964 ",commentary:"\u0964\u09648.22\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u092f\u0938\u094d\u092f\u093e\u0928\u094d\u0924\u0903\u0938\u094d\u0925\u093e\u0928\u093f \u092d\u0942\u0924\u093e\u0928\u093f \u092f\u0947\u0928 \u0938\u0930\u094d\u0935\u092e\u093f\u0926\u0902 \u0924\u0924\u092e\u094d',\u0938\u093e\u0924\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u092c\u093e\u0930\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0928\u093f\u0937\u0947\u0927\u0930\u0942\u092a\u0938\u0947 \u0915\u0939\u093e \u0915\u093f \u0938\u093e\u0924\u094d\u0924\u094d\u0935\u093f\u0915, \u0930\u093e\u091c\u0938 \u0914\u0930 \u0924\u093e\u092e\u0938 \u092d\u093e\u0935 \u092e\u0947\u0930\u0947\u0938\u0947 \u0939\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u092a\u0930 \u092e\u0948\u0902 \u0909\u0928\u092e\u0947\u0902 \u0914\u0930 \u0935\u0947 \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u0939\u0948\u0902\u0964 \u092f\u0939\u093e\u0901 \u092d\u0917\u0935\u093e\u0928\u094d \u0935\u093f\u0927\u093f\u0930\u0942\u092a\u0938\u0947 \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0947 \u0905\u0928\u094d\u0924\u0930\u094d\u0917\u0924 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u0940 \u0939\u0948\u0902 \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u092a\u0930\u093f\u092a\u0942\u0930\u094d\u0923 \u0939\u0948\u0902\u0964 \u0907\u0938\u0940\u0915\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0928\u0935\u0947\u0902 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u091a\u094c\u0925\u0947, \u092a\u093e\u0901\u091a\u0935\u0947\u0902 \u0914\u0930 \u091b\u0920\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0935\u093f\u0927\u093f \u0914\u0930 \u0928\u093f\u0937\u0947\u0927,\u0926\u094b\u0928\u094b\u0902 \u0930\u0942\u092a\u094b\u0902\u0938\u0947 \u0915\u0939\u093e \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092e\u0947\u0930\u0947 \u0938\u093f\u0935\u093e\u092f \u0915\u093f\u0938\u0940\u0915\u0940 \u092d\u0940 \u0938\u094d\u0935\u0924\u0928\u094d\u0924\u094d\u0930 \u0938\u0924\u094d\u0924\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0938\u092c \u092e\u0947\u0930\u0947\u0938\u0947 \u0939\u0940 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902; \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0939\u0940 \u0938\u094d\u0925\u093f\u0924 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092e\u0947\u0930\u0947\u092e\u0947\u0902 \u0939\u0940 \u0932\u0940\u0928 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0905\u0924\u0903 \u0938\u092c \u0915\u0941\u091b \u092e\u0948\u0902 \u0939\u0940 \u0939\u0941\u0906\u0964\u0935\u0947 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u0930\u094d\u0935\u094b\u092a\u0930\u093f \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0938\u092c\u092e\u0947\u0902 \u0935\u094d\u092f\u093e\u092a\u094d\u0924 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0935\u0947 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u092c \u091c\u0917\u0939 \u0939\u0948\u0902; \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u0939\u0948\u0902; \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0935\u0938\u094d\u0924\u0941\u0913\u0902\u092e\u0947\u0902 \u0939\u0948\u0902, \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u0915\u094d\u0930\u093f\u092f\u093e\u0913\u0902\u092e\u0947\u0902 \u0939\u0948\u0902 \u0914\u0930 \u0938\u092e\u094d\u092a\u0942\u0930\u094d\u0923 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0939\u0948\u0902\u0964 \u091c\u0948\u0938\u0947 \u0938\u094b\u0928\u0947\u0938\u0947 \u092c\u0928\u0947 \u0939\u0941\u090f \u0917\u0939\u0928\u094b\u0902\u092e\u0947\u0902 \u092a\u0939\u0932\u0947 \u092d\u0940 \u0938\u094b\u0928\u093e \u0939\u0940 \u0925\u093e, \u0917\u0939\u0928\u093e\u0930\u0942\u092a \u092c\u0928\u0928\u0947\u092a\u0930 \u092d\u0940 \u0938\u094b\u0928\u093e \u0939\u0940 \u0930\u0939\u093e \u0914\u0930 \u0917\u0939\u0928\u094b\u0902\u0915\u0947 \u0928\u0937\u094d\u091f \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u0938\u094b\u0928\u093e \u0939\u0940 \u0930\u0939\u0947\u0917\u093e\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0938\u094b\u0928\u0947\u0938\u0947 \u092c\u0928\u0947 \u0917\u0939\u0928\u094b\u0902\u0915\u0947 \u0928\u093e\u092e, \u0930\u0942\u092a, \u0906\u0915\u0943\u0924\u093f, \u0909\u092a\u092f\u094b\u0917, \u0924\u094c\u0932 \u092e\u0942\u0932\u094d\u092f \u0906\u0926\u093f \u092a\u0930 \u0926\u0943\u0937\u094d\u091f\u093f \u0930\u0939\u0928\u0947\u0938\u0947 \u0938\u094b\u0928\u0947\u0915\u0940 \u0924\u0930\u092b \u0926\u0943\u0937\u094d\u091f\u093f \u0928\u0939\u0940\u0902 \u091c\u093e\u0924\u0940\u0964 \u0910\u0938\u0947 \u0939\u0940 \u0938\u0902\u0938\u093e\u0930\u0915\u0947 \u092a\u0939\u0932\u0947 \u092d\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0925\u0947, \u0938\u0902\u0938\u093e\u0930\u0930\u0942\u092a\u0938\u0947 \u092d\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902 \u0914\u0930 \u0938\u0902\u0938\u093e\u0930\u0915\u093e \u0905\u0928\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u092d\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0930\u0939\u0947\u0902\u0917\u0947\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0938\u0902\u0938\u093e\u0930\u0915\u094b \u092a\u093e\u091e\u094d\u091a\u092d\u094c\u0924\u093f\u0915, \u090a\u0901\u091a-\u0928\u0940\u091a, \u092c\u0921\u093c\u093e-\u091b\u094b\u091f\u093e, \u0905\u0928\u0941\u0915\u0942\u0932-\u092a\u094d\u0930\u0924\u093f\u0915\u0942\u0932 \u0906\u0926\u093f \u092e\u093e\u0928 \u0932\u0947\u0928\u0947\u0938\u0947 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u0924\u0930\u092b \u0926\u0943\u0937\u094d\u091f\u093f \u0928\u0939\u0940\u0902 \u091c\u093e\u0924\u0940\u0964"},{text:"\u092f\u0924\u094d\u0930 \u0915\u093e\u0932\u0947 \u0924\u094d\u0935\u0928\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u0902 \u091a\u0948\u0935 \u092f\u094b\u0917\u093f\u0928\u0903\u0964\n\u092a\u094d\u0930\u092f\u093e\u0924\u093e \u092f\u093e\u0928\u094d\u0924\u093f \u0924\u0902 \u0915\u093e\u0932\u0902 \u0935\u0915\u094d\u0937\u094d\u092f\u093e\u092e\u093f \u092d\u0930\u0924\u0930\u094d\u0937\u092d\u0964\u09648.23\u0964\u0964",translation:"\u0964\u09648.23\u0964\u0964 \u0939\u0947 \u092d\u0930\u0924\u0935\u0902\u0936\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u091c\u093f\u0938 \u0915\u093e\u0932 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092e\u093e\u0930\u094d\u0917\u092e\u0947\u0902 \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u0917\u092f\u0947 \u0939\u0941\u090f \u092f\u094b\u0917\u0940 \u0905\u0928\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u0940\u091b\u0947 \u0932\u094c\u091f\u0915\u0930 \u0928\u0939\u0940\u0902 \u0906\u0924\u0947 \u0914\u0930 (\u091c\u093f\u0938 \u092e\u093e\u0930\u094d\u0917\u092e\u0947\u0902 \u0917\u092f\u0947 \u0939\u0941\u090f) \u0906\u0935\u0943\u0924\u094d\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u0940\u091b\u0947 \u0932\u094c\u091f\u0915\u0930 \u0906\u0924\u0947 \u0939\u0948\u0902, \u0909\u0938 \u0915\u093e\u0932\u0915\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0926\u094b\u0928\u094b\u0902 \u092e\u093e\u0930\u094d\u0917\u094b\u0902\u0915\u094b \u092e\u0948\u0902 \u0915\u0939\u0942\u0901\u0917\u093e\u0964 ",commentary:"\u0964\u09648.23\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,[\u091c\u0940\u0935\u093f\u0924 \u0905\u0935\u0938\u094d\u0925\u093e\u092e\u0947\u0902 \u0939\u0940 \u092c\u0928\u094d\u0927\u0928\u0938\u0947 \u091b\u0942\u091f\u0928\u0947\u0915\u094b '\u0938\u0926\u094d\u092f\u094b\u092e\u0941\u0915\u094d\u0924\u093f' \u0915\u0939\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u091c\u093f\u0928\u0915\u094b \u092f\u0939\u093e\u0901 \u0939\u0940 \u092d\u0917\u0935\u0924\u094d\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0939\u094b \u0917\u092f\u0940, \u092d\u0917\u0935\u093e\u0928\u094d\u092e\u0947\u0902 \u0905\u0928\u0928\u094d\u092f\u092d\u0915\u094d\u0924\u093f \u0939\u094b \u0917\u092f\u0940, \u0905\u0928\u0928\u094d\u092f\u092a\u094d\u0930\u0947\u092e \u0939\u094b \u0917\u092f\u093e, \u0935\u0947 \u092f\u0939\u093e\u0901 \u0939\u0940 \u092a\u0930\u092e \u0938\u0902\u0938\u093f\u0926\u094d\u0927\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0926\u0942\u0938\u0930\u0947 \u091c\u094b \u0938\u093e\u0927\u0915 \u0915\u093f\u0938\u0940 \u0938\u0942\u0915\u094d\u0937\u094d\u092e \u0935\u093e\u0938\u0928\u093e\u0915\u0947 \u0915\u093e\u0930\u0923 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u093e\u0915\u0930 \u0915\u094d\u0930\u092e\u0936\u0903 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u093e\u0925 \u092e\u0941\u0915\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902, \u0909\u0928\u0915\u0940 \u092e\u0941\u0915\u094d\u0924\u093f\u0915\u094b '\u0915\u094d\u0930\u092e\u092e\u0941\u0915\u094d\u0924\u093f' \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u091c\u094b \u0915\u0947\u0935\u0932 \u0938\u0941\u0916 \u092d\u094b\u0917\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u0906\u0926\u093f \u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902, \u0935\u0947 \u092b\u093f\u0930 \u0932\u094c\u091f\u0915\u0930 \u0906\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0938\u0915\u094b '\u092a\u0941\u0928\u0930\u093e\u0935\u0943\u0924\u094d\u0924\u093f' \u0915\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0938\u0926\u094d\u092f\u094b\u092e\u0941\u0915\u094d\u0924\u093f\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0924\u094b \u092a\u0902\u0926\u094d\u0930\u0939\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0939\u094b \u0917\u092f\u093e, \u092a\u0930 \u0915\u094d\u0930\u092e\u092e\u0941\u0915\u094d\u0924\u093f \u0914\u0930 \u092a\u0941\u0928\u0930\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0928\u093e \u092c\u093e\u0915\u0940 \u0930\u0939 \u0917\u092f\u093e\u0964 \u0905\u0924\u0903 \u0907\u0928 \u0926\u094b\u0928\u094b\u0902\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d \u0906\u0917\u0947\u0915\u093e \u092a\u094d\u0930\u0915\u0930\u0923 \u0906\u0930\u092e\u094d\u092d \u0915\u0930\u0924\u0947 \u0939\u0948\u0902\u0964]"},{text:"\u0905\u0917\u094d\u0928\u093f\u0930\u094d\u091c\u094d\u092f\u094b\u0924\u093f\u0930\u0939\u0903 \u0936\u0941\u0915\u094d\u0932\u0903 \u0937\u0923\u094d\u092e\u093e\u0938\u093e \u0909\u0924\u094d\u0924\u0930\u093e\u092f\u0923\u092e\u094d\u0964\n\u0924\u0924\u094d\u0930 \u092a\u094d\u0930\u092f\u093e\u0924\u093e \u0917\u091a\u094d\u091b\u0928\u094d\u0924\u093f \u092c\u094d\u0930\u0939\u094d\u092e \u092c\u094d\u0930\u0939\u094d\u092e\u0935\u093f\u0926\u094b \u091c\u0928\u093e\u0903\u0964\u09648.24\u0964\u0964",translation:"\u0964\u09648.24\u0964\u0964 \u091c\u093f\u0938 \u092e\u093e\u0930\u094d\u0917\u092e\u0947\u0902 \u092a\u094d\u0930\u0915\u093e\u0936\u0938\u094d\u0935\u0930\u0942\u092a \u0905\u0917\u094d\u0928\u093f\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e, \u0926\u093f\u0928\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e, \u0936\u0941\u0915\u094d\u0932\u092a\u0915\u094d\u0937\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e, \u0914\u0930 \u091b\u0903 \u092e\u0939\u0940\u0928\u094b\u0902\u0935\u093e\u0932\u0947 \u0909\u0924\u094d\u0924\u0930\u093e\u092f\u0923\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e \u0939\u0948, \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u0909\u0938 \u092e\u093e\u0930\u094d\u0917\u0938\u0947 \u0917\u092f\u0947 \u0939\u0941\u090f \u092c\u094d\u0930\u0939\u094d\u092e\u0935\u0947\u0924\u094d\u0924\u093e \u092a\u0941\u0930\u0941\u0937 (\u092a\u0939\u0932\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0915\u0930 \u092a\u0940\u091b\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u093e\u091c\u0940\u0915\u0947 \u0938\u093e\u0925) \u092c\u094d\u0930\u0939\u094d\u092e\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 ",commentary:"\u0964\u09648.24\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0905\u0917\u094d\u0928\u093f\u0930\u094d\u091c\u094d\u092f\u094b\u0924\u093f\u0930\u0939\u0903 \u0936\u0941\u0915\u094d\u0932\u0903 \u0937\u0923\u094d\u092e\u093e\u0938\u093e \u0909\u0924\u094d\u0924\u0930\u093e\u092f\u0923\u092e\u094d',\u0907\u0938 \u092d\u0942\u092e\u0923\u094d\u0921\u0932\u092a\u0930 \u0936\u0941\u0915\u094d\u0932\u092e\u093e\u0930\u094d\u0917\u092e\u0947\u0902 \u0938\u092c\u0938\u0947 \u092a\u0939\u0932\u0947 \u0905\u0917\u094d\u0928\u093f\u0926\u0947\u0935\u0924\u093e\u0915\u093e \u0905\u0927\u093f\u0915\u093e\u0930 \u0930\u0939\u0924\u093e \u0939\u0948\u0964 \u0905\u0917\u094d\u0928\u093f \u0930\u093e\u0924\u094d\u0930\u093f\u092e\u0947\u0902 \u092a\u094d\u0930\u0915\u093e\u0936 \u0915\u0930\u0924\u0940 \u0939\u0948, \u0926\u093f\u0928\u092e\u0947\u0902 \u0928\u0939\u0940\u0902; \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0926\u093f\u0928\u0915\u0947 \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0940 \u0905\u092a\u0947\u0915\u094d\u0937\u093e \u0905\u0917\u094d\u0928\u093f\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u0938\u0940\u092e\u093f\u0924 \u0939\u0948\u0964 \u0905\u0924\u0903 \u0905\u0917\u094d\u0928\u093f\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u0925\u094b\u0921\u093c\u0940 \u0926\u0942\u0930\u0924\u0915 (\u0925\u094b\u0921\u093c\u0947 \u0926\u0947\u0936\u092e\u0947\u0902) \u0924\u0925\u093e \u0925\u094b\u0921\u093c\u0947 \u0938\u092e\u092f\u0924\u0915 \u0930\u0939\u0924\u093e \u0939\u0948; \u0914\u0930 \u0926\u093f\u0928\u0915\u093e \u092a\u094d\u0930\u0915\u093e\u0936 \u092c\u0939\u0941\u0924 \u0926\u0942\u0930\u0924\u0915 \u0924\u0925\u093e \u092c\u0939\u0941\u0924 \u0938\u092e\u092f\u0924\u0915 \u0930\u0939\u0924\u093e \u0939\u0948\u0964"},{text:"\u0927\u0942\u092e\u094b \u0930\u093e\u0924\u094d\u0930\u093f\u0938\u094d\u0924\u0925\u093e \u0915\u0943\u0937\u094d\u0923\u0903 \u0937\u0923\u094d\u092e\u093e\u0938\u093e \u0926\u0915\u094d\u0937\u093f\u0923\u093e\u092f\u0928\u092e\u094d\u0964\n\u0924\u0924\u094d\u0930 \u091a\u093e\u0928\u094d\u0926\u094d\u0930\u092e\u0938\u0902 \u091c\u094d\u092f\u094b\u0924\u093f\u0930\u094d\u092f\u094b\u0917\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928\u093f\u0935\u0930\u094d\u0924\u0924\u0947\u0964\u09648.25\u0964\u0964",translation:"\u0964\u09648.25\u0964\u0964 \u091c\u093f\u0938 \u092e\u093e\u0930\u094d\u0917\u092e\u0947\u0902 \u0927\u0942\u092e\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e, \u0930\u093e\u0924\u094d\u0930\u093f\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e, \u0915\u0943\u0937\u094d\u0923\u092a\u0915\u094d\u0937\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e \u0914\u0930 \u091b\u0903 \u092e\u0939\u0940\u0928\u094b\u0902\u0935\u093e\u0932\u0947 \u0926\u0915\u094d\u0937\u093f\u0923\u093e\u092f\u0928\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e \u0939\u0948, \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u0909\u0938 \u092e\u093e\u0930\u094d\u0917\u0938\u0947 \u0917\u092f\u093e \u0939\u0941\u0906 \u092f\u094b\u0917\u0940 (\u0938\u0915\u093e\u092e \u092e\u0928\u0941\u0937\u094d\u092f) \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e\u0915\u0940 \u091c\u094d\u092f\u094b\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0915\u0930 \u0932\u094c\u091f \u0906\u0924\u093e \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u091c\u0928\u094d\u092e-\u092e\u0930\u0923\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.25\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0927\u0942\u092e\u094b \u0930\u093e\u0924\u094d\u0930\u093f\u0938\u094d\u0924\u0925\u093e \u0915\u0943\u0937\u094d\u0923\u0903 \u09f7\u09f7. \u092a\u094d\u0930\u093e\u092a\u094d\u092f \u0928\u093f\u0935\u0930\u094d\u0924\u0924\u0947',\u0926\u0947\u0936 \u0914\u0930 \u0915\u093e\u0932\u0915\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u091c\u093f\u0924\u0928\u093e \u0905\u0927\u093f\u0915\u093e\u0930 \u0905\u0917\u094d\u0928\u093f \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092a\u094d\u0930\u0915\u093e\u0936\u0915\u0947 \u0926\u0947\u0935\u0924\u093e\u0915\u093e \u0939\u0948, \u0909\u0924\u0928\u093e \u0939\u0940 \u0905\u0927\u093f\u0915\u093e\u0930 \u0927\u0942\u092e \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0905\u0928\u094d\u0927\u0915\u093e\u0930\u0915\u0947 \u0926\u0947\u0935\u0924\u093e\u0915\u093e \u0939\u0948\u0964 \u0935\u0939 \u0927\u0942\u092e\u093e\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0938\u0947 \u091c\u093e\u0928\u0947\u0935\u093e\u0932\u0947 \u091c\u0940\u0935\u094b\u0902\u0915\u094b \u0905\u092a\u0928\u0940 \u0938\u0940\u092e\u093e\u0938\u0947 \u092a\u093e\u0930 \u0915\u0930\u093e\u0915\u0930 \u0930\u093e\u0924\u094d\u0930\u093f\u0915\u0947 \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e\u0915\u0947 \u0905\u0927\u0940\u0928 \u0915\u0930 \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u0930\u093e\u0924\u094d\u0930\u093f\u0915\u093e \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e \u0909\u0938 \u091c\u0940\u0935\u0915\u094b \u0905\u092a\u0928\u0940 \u0938\u0940\u092e\u093e\u0938\u0947 \u092a\u093e\u0930 \u0915\u0930\u093e\u0915\u0930 \u0926\u0947\u0936-\u0915\u093e\u0932\u0915\u094b \u0932\u0947\u0915\u0930 \u092c\u0939\u0941\u0924 \u0926\u0942\u0930\u0924\u0915 \u0905\u0927\u093f\u0915\u093e\u0930 \u0930\u0916\u0928\u0947\u0935\u093e\u0932\u0947 \u0915\u0943\u0937\u094d\u0923\u092a\u0915\u094d\u0937\u0915\u0947 \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e\u0915\u0947 \u0905\u0927\u0940\u0928 \u0915\u0930 \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u0935\u0939 \u0926\u0947\u0935\u0924\u093e \u0909\u0938 \u091c\u0940\u0935\u0915\u094b \u0905\u092a\u0928\u0940 \u0938\u0940\u092e\u093e\u0938\u0947 \u092a\u093e\u0930 \u0915\u0930\u093e\u0915\u0930 \u0926\u0947\u0936 \u0914\u0930 \u0915\u093e\u0932\u0915\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u092c\u0939\u0941\u0924 \u0926\u0942\u0930\u0924\u0915 \u0905\u0927\u093f\u0915\u093e\u0930 \u0930\u0916\u0928\u0947\u0935\u093e\u0932\u0947 \u0926\u0915\u094d\u0937\u093f\u0923\u093e\u092f\u0928\u0915\u0947 \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e\u0915\u0947 \u0938\u092e\u0930\u094d\u092a\u093f\u0924 \u0915\u0930 \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u0935\u0939 \u0926\u0947\u0935\u0924\u093e \u0909\u0938 \u091c\u0940\u0935\u0915\u094b \u091a\u0928\u094d\u0926\u094d\u0930\u0932\u094b\u0915\u0915\u0947 \u0905\u0927\u093f\u092a\u0924\u093f \u0926\u0947\u0935\u0924\u093e\u0915\u094b \u0938\u094c\u0902\u092a \u0926\u0947\u0924\u093e \u0939\u0948\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0938\u0947 \u091c\u093e\u0928\u0947\u0935\u093e\u0932\u093e \u0935\u0939 \u091c\u0940\u0935 \u0927\u0942\u092e, \u0930\u093e\u0924\u094d\u0930\u093f, \u0915\u0943\u0937\u094d\u0923\u092a\u0915\u094d\u0937 \u0914\u0930 \u0926\u0915\u094d\u0937\u093f\u0923\u093e\u092f\u0928\u0915\u0947 \u0926\u0947\u0936\u0915\u094b \u092a\u093e\u0930 \u0915\u0930\u0924\u093e \u0939\u0941\u0906 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e\u0915\u0940 \u091c\u094d\u092f\u094b\u0924\u093f\u0915\u094b \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u091c\u0939\u093e\u0901 \u0905\u092e\u0943\u0924\u0915\u093e \u092a\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948, \u0910\u0938\u0947 \u0938\u094d\u0935\u0930\u094d\u0917\u093e\u0926\u093f \u0926\u093f\u0935\u094d\u092f \u0932\u094b\u0915\u094b\u0902\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u092b\u093f\u0930 \u0905\u092a\u0928\u0947 \u092a\u0941\u0923\u094d\u092f\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0928\u094d\u092f\u0942\u0928\u093e\u0927\u093f\u0915 \u0938\u092e\u092f\u0924\u0915 \u0935\u0939\u093e\u0901 \u0930\u0939\u0915\u0930 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092d\u094b\u0917 \u092d\u094b\u0917\u0915\u0930 \u092a\u0940\u091b\u0947 \u0932\u094c\u091f \u0906\u0924\u093e \u0939\u0948\u0964\u092f\u0939\u093e\u0901 \u090f\u0915 \u0927\u094d\u092f\u093e\u0928 \u0926\u0947\u0928\u0947\u0915\u0940 \u092c\u093e\u0924 \u0939\u0948 \u0915\u093f \u092f\u0939 \u091c\u094b \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u0923\u094d\u0921\u0932 \u0926\u0940\u0916\u0924\u093e \u0939\u0948, \u092f\u0939 \u091a\u0928\u094d\u0926\u094d\u0930\u0932\u094b\u0915 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092f\u0939 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u0923\u094d\u0921\u0932 \u0924\u094b \u092a\u0943\u0925\u094d\u0935\u0940\u0915\u0947 \u092c\u0939\u0941\u0924 \u0928\u091c\u0926\u0940\u0915 \u0939\u0948, \u091c\u092c \u0915\u093f \u091a\u0928\u094d\u0926\u094d\u0930\u0932\u094b\u0915 \u0938\u0942\u0930\u094d\u092f\u0938\u0947 \u092d\u0940 \u092c\u0939\u0941\u0924 \u090a\u0901\u091a\u093e \u0939\u0948\u0964 \u0909\u0938\u0940 \u091a\u0928\u094d\u0926\u094d\u0930\u0932\u094b\u0915 \u0938\u0947 \u0905\u092e\u0943\u0924 \u0907\u0938 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u0923\u094d\u0921\u0932\u092e\u0947\u0902 \u0906\u0924\u093e \u0939\u0948, \u091c\u093f\u0938\u0938\u0947 \u0936\u0941\u0915\u094d\u0932\u092a\u0915\u094d\u0937 \u092e\u0947\u0902 \u0913\u0937\u0927\u093f\u092f\u093e\u0901 \u092a\u0941\u0937\u094d\u091f \u0939\u094b\u0924\u0940 \u0939\u0948\u0902\u0964\u0905\u092c \u090f\u0915 \u0938\u092e\u091d\u0928\u0947\u0915\u0940 \u092c\u093e\u0924 \u0939\u0948 \u0915\u093f \u092f\u0939\u093e\u0901 \u091c\u093f\u0938 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0939\u0948, \u0935\u0939 \u0936\u0941\u0915\u094d\u0932\u092e\u093e\u0930\u094d\u0917\u0915\u0940 \u0905\u092a\u0947\u0915\u094d\u0937\u093e \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917 \u0939\u0948\u0964 \u0935\u093e\u0938\u094d\u0924\u0935 \u092e\u0947\u0902 \u0924\u094b \u092f\u0939 \u092e\u093e\u0930\u094d\u0917 \u090a\u0901\u091a\u0947-\u090a\u0901\u091a\u0947 \u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0928\u0947\u0915\u093e \u0939\u0948\u0964 \u0938\u093e\u092e\u093e\u0928\u094d\u092f \u092e\u0928\u0941\u0937\u094d\u092f \u092e\u0930\u0915\u0930 \u092e\u0943\u0924\u094d\u092f\u0941\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u0928\u094d\u092e \u0932\u0947\u0924\u0947 \u0939\u0948\u0902, \u091c\u094b \u092a\u093e\u092a\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0935\u0947 \u0906\u0938\u0941\u0930\u0940 \u092f\u094b\u0928\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0909\u0928\u0938\u0947 \u092d\u0940 \u091c\u094b \u0905\u0927\u093f\u0915 \u092a\u093e\u092a\u0940 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0935\u0947 \u0928\u0930\u0915\u0915\u0947 \u0915\u0941\u0923\u094d\u0921\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902, \u0907\u0928 \u0938\u092c \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0938\u0947 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0938\u0947 \u091c\u093e\u0928\u0947\u0935\u093e\u0932\u0947 \u092c\u0939\u0941\u0924 \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u0948\u0902\u0964 \u0935\u0947 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e\u0915\u0940 \u091c\u094d\u092f\u094b\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0924\u0947 \u0939\u0948\u0902, \u0910\u0938\u093e \u0915\u0939\u0928\u0947 \u0915\u093e \u092f\u0939\u0940 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u091c\u0928\u094d\u092e\u092e\u0930\u0923\u0915\u0947 \u091c\u093f\u0924\u0928\u0947 \u092e\u093e\u0930\u094d\u0917 \u0939\u0948\u0902 \u0909\u0928 \u0938\u092c \u092e\u093e\u0930\u094d\u0917\u094b\u0902\u0938\u0947 \u092f\u0939 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917 (\u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f\u0915\u093e \u0939\u094b\u0928\u0947 \u0938\u0947) \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u0948 \u0914\u0930 \u0909\u0928\u0915\u0940 \u0905\u092a\u0947\u0915\u094d\u0937\u093e \u092a\u094d\u0930\u0915\u093e\u0936\u092e\u092f \u0939\u0948\u0964\u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0938\u0947 \u0932\u094c\u091f\u0924\u0947 \u0938\u092e\u092f \u0935\u0939 \u091c\u0940\u0935 \u092a\u0939\u0932\u0947 \u0906\u0915\u093e\u0936\u092e\u0947\u0902 \u0906\u0924\u093e \u0939\u0948\u0964 \u092b\u093f\u0930 \u0935\u093e\u092f\u0941\u0915\u0947 \u0905\u0927\u0940\u0928 \u0939\u094b\u0915\u0930 \u092c\u093e\u0926\u0932\u094b\u0902\u092e\u0947\u0902 \u0906\u0924\u093e \u0939\u0948 \u0914\u0930 \u092c\u093e\u0926\u0932\u094b\u0902\u092e\u0947\u0902\u0938\u0947 \u0935\u0930\u094d\u0937\u093e\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092d\u0942\u092e\u0923\u094d\u0921\u0932\u092a\u0930 \u0906\u0915\u0930 \u0905\u0928\u094d\u0928\u092e\u0947\u0902 \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0924\u093e \u0939\u0948\u0964 \u092b\u093f\u0930 \u0915\u0930\u094d\u092e\u093e\u0928\u0941\u0938\u093e\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u0940 \u092f\u094b\u0928\u093f\u0915\u0947 \u092a\u0941\u0930\u0941\u0937\u094b\u0902\u092e\u0947\u0902 \u0905\u0928\u094d\u0928\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u092a\u094d\u0930\u0935\u0947\u0936 \u0915\u0930\u0924\u093e \u0939\u0948 \u0914\u0930 \u092a\u0941\u0930\u0941\u0937\u0938\u0947 \u0938\u094d\u0924\u094d\u0930\u0940-\u091c\u093e\u0924\u093f\u092e\u0947\u0902 \u091c\u093e\u0915\u0930 \u0936\u0930\u0940\u0930 \u0927\u093e\u0930\u0923 \u0915\u0930\u0915\u0947 \u091c\u0928\u094d\u092e \u0932\u0947\u0924\u093e \u0939\u0948\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0935\u0939 \u091c\u0928\u094d\u092e-\u092e\u0930\u0923\u0915\u0947 \u091a\u0915\u094d\u0915\u0930\u092e\u0947\u0902 \u092a\u0921\u093c \u091c\u093e\u0924\u093e \u0939\u0948\u0964\u092f\u0939\u093e\u0901 \u0938\u0915\u093e\u092e \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u094b \u092d\u0940 '\u092f\u094b\u0917\u0940' \u0915\u094d\u092f\u094b\u0902 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948? \u0907\u0938\u0915\u0947 \u0905\u0928\u0947\u0915 \u0915\u093e\u0930\u0923 \u0939\u094b \u0938\u0915\u0924\u0947 \u0939\u0948\u0902; \u091c\u0948\u0938\u0947,(1) \u0917\u0940\u0924\u093e\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092e\u0930\u0928\u0947\u0935\u093e\u0932\u0947 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0940 \u0924\u0940\u0928 \u0917\u0924\u093f\u092f\u093e\u0901 \u092c\u0924\u093e\u092f\u0940 \u0939\u0948\u0902, \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f, \u092e\u0927\u094d\u092f\u0917\u0924\u093f \u0914\u0930 \u0905\u0927\u094b\u0917\u0924\u093f (\u0917\u0940\u0924\u093e 14\u0964 18)\u0964 \u0907\u0928\u092e\u0947\u0902\u0938\u0947 \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u0907\u0938 \u092a\u094d\u0930\u0915\u0930\u0923\u092e\u0947\u0902 \u0939\u0941\u0906 \u0939\u0948\u0964 \u092e\u0927\u094d\u092f\u0917\u0924\u093f \u0914\u0930 \u0905\u0927\u094b\u0917\u0924\u093f\u0938\u0947 \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f \u0936\u094d\u0930\u0947\u0937\u094d\u0920 \u0939\u094b\u0928\u0947 \u0915\u0947 \u0915\u093e\u0930\u0923 \u092f\u0939\u093e\u0901 \u0938\u0915\u093e\u092e \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u094b \u092d\u0940 \u092f\u094b\u0917\u0940 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964,(2) \u091c\u094b \u0915\u0947\u0935\u0932 \u092d\u094b\u0917 \u092d\u094b\u0917\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0939\u0940 \u090a\u0901\u091a\u0947 \u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0924\u093e \u0939\u0948, \u0909\u0938\u0928\u0947 \u0938\u0902\u092f\u092e\u092a\u0942\u0930\u094d\u0935\u0915 \u0907\u0938 \u0932\u094b\u0915\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u0915\u093e \u0924\u094d\u092f\u093e\u0917 \u0915\u093f\u092f\u093e \u0939\u0948\u0964 \u0907\u0938 \u0924\u094d\u092f\u093e\u0917\u0938\u0947 \u0909\u0938\u0915\u0940 \u092f\u0939\u093e\u0901\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u0915\u0947 \u092e\u093f\u0932\u0928\u0947 \u0914\u0930 \u0928 \u092e\u093f\u0932\u0928\u0947\u092e\u0947\u0902 \u0938\u092e\u0924\u093e \u0939\u094b \u0917\u092f\u0940 \u0939\u0948\u0964 \u0907\u0938 \u0906\u0902\u0936\u093f\u0915 \u0938\u092e\u0924\u093e\u0915\u094b \u0932\u0947\u0915\u0930 \u0939\u0940 \u0909\u0938\u0915\u094b \u092f\u0939\u093e\u0901 \u092f\u094b\u0917\u0940 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964\n(3) \u091c\u093f\u0928\u0915\u093e \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u093e \u0939\u0948, \u092a\u0930 \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0915\u093f\u0938\u0940 \u0938\u0942\u0915\u094d\u0937\u094d\u092e \u092d\u094b\u0917-\u0935\u093e\u0938\u0928\u093e\u0915\u0947 \u0915\u093e\u0930\u0923 \u0935\u0947 \u092f\u094b\u0917\u0938\u0947,\u0935\u093f\u091a\u0932\u093f\u0924\u092e\u0928\u093e \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902, \u0924\u094b \u0935\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u0906\u0926\u093f \u090a\u0901\u091a\u0947 \u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u0935\u0939\u093e\u0901 \u092c\u0939\u0941\u0924 \u0938\u092e\u092f\u0924\u0915 \u0930\u0939\u0915\u0930 \u092a\u0940\u091b\u0947 \u092f\u0939\u093e\u0901 \u092d\u0942\u092e\u0923\u094d\u0921\u0932\u092a\u0930 \u0906\u0915\u0930 \u0936\u0941\u0926\u094d\u0927 \u0936\u094d\u0930\u0940\u092e\u093e\u0928\u094b\u0902\u0915\u0947 \u0918\u0930\u092e\u0947\u0902 \u091c\u0928\u094d\u092e \u0932\u0947\u0924\u0947 \u0939\u0948\u0902\u0964 \u0910\u0938\u0947 \u092f\u094b\u0917\u092d\u094d\u0930\u0937\u094d\u091f \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u093e \u092d\u0940 \u091c\u093e\u0928\u0947\u0915\u093e \u092f\u0939\u0940 \u092e\u093e\u0930\u094d\u0917 (\u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917) \u0939\u094b\u0928\u0947 \u0938\u0947 \u092f\u0939\u093e\u0901 \u0938\u0915\u093e\u092e \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u094b \u092d\u0940 \u092f\u094b\u0917\u0940 \u0915\u0939 \u0926\u093f\u092f\u093e \u0939\u0948\u0964\u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092a\u0940\u091b\u0947\u0915\u0947 (\u091a\u094c\u092c\u0940\u0938\u0935\u0947\u0902) \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092c\u094d\u0930\u0939\u094d\u092e\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u0915\u0947 \u0932\u093f\u092f\u0947 '\u092c\u094d\u0930\u0939\u094d\u092e\u0935\u093f\u0926\u094b \u091c\u0928\u093e\u0903' \u0915\u0939 \u0915\u0930 \u092c\u0939\u0941\u0935\u091a\u0928\u0915\u093e \u092a\u094d\u0930\u092f\u094b\u0917 \u0915\u093f\u092f\u093e \u0939\u0948 \u0914\u0930 \u092f\u0939\u093e\u0901 \u091a\u0928\u094d\u0926\u094d\u0930\u092e\u093e\u0915\u0940 \u091c\u094d\u092f\u094b\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u094b\u0902\u0915\u0947 \u0932\u093f\u092f\u0947 '\u092f\u094b\u0917\u0940'\xa0\u0915\u0939 \u0915\u0930 \u090f\u0915\u0935\u091a\u0928\u0915\u093e \u092a\u094d\u0930\u092f\u094b\u0917 \u0915\u093f\u092f\u093e \u0939\u0948\u0964 \u0907\u0938\u0938\u0947 \u0910\u0938\u093e \u0905\u0928\u0941\u092e\u093e\u0928 \u0939\u094b\u0924\u093e \u0939\u0948 \u0915\u093f \u0938\u092d\u0940 \u092e\u0928\u0941\u0937\u094d\u092f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u0947 \u0905\u0927\u093f\u0915\u093e\u0930\u0940 \u0939\u0948\u0902, \u0914\u0930 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f \u0938\u0941\u0917\u092e \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0938\u092c\u0915\u094b \u0938\u094d\u0935\u0924\u0903 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u0948\u0902\u0964 \u0938\u094d\u0935\u0924\u0903\u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0924\u0924\u094d\u0924\u094d\u0935\u0915\u093e \u0905\u0928\u0941\u092d\u0935 \u092c\u0921\u093c\u093e \u0938\u0941\u0917\u092e \u0939\u0948\u0964 \u0907\u0938\u092e\u0947\u0902 \u0915\u0930\u0928\u093e \u0915\u0941\u091b \u0928\u0939\u0940\u0902 \u092a\u0921\u093c\u0924\u093e\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092c\u0939\u0941\u0935\u091a\u0928\u0915\u093e \u092a\u094d\u0930\u092f\u094b\u0917 \u0915\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u0938\u094d\u0935\u0930\u094d\u0917 \u0906\u0926\u093f\u0915\u0940 \u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u0947 \u0932\u093f\u092f\u0947 \u0935\u093f\u0936\u0947\u0937 \u0915\u094d\u0930\u093f\u092f\u093e \u0915\u0930\u0928\u0940 \u092a\u0921\u093c\u0924\u0940 \u0939\u0948, \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0915\u093e \u0938\u0902\u0917\u094d\u0930\u0939 \u0915\u0930\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948, \u0935\u093f\u0927\u093f-\u0935\u093f\u0927\u093e\u0928\u0915\u093e \u092a\u093e\u0932\u0928 \u0915\u0930\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948\u0964 \u0907\u0938 \u092a\u094d\u0930\u0915\u093e\u0930 \u0938\u094d\u0935\u0930\u094d\u0917\u093e\u0926\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u0947 \u092e\u0947\u0902 \u092d\u0940 \u0915\u0920\u093f\u0928\u0924\u093e \u0939\u0948 \u0924\u0925\u093e \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0928\u0947 \u0915\u0947 \u092c\u093e\u0926 \u092a\u0940\u091b\u0947 \u0932\u094c\u091f\u0915\u0930 \u092d\u0940 \u0906\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092f\u0939\u093e\u0901 \u090f\u0915\u0935\u091a\u0928 \u0926\u093f\u092f\u093e \u0917\u092f\u093e \u0939\u0948\u0964\n\u0935\u093f\u0936\u0947\u0937 \u092c\u093e\u0924\n(1) \u091c\u093f\u0928\u0915\u093e \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u093e \u0939\u0948; \u092a\u0930\u0928\u094d\u0924\u0941 \u0938\u0941\u0916\u092d\u094b\u0917\u0915\u0940 \u0938\u0942\u0915\u094d\u0937\u094d\u092e \u0935\u093e\u0938\u0928\u093e \u0938\u0930\u094d\u0935\u0925\u093e \u0928\u0939\u0940\u0902 \u092e\u093f\u091f\u0940 \u0939\u0948, \u0935\u0947 \u0936\u0930\u0940\u0930 \u091b\u094b\u0921\u093c\u0915\u0930 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0915\u0947 \u092d\u094b\u0917 \u092d\u094b\u0917\u0928\u0947\u092a\u0930 \u0909\u0928\u0915\u0940 \u0935\u0939 \u0935\u093e\u0938\u0928\u093e \u092e\u093f\u091f \u091c\u093e\u0924\u0940 \u0939\u0948 \u0924\u094b \u0935\u0947 \u092e\u0941\u0915\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902\u0964 \u0907\u0928\u0915\u093e \u0935\u0930\u094d\u0923\u0928 \u092f\u0939\u093e\u0901 \u091a\u094c\u092c\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u0939\u0941\u0906 \u0939\u0948\u0964\n\t\u091c\u093f\u0928\u0915\u093e \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u093e \u0939\u0940 \u0939\u0948 \u0914\u0930 \u091c\u093f\u0928\u092e\u0947\u0902 \u0928 \u092f\u0939\u093e\u0901\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u0915\u0940 \u0935\u093e\u0938\u0928\u093e \u0939\u0948 \u0924\u0925\u093e \u0928 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u0915\u0940; \u092a\u0930\u0928\u094d\u0924\u0941 \u091c\u094b \u0905\u0928\u094d\u0924\u0915\u093e\u0932\u092e\u0947\u0902 \u0928\u093f\u0930\u094d\u0917\u0941\u0923\u0915\u0947 \u0927\u094d\u092f\u093e\u0928\u0938\u0947 \u0935\u093f\u091a\u0932\u093f\u0924 \u0939\u094b \u0917\u092f\u0947 \u0939\u0948\u0902, \u0935\u0947 \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u0906\u0926\u093f \u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u0928\u0939\u0940\u0902 \u091c\u093e\u0924\u0947\u0964 \u0935\u0947 \u0924\u094b \u0938\u0940\u0927\u0947 \u0939\u0940 \u092f\u094b\u0917\u093f\u092f\u094b\u0902\u0915\u0947 \u0915\u0941\u0932\u092e\u0947\u0902 \u091c\u0928\u094d\u092e \u0932\u0947\u0924\u0947 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u091c\u0939\u093e\u0901 \u092a\u0942\u0930\u094d\u0935\u091c\u0928\u094d\u092e\u0915\u0943\u0924 \u0927\u094d\u092f\u093e\u0928\u0930\u0942\u092a \u0938\u093e\u0927\u0928 \u0920\u0940\u0915 \u0924\u0930\u0939 \u0938\u0947 \u0939\u094b \u0938\u0915\u0947, \u0910\u0938\u0947 \u092f\u094b\u0917\u093f\u092f\u094b\u0902\u0915\u0947 \u0915\u0941\u0932\u092e\u0947\u0902 \u0909\u0928\u0915\u093e \u091c\u0928\u094d\u092e \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0935\u0939\u093e\u0901 \u0935\u0947 \u0938\u093e\u0927\u0928 \u0915\u0930\u0915\u0947 \u092e\u0941\u0915\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u0947 \u0939\u0948\u0902 (\u0917\u0940\u0924\u093e 6\u0964 42 43)\u0964\xa0"},{text:"\u0936\u0941\u0915\u094d\u0932\u0915\u0943\u0937\u094d\u0923\u0947 \u0917\u0924\u0940 \u0939\u094d\u092f\u0947\u0924\u0947 \u091c\u0917\u0924\u0903 \u0936\u093e\u0936\u094d\u0935\u0924\u0947 \u092e\u0924\u0947\u0964\n\u090f\u0915\u092f\u093e \u092f\u093e\u0924\u094d\u092f\u0928\u093e\u0935\u0943\u0924\u094d\u0924\u093f\u092e\u0928\u094d\u092f\u092f\u093e\u093d\u093d\u0935\u0930\u094d\u0924\u0924\u0947 \u092a\u0941\u0928\u0903\u0964\u09648.26\u0964\u0964",translation:"\u0964\u09648.26\u0964\u0964 \u0915\u094d\u092f\u094b\u0902\u0915\u093f \u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923, \u092f\u0947 \u0926\u094b\u0928\u094b\u0902 \u0917\u0924\u093f\u092f\u093e\u0901 \u0905\u0928\u093e\u0926\u093f\u0915\u093e\u0932\u0938\u0947 \u091c\u0917\u0924\u094d-(\u092a\u094d\u0930\u093e\u0923\u093f\u092e\u093e\u0924\u094d\u0930-) \u0915\u0947 \u0938\u093e\u0925 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0930\u0916\u0928\u0947\u0935\u093e\u0932\u0940 \u092e\u093e\u0928\u0940 \u0917\u0908 \u0939\u0948\u0902\u0964 \u0907\u0928\u092e\u0947\u0902\u0938\u0947 \u090f\u0915 \u0917\u0924\u093f\u092e\u0947\u0902 \u091c\u093e\u0928\u0947\u0935\u093e\u0932\u0947\u0915\u094b \u0932\u094c\u091f\u0928\u093e \u0928\u0939\u0940\u0902 \u092a\u0921\u093c\u0924\u093e \u0914\u0930 \u0926\u0942\u0938\u0930\u0940 \u0917\u0924\u093f\u092e\u0947\u0902 \u091c\u093e\u0928\u0947\u0935\u093e\u0932\u0947\u0915\u094b \u0932\u094c\u091f\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948\u0964 ",commentary:"\u0964\u09648.26\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0936\u0941\u0915\u094d\u0932\u0915\u0943\u0937\u094d\u0923\u0947 \u0917\u0924\u0940 \u0939\u094d\u092f\u0947\u0924\u0947 \u091c\u0917\u0924\u0903 \u0936\u093e\u0936\u094d\u0935\u0924\u0947 \u092e\u0924\u0947',\u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923,\u0907\u0928 \u0926\u094b\u0928\u094b\u0902 \u092e\u093e\u0930\u094d\u0917\u094b\u0902\u0915\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u091c\u0917\u0924\u094d\u0915\u0947 \u0938\u092d\u0940 \u091a\u0930-\u0905\u091a\u0930 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u0947 \u0938\u093e\u0925 \u0939\u0948\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f\u0915\u0947 \u0938\u093e\u0925 \u092e\u0928\u0941\u0937\u094d\u092f \u0915\u093e \u0924\u094b \u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0939\u0948 \u0914\u0930 \u091a\u0930-\u0905\u091a\u0930 \u092a\u094d\u0930\u093e\u0923\u093f\u092f\u094b\u0902\u0915\u093e \u092a\u0930\u092e\u094d\u092a\u0930\u093e\u0938\u0947 \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u091a\u0930-\u0905\u091a\u0930 \u092a\u094d\u0930\u093e\u0923\u0940 \u0915\u094d\u0930\u092e\u0938\u0947 \u0905\u0925\u0935\u093e \u092d\u0917\u0935\u0924\u094d\u0915\u0943\u092a\u093e\u0938\u0947 \u0915\u092d\u0940-\u0928-\u0915\u092d\u0940 \u092e\u0928\u0941\u0937\u094d\u092f-\u091c\u0928\u094d\u092e \u092e\u0947\u0902 \u0906\u0924\u0947 \u0939\u0940 \u0939\u0948\u0902 \u0914\u0930 \u092e\u0928\u0941\u0937\u094d\u092f\u091c\u0928\u094d\u092e \u092e\u0947\u0902 \u0915\u093f\u092f\u0947 \u0939\u0941\u090f \u0915\u0930\u094d\u092e\u094b\u0902\u0915\u0947 \u0905\u0928\u0941\u0938\u093e\u0930 \u0939\u0940 \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f, \u092e\u0927\u094d\u092f\u0917\u0924\u093f \u0914\u0930 \u0905\u0927\u094b\u0917\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948\u0964 \u0905\u092c \u0935\u0947 \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0915\u0930\u0947\u0902 \u0905\u0925\u0935\u093e \u0928 \u0915\u0930\u0947\u0902, \u092a\u0930 \u0909\u0928 \u0938\u092c\u0915\u093e \u0938\u092e\u094d\u092c\u0928\u094d\u0927 \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923-\u0917\u0924\u093f\u0915\u0947 \u0938\u093e\u0925 \u0939\u0948 \u0939\u0940\u0964\u091c\u092c\u0924\u0915 \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0915\u0947 \u092d\u0940\u0924\u0930 \u0905\u0938\u0924\u094d (\u0935\u093f\u0928\u093e\u0936\u0940) \u0935\u0938\u094d\u0924\u0941\u0913\u0902\u0915\u093e \u0906\u0926\u0930 \u0939\u0948, \u0915\u093e\u092e\u0928\u093e \u0939\u0948, \u0924\u092c\u0924\u0915 \u0935\u0947 \u0915\u093f\u0924\u0928\u0940 \u0939\u0940 \u090a\u0901\u091a\u0940 \u092d\u094b\u0917-\u092d\u0942\u092e\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u0915\u094d\u092f\u094b\u0902 \u0928 \u091a\u0932\u0947 \u091c\u093e\u092f\u0901, \u092a\u0930 \u0905\u0938\u0924\u094d \u0935\u0938\u094d\u0924\u0941\u0915\u093e \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0930\u0939\u0928\u0947\u0938\u0947 \u0909\u0928\u0915\u0940 \u0915\u092d\u0940 \u092d\u0940 \u0905\u0927\u094b\u0917\u0924\u093f \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948\u0964 \u0907\u0938\u0940 \u0924\u0930\u0939 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0947 \u0905\u0902\u0936 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0909\u0928\u0915\u0940 \u0915\u092d\u0940 \u092d\u0940 \u090a\u0930\u094d\u0927\u094d\u0935\u0917\u0924\u093f \u0939\u094b \u0938\u0915\u0924\u0940 \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0938\u093e\u0927\u0915\u0915\u094b \u0939\u0930\u0926\u092e \u0938\u091c\u0917 \u0930\u0939\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947 \u0914\u0930 \u0905\u092a\u0928\u0947 \u0905\u0928\u094d\u0924\u0903\u0915\u0930\u0923\u092e\u0947\u0902 \u0935\u093f\u0928\u093e\u0936\u0940 \u0935\u0938\u094d\u0924\u0941\u0913\u0902\u0915\u094b \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928\u0939\u0940\u0902 \u0926\u0947\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u092f\u0939 \u0939\u0941\u0906 \u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u092a\u094d\u0930\u093e\u092a\u094d\u0924\u093f\u0915\u0947 \u0932\u093f\u092f\u0947 \u0915\u093f\u0938\u0940 \u092d\u0940 \u0932\u094b\u0915\u092e\u0947\u0902, \u092f\u094b\u0928\u093f\u092e\u0947\u0902 \u0915\u094b\u0908 \u092c\u093e\u0927\u093e \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0907\u0938\u0915\u093e \u0915\u093e\u0930\u0923 \u092f\u0939 \u0939\u0948 \u0915\u093f \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0947 \u0938\u093e\u0925 \u0915\u093f\u0938\u0940 \u092d\u0940 \u092a\u094d\u0930\u093e\u0923\u0940\u0915\u093e \u0915\u092d\u0940 \u0938\u092e\u094d\u092c\u0928\u094d\u0927-\u0935\u093f\u091a\u094d\u091b\u0947\u0926 \u0939\u094b\u0924\u093e \u0939\u0940 \u0928\u0939\u0940\u0902\u0964 \u0905\u0924\u0903 \u0928 \u091c\u093e\u0928\u0947 \u0915\u092c \u0914\u0930 \u0915\u093f\u0938 \u092f\u094b\u0928\u093f\u092e\u0947\u0902 \u0935\u0939 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u0924\u0930\u092b \u091a\u0932 \u0926\u0947, \u0907\u0938 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u0938\u093e\u0927\u0915\u0915\u094b \u0915\u093f\u0938\u0940 \u092d\u0940 \u092a\u094d\u0930\u093e\u0923\u0940\u0915\u094b \u0918\u0943\u0923\u093e\u0915\u0940 \u0926\u0943\u0937\u094d\u091f\u093f \u0938\u0947 \u0926\u0947\u0916\u0928\u0947\u0915\u093e \u0905\u0927\u093f\u0915\u093e\u0930 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964\u091a\u094c\u0925\u0947 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u092a\u0939\u0932\u0947 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 '\u092f\u094b\u0917' \u0915\u094b \u0905\u0935\u094d\u092f\u092f \u0915\u0939\u093e \u0939\u0948\u0964 \u091c\u0948\u0938\u0947 \u092f\u094b\u0917 \u0905\u0935\u094d\u092f\u092f \u0939\u0948, \u0910\u0938\u0947 \u0939\u0940 \u092f\u0947 \u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923, \u0926\u094b\u0928\u094b\u0902 \u0917\u0924\u093f\u092f\u093e\u0901 \u092d\u0940 \u0905\u0935\u094d\u092f\u092f, \u0936\u093e\u0936\u094d\u0935\u0924 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092f\u0947 \u0926\u094b\u0928\u094b\u0902 \u0917\u0924\u093f\u092f\u093e\u0901 \u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0930\u0939\u0928\u0947\u0935\u093e\u0932\u0940 \u0939\u0948\u0902, \u0905\u0928\u093e\u0926\u093f\u0915\u093e\u0932\u0938\u0947 \u0939\u0948\u0902 \u0914\u0930 \u091c\u0917\u0924\u094d\u0915\u0947 \u0932\u093f\u092f\u0947 \u0905\u0928\u0928\u094d\u0924\u0915\u093e\u0932\u0924\u0915 \u091a\u0932\u0924\u0940 \u0930\u0939\u0947\u0902\u0917\u0940\u0964"},{text:"\u0928\u0948\u0924\u0947 \u0938\u0943\u0924\u0940 \u092a\u093e\u0930\u094d\u0925 \u091c\u093e\u0928\u0928\u094d\u092f\u094b\u0917\u0940 \u092e\u0941\u0939\u094d\u092f\u0924\u093f \u0915\u0936\u094d\u091a\u0928\u0964\n\u0924\u0938\u094d\u092e\u093e\u0924\u094d\u0938\u0930\u094d\u0935\u0947\u0937\u0941 \u0915\u093e\u0932\u0947\u0937\u0941 \u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924\u094b \u092d\u0935\u093e\u0930\u094d\u091c\u0941\u0928\u0964\u09648.27\u0964\u0964",translation:"\u0964\u09648.27\u0964\u0964 \u0939\u0947 \u092a\u0943\u0925\u093e\u0928\u0928\u094d\u0926\u0928\xa0 ! \u0907\u0928 \u0926\u094b\u0928\u094b\u0902 \u092e\u093e\u0930\u094d\u0917\u094b\u0902\u0915\u094b \u091c\u093e\u0928\u0928\u0947\u0935\u093e\u0932\u093e \u0915\u094b\u0908 \u092d\u0940 \u092f\u094b\u0917\u0940 \u092e\u094b\u0939\u093f\u0924 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u0905\u0924\u0903 \u0939\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 ! \u0924\u0942 \u0938\u092c \u0938\u092e\u092f\u092e\u0947\u0902 \u092f\u094b\u0917\u092f\u0941\u0915\u094d\u0924 \u0939\u094b \u091c\u093e\u0964 ",commentary:"\u0964\u09648.27\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0928\u0948\u0924\u0947 \u0938\u0943\u0924\u0940 \u092a\u093e\u0930\u094d\u0925 \u091c\u093e\u0928\u0928\u094d\u092f\u094b\u0917\u0940 \u092e\u0941\u0939\u094d\u092f\u0924\u093f \u0915\u0936\u094d\u091a\u0928',\u0936\u0941\u0915\u094d\u0932\u092e\u093e\u0930\u094d\u0917 \u092a\u094d\u0930\u0915\u093e\u0936\u092e\u092f \u0939\u0948 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917 \u0905\u0928\u094d\u0927\u0915\u093e\u0930\u092e\u092f \u0939\u0948\u0964 \u091c\u093f\u0928\u0915\u0947 \u0905\u0928\u094d\u0924\u0903\u0915\u0930\u0923\u092e\u0947\u0902 \u0909\u0924\u094d\u092a\u0924\u094d\u0924\u093f-\u0935\u093f\u0928\u093e\u0936\u0936\u0940\u0932 \u0935\u0938\u094d\u0924\u0941\u0913\u0902\u0915\u093e \u092e\u0939\u0924\u094d\u0924\u094d\u0935 \u0928\u0939\u0940\u0902 \u0939\u0948 \u0914\u0930 \u091c\u093f\u0928\u0915\u0947 \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f, \u0927\u094d\u092f\u0947\u092f\u092e\u0947\u0902 \u092a\u094d\u0930\u0915\u093e\u0936\u0938\u094d\u0935\u0930\u0942\u092a (\u091c\u094d\u091e\u093e\u0928\u0938\u094d\u0935\u0930\u0942\u092a) \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e \u0939\u0940 \u0939\u0948\u0902, \u0910\u0938\u0947 \u0935\u0947 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u0940 \u0924\u0930\u092b \u091a\u0932\u0928\u0947\u0935\u093e\u0932\u0947 \u0938\u093e\u0927\u0915 \u0936\u0941\u0915\u094d\u0932\u092e\u093e\u0930\u094d\u0917\u0940 \u0939\u0948\u0902 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0909\u0928\u0915\u093e \u092e\u093e\u0930\u094d\u0917 \u092a\u094d\u0930\u0915\u093e\u0936\u092e\u092f \u0939\u0948\u0964 \u091c\u094b \u0938\u0902\u0938\u093e\u0930 \u092e\u0947\u0902 \u0930\u091a\u0947-\u092a\u091a\u0947 \u0939\u0948\u0902 \u0914\u0930 \u091c\u093f\u0928\u0915\u093e \u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0915\u093e \u0938\u0902\u0917\u094d\u0930\u0939 \u0915\u0930\u0928\u093e \u0914\u0930 \u0909\u0928\u0938\u0947 \u0938\u0941\u0916 \u092d\u094b\u0917\u0928\u093e \u0939\u0940 \u0927\u094d\u092f\u0947\u092f \u0939\u094b\u0924\u093e \u0939\u0948, \u0910\u0938\u0947 \u092e\u0928\u0941\u0937\u094d\u092f \u0924\u094b \u0918\u094b\u0930 \u0905\u0928\u094d\u0927\u0915\u093e\u0930\u092e\u0947\u0902 \u0939\u0948\u0902 \u0939\u0940 \u092a\u0930 \u091c\u094b \u092d\u094b\u0917 \u092d\u094b\u0917\u0928\u0947\u0915\u0947 \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f\u0938\u0947 \u092f\u0939\u093e\u0901\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u0938\u0947 \u0938\u0902\u092f\u092e \u0915\u0930\u0915\u0947 \u092f\u091c\u094d\u091e, \u0924\u092a, \u0926\u093e\u0928 \u0906\u0926\u093f \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u0935\u093f\u0939\u093f\u0924 \u0936\u0941\u092d \u0915\u0930\u094d\u092e \u0915\u0930\u0924\u0947 \u0939\u0948\u0902 \u0914\u0930 \u092e\u0930\u0928\u0947\u0915\u0947 \u092c\u093e\u0926 \u0938\u094d\u0935\u0930\u094d\u0917\u093e\u0926\u093f \u090a\u0901\u091a\u0940 \u092d\u094b\u0917-\u092d\u0942\u092e\u093f\u092f\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0924\u0947 \u0939\u0948\u0902, \u0935\u0947 \u092f\u0926\u094d\u092f\u092a\u093f \u092f\u0939\u093e\u0901\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u092e\u0947\u0902 \u0906\u0938\u0915\u094d\u0924 \u092e\u0928\u0941\u0937\u094d\u092f\u094b\u0902\u0938\u0947 \u090a\u0901\u091a\u0947 \u0909\u0920\u0947 \u0939\u0941\u090f \u0939\u0948\u0902, \u0924\u094b \u092d\u0940 \u0906\u0928\u0947-\u091c\u093e\u0928\u0947\u0935\u093e\u0932\u0947 (\u091c\u0928\u094d\u092e-\u092e\u0930\u0923\u0915\u0947) \u092e\u093e\u0930\u094d\u0917\u092e\u0947\u0902 \u0939\u094b\u0928\u0947 \u0938\u0947 \u0935\u0947 \u092d\u0940 \u0905\u0928\u094d\u0927\u0915\u093e\u0930\u092e\u0947\u0902 \u0939\u0940 \u0939\u0948\u0902\u0964 \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0935\u093e\u0932\u0947 \u090a\u0901\u091a\u0947-\u090a\u0901\u091a\u0947 \u0932\u094b\u0915\u094b\u0902\u092e\u0947\u0902 \u091c\u093e\u0928\u0947\u092a\u0930 \u092d\u0940 \u091c\u0928\u094d\u092e-\u092e\u0930\u0923\u0915\u0947 \u091a\u0915\u094d\u0915\u0930\u092e\u0947\u0902 \u092a\u0921\u093c\u0947 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902\u0964 \u0915\u0939\u0940\u0902 \u091c\u0928\u094d\u092e \u0917\u092f\u0947 \u0924\u094b \u092e\u0930\u0928\u093e \u092c\u093e\u0915\u0940 \u0930\u0939\u0924\u093e \u0939\u0948 \u0914\u0930 \u092e\u0930 \u0917\u092f\u0947 \u0924\u094b \u091c\u0928\u094d\u092e\u0928\u093e \u092c\u093e\u0915\u0940 \u0930\u0939\u0924\u093e \u0939\u0948,\u0910\u0938\u0947 \u091c\u0928\u094d\u092e-\u092e\u0930\u0923\u0915\u0947 \u091a\u0915\u094d\u0915\u0930\u092e\u0947\u0902 \u092a\u0921\u093c\u0947 \u0939\u0941\u090f \u0935\u0947 \u0915\u094b\u0932\u094d\u0939\u0942\u0915\u0947 \u092c\u0948\u0932\u0915\u0940 \u0924\u0930\u0939 \u0905\u0928\u0928\u094d\u0924\u0915\u093e\u0932\u0924\u0915 \u0918\u0942\u092e\u0924\u0947 \u0939\u0940 \u0930\u0939\u0924\u0947 \u0939\u0948\u0902\u0964, \u0907\u0938 \u0924\u0930\u0939 \u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923 \u0926\u094b\u0928\u094b\u0902 \u092e\u093e\u0930\u094d\u0917\u094b\u0902\u0915\u0947 \u092a\u0930\u093f\u0923\u093e\u092e\u0915\u094b \u091c\u093e\u0928\u0928\u0947\u0935\u093e\u0932\u093e \u092e\u0928\u0941\u0937\u094d\u092f \u092f\u094b\u0917\u0940 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u0928\u093f\u0937\u094d\u0915\u093e\u092e \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948, \u092d\u094b\u0917\u0940 \u0928\u0939\u0940\u0902\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0935\u0939 \u092f\u0939\u093e\u0901\u0915\u0947 \u0914\u0930 \u092a\u0930\u0932\u094b\u0915\u0915\u0947 \u092d\u094b\u0917\u094b\u0902\u0938\u0947 \u090a\u0901\u091a\u093e \u0909\u0920 \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u0939 \u092e\u094b\u0939\u093f\u0924 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964\u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u092d\u094b\u0917\u094b\u0902\u0915\u0947 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947\u092e\u0947\u0902 \u0914\u0930 \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0928 \u0939\u094b\u0928\u0947\u092e\u0947\u0902 \u091c\u093f\u0938\u0915\u093e \u0909\u0926\u094d\u0926\u0947\u0936\u094d\u092f \u0928\u093f\u0930\u094d\u0935\u093f\u0915\u093e\u0930 \u0930\u0939\u0928\u0947\u0915\u093e \u0939\u0940 \u0939\u094b\u0924\u093e \u0939\u0948, \u0935\u0939 \u092f\u094b\u0917\u0940 \u0915\u0939\u0932\u093e\u0924\u093e \u0939\u0948\u0964"},{text:"\u0935\u0947\u0926\u0947\u0937\u0941 \u092f\u091c\u094d\u091e\u0947\u0937\u0941 \u0924\u092a\u0903\u0938\u0941 \u091a\u0948\u0935\n\u0926\u093e\u0928\u0947\u0937\u0941 \u092f\u0924\u094d\u092a\u0941\u0923\u094d\u092f\u092b\u0932\u0902 \u092a\u094d\u0930\u0926\u093f\u0937\u094d\u091f\u092e\u094d\u0964\n\u0905\u0924\u094d\u092f\u0947\u0924\u093f \u0924\u0924\u094d\u0938\u0930\u094d\u0935\u092e\u093f\u0926\u0902 \u0935\u093f\u0926\u093f\u0924\u094d\u0935\u093e\n\u092f\u094b\u0917\u0940 \u092a\u0930\u0902 \u0938\u094d\u0925\u093e\u0928\u092e\u0941\u092a\u0948\u0924\u093f \u091a\u093e\u0926\u094d\u092f\u092e\u094d\u0964\u09648.28\u0964\u0964",translation:"\u0964\u09648.28\u0964\u0964 \u092f\u094b\u0917\u0940 \u0907\u0938\u0915\u094b (\u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0915\u0947 \u0930\u0939\u0938\u094d\u092f\u0915\u094b) \u091c\u093e\u0928\u0915\u0930 \u0935\u0947\u0926\u094b\u0902\u092e\u0947\u0902, \u092f\u091c\u094d\u091e\u094b\u0902\u092e\u0947\u0902, \u0924\u092a\u094b\u0902\u092e\u0947\u0902 \u0924\u0925\u093e \u0926\u093e\u0928\u092e\u0947\u0902 \u091c\u094b-\u091c\u094b \u092a\u0941\u0923\u094d\u092f\u092b\u0932 \u0915\u0939\u0947 \u0917\u092f\u0947 \u0939\u0948\u0902, \u0909\u0928 \u0938\u092d\u0940 \u092a\u0941\u0923\u094d\u092f\u092b\u0932\u094b\u0902\u0915\u093e \u0905\u0924\u093f\u0915\u094d\u0930\u092e\u0923 \u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948 \u0914\u0930 \u0906\u0926\u093f\u0938\u094d\u0925\u093e\u0928 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964",commentary:"\u0964\u09648.28\u0964\u0964\xa0\u0935\u094d\u092f\u093e\u0916\u094d\u092f\u093e,'\u0935\u0947\u0926\u0947\u0937\u0941 \u092f\u091c\u094d\u091e\u0947\u0937\u0941 \u0924\u092a\u0903\u0938\u0941 \u09f7\u09f7. \u0938\u094d\u0925\u093e\u0928\u092e\u0941\u092a\u0948\u0924\u093f \u091a\u093e\u0926\u094d\u092f\u092e\u094d',\u092f\u091c\u094d\u091e, \u0926\u093e\u0928, \u0924\u092a, \u0924\u0940\u0930\u094d\u0925, \u0935\u094d\u0930\u0924 \u0906\u0926\u093f \u091c\u093f\u0924\u0928\u0947 \u092d\u0940 \u0936\u093e\u0938\u094d\u0924\u094d\u0930\u0940\u092f \u0909\u0924\u094d\u0924\u092e-\u0938\u0947-\u0909\u0924\u094d\u0924\u092e \u0915\u093e\u0930\u094d\u092f \u0939\u0948\u0902 \u0914\u0930 \u0909\u0928\u0915\u093e \u091c\u094b \u092b\u0932 \u0939\u0948, \u0935\u0939 \u0935\u093f\u0928\u093e\u0936\u0940 \u0939\u0940 \u0939\u094b\u0924\u093e \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u091c\u092c \u0909\u0924\u094d\u0924\u092e-\u0938\u0947-\u0909\u0924\u094d\u0924\u092e \u0915\u093e\u0930\u094d\u092f\u0915\u093e \u092d\u0940 \u0906\u0930\u092e\u094d\u092d \u0914\u0930 \u0938\u092e\u093e\u092a\u094d\u0924\u093f \u0939\u094b\u0924\u0940 \u0939\u0948, \u0924\u094b \u092b\u093f\u0930 \u0909\u0938 \u0915\u093e\u0930\u094d\u092f\u0938\u0947 \u0909\u0924\u094d\u092a\u0928\u094d\u0928 \u0939\u094b\u0928\u0947\u0935\u093e\u0932\u093e \u092b\u0932 \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u0915\u0948\u0938\u0947 \u0939\u094b \u0938\u0915\u0924\u093e \u0939\u0948? \u0935\u0939 \u092b\u0932 \u091a\u093e\u0939\u0947 \u0907\u0938 \u0932\u094b\u0915\u0915\u093e \u0939\u094b, \u091a\u093e\u0939\u0947 \u0938\u094d\u0935\u0930\u094d\u0917\u093e\u0926\u093f \u092d\u094b\u0917-\u092d\u0942\u092e\u093f\u092f\u094b\u0902\u0915\u093e \u0939\u094b, \u0909\u0938\u0915\u0940 \u0928\u0936\u094d\u0935\u0930\u0924\u093e\u092e\u0947\u0902 \u0915\u093f\u091e\u094d\u091a\u093f\u0928\u094d\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u092b\u0930\u0915 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u091c\u0940\u0935 \u0938\u094d\u0935\u092f\u0902 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0905\u0935\u093f\u0928\u093e\u0936\u0940 \u0905\u0902\u0936 \u0939\u094b\u0915\u0930 \u092d\u0940 \u0935\u093f\u0928\u093e\u0936\u0940 \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u092e\u0947\u0902 \u092b\u0901\u0938\u093e \u0930\u0939\u0947, \u0924\u094b \u0907\u0938\u092e\u0947\u0902 \u0909\u0938\u0915\u0940 \u0905\u091c\u094d\u091e\u0924\u093e \u0939\u0940 \u092e\u0941\u0916\u094d\u092f \u0939\u0948\u0964 \u0905\u0924\u0903 \u091c\u094b \u092e\u0928\u0941\u0937\u094d\u092f \u0924\u0947\u0908\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915 \u0938\u0947 \u0932\u0947\u0915\u0930 \u091b\u092c\u094d\u092c\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u0924\u0915 \u0935\u0930\u094d\u0923\u093f\u0924 \u0936\u0941\u0915\u094d\u0932 \u0914\u0930 \u0915\u0943\u0937\u094d\u0923\u092e\u093e\u0930\u094d\u0917\u0915\u0947 \u0930\u0939\u0938\u094d\u092f\u0915\u094b \u0938\u092e\u091d \u0932\u0947\u0924\u093e \u0939\u0948, \u0935\u0939 \u092f\u091c\u094d\u091e, \u0924\u092a, \u0926\u093e\u0928 \u0906\u0926\u093f \u0938\u092d\u0940 \u092a\u0941\u0923\u094d\u092f\u092b\u0932\u094b\u0902\u0915\u093e \u0905\u0924\u093f\u0915\u094d\u0930\u092e\u0923 \u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0935\u0939 \u092f\u0939 \u0938\u092e\u091d \u0932\u0947\u0924\u093e \u0939\u0948 \u0915\u093f \u092d\u094b\u0917-\u092d\u0942\u092e\u093f\u092f\u094b\u0902\u0915\u0940 \u092d\u0940 \u0906\u0916\u093f\u0930\u0940 \u0939\u0926 \u091c\u094b \u092c\u094d\u0930\u0939\u094d\u092e\u0932\u094b\u0915 \u0939\u0948, \u0935\u0939\u093e\u0901 \u091c\u093e\u0928\u0947\u092a\u0930 \u092d\u0940 \u0932\u094c\u091f\u0915\u0930 \u092a\u0940\u091b\u0947 \u0906\u0928\u093e \u092a\u0921\u093c\u0924\u093e \u0939\u0948; \u092a\u0930\u0928\u094d\u0924\u0941 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b\u0928\u0947 \u092a\u0930 \u0932\u094c\u091f\u0915\u0930 \u0928\u0939\u0940\u0902 \u0906\u0928\u093e \u092a\u0921\u093c\u0924\u093e (8\u0964 16); \u0914\u0930 \u0938\u093e\u0925-\u0938\u093e\u0925 \u092f\u0939 \u092d\u0940 \u0938\u092e\u091d \u0932\u0947\u0924\u093e \u0939\u0948 \u0915\u093f \u092e\u0948\u0902 \u0924\u094b \u0938\u093e\u0915\u094d\u0937\u093e\u0924\u094d \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u093e \u0905\u0902\u0936 \u0939\u0942\u0901 \u0924\u0925\u093e \u092f\u0947 \u092a\u094d\u0930\u093e\u0915\u0943\u0924 \u092a\u0926\u093e\u0930\u094d\u0925 \u0928\u093f\u0924\u094d\u092f-\u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0905\u092d\u093e\u0935\u092e\u0947\u0902, \u0928\u093e\u0936\u092e\u0947\u0902 \u091c\u093e \u0930\u0939\u0947 \u0939\u0948\u0902, \u0924\u094b \u092b\u093f\u0930 \u0935\u0939 \u0928\u093e\u0936\u0935\u093e\u0928\u094d \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u092e\u0947\u0902, \u092d\u094b\u0917\u094b\u0902\u092e\u0947\u0902 \u0928 \u092b\u0901\u0938\u0915\u0930 \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0947 \u0939\u0940 \u0906\u0936\u094d\u0930\u093f\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u0935\u0939 \u0906\u0926\u093f\u0938\u094d\u0925\u093e\u0928  \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u093e\u0915\u094b \u092a\u094d\u0930\u093e\u092a\u094d\u0924 \u0939\u094b \u091c\u093e\u0924\u093e \u0939\u0948, \u091c\u093f\u0938\u0915\u094b \u0907\u0938\u0940 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0907\u0915\u094d\u0915\u0940\u0938\u0935\u0947\u0902 \u0936\u094d\u0932\u094b\u0915\u092e\u0947\u0902 '\u092a\u0930\u092e\u0917\u0924\u093f' \u0914\u0930 '\u092a\u0930\u092e\u0927\u093e\u092e' \u0928\u093e\u092e\u0938\u0947 \u0915\u0939\u093e \u0917\u092f\u093e \u0939\u0948\u0964\u0928\u093e\u0936\u0935\u093e\u0928\u094d \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0915\u0947 \u0938\u0902\u0917\u094d\u0930\u0939 \u0914\u0930 \u092d\u094b\u0917\u094b\u0902\u092e\u0947\u0902 \u0906\u0938\u0915\u094d\u0924 \u0939\u0941\u0906 \u092e\u0928\u0941\u0937\u094d\u092f \u0909\u0938 \u0906\u0926\u093f\u0938\u094d\u0925\u093e\u0928 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935\u0915\u094b \u0928\u0939\u0940\u0902 \u091c\u093e\u0928 \u0938\u0915\u0924\u093e\u0964 \u0928 \u091c\u093e\u0928\u0928\u0947\u0915\u0940 \u092f\u0939 \u0905\u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f \u0928 \u0924\u094b \u092d\u0917\u0935\u093e\u0928\u094d\u0915\u0940 \u0926\u0940 \u0939\u0941\u0908 \u0939\u0948, \u0928 \u092a\u094d\u0930\u0915\u0943\u0924\u093f\u0938\u0947 \u092a\u0948\u0926\u093e \u0939\u0941\u0908 \u0939\u0948 \u0914\u0930 \u0928 \u0915\u093f\u0938\u0940 \u0915\u0930\u094d\u092e\u0915\u093e \u092b\u0932 \u0939\u0940 \u0939\u0948 \u0905\u0930\u094d\u0925\u093e\u0924\u094d \u092f\u0939 \u0905\u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f \u0915\u093f\u0938\u0940\u0915\u0940 \u0926\u0947\u0928 \u0928\u0939\u0940\u0902 \u0939\u0948; \u0915\u093f\u0928\u094d\u0924\u0941 \u0938\u094d\u0935\u092f\u0902 \u091c\u0940\u0935\u0928\u0947 \u0939\u0940 \u092a\u0930\u092e\u093e\u0924\u094d\u092e\u0924\u0924\u094d\u0924\u094d\u0935\u0938\u0947 \u0935\u093f\u092e\u0941\u0916 \u0939\u094b\u0915\u0930 \u0907\u0938\u0915\u094b \u092a\u0948\u0926\u093e \u0915\u093f\u092f\u093e \u0939\u0948\u0964 \u0907\u0938\u0932\u093f\u092f\u0947 \u092f\u0939 \u0938\u094d\u0935\u092f\u0902 \u0939\u0940 \u0907\u0938\u0915\u094b \u092e\u093f\u091f\u093e \u0938\u0915\u0924\u093e \u0939\u0948\u0964 \u0915\u093e\u0930\u0923 \u0915\u093f \u0905\u092a\u0928\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0915\u0940 \u0939\u0941\u0908 \u092d\u0942\u0932\u0915\u094b \u0938\u094d\u0935\u092f\u0902 \u0939\u0940 \u092e\u093f\u091f\u093e \u0938\u0915\u0924\u093e \u0939\u0948 \u0914\u0930 \u0907\u0938\u0915\u094b \u092e\u093f\u091f\u093e\u0928\u0947\u0915\u093e \u0926\u093e\u092f\u093f\u0924\u094d\u0935 \u092d\u0940 \u0938\u094d\u0935\u092f\u0902\u092a\u0930 \u0939\u0940 \u0939\u0948\u0964 \u0907\u0938 \u092d\u0942\u0932\u0915\u094b \u092e\u093f\u091f\u093e\u0928\u0947\u092e\u0947\u0902 \u092f\u0939 \u091c\u0940\u0935 \u0905\u0938\u092e\u0930\u094d\u0925 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0928\u093f\u0930\u094d\u092c\u0932 \u0928\u0939\u0940\u0902 \u0939\u0948, \u0905\u092a\u093e\u0924\u094d\u0930 \u0928\u0939\u0940\u0902 \u0939\u0948\u0964 \u0915\u0947\u0935\u0932 \u0938\u0902\u092f\u094b\u0917\u091c\u0928\u094d\u092f \u0938\u0941\u0916\u0915\u0940 \u0932\u094b\u0932\u0941\u092a\u0924\u093e\u0915\u0947 \u0915\u093e\u0930\u0923 \u092f\u0939 \u0905\u092a\u0928\u0947\u092e\u0947\u0902 \u0905\u0938\u093e\u092e\u0930\u094d\u0925\u094d\u092f\u0915\u093e \u0906\u0930\u094b\u092a \u0915\u0930 \u0932\u0947\u0924\u093e \u0939\u0948 \u0914\u0930 \u0907\u0938\u0940\u0938\u0947 \u092e\u0928\u0941\u0937\u094d\u092f\u091c\u0928\u094d\u092e\u0915\u0947 \u092e\u0939\u093e\u0928\u094d \u0932\u093e\u092d\u0938\u0947 \u0935\u091e\u094d\u091a\u093f\u0924 \u0930\u0939 \u091c\u093e\u0924\u093e \u0939\u0948\u0964 \u0905\u0924\u0903 \u092e\u0928\u0941\u0937\u094d\u092f\u0915\u094b \u0938\u0902\u092f\u094b\u0917\u091c\u0928\u094d\u092f \u0938\u0941\u0916\u0915\u0940 \u0932\u094b\u0932\u0941\u092a\u0924\u093e\u0915\u093e \u0924\u094d\u092f\u093e\u0917 \u0915\u0930\u0915\u0947 \u092e\u0928\u0941\u0937\u094d\u092f\u091c\u0928\u094d\u092e\u0915\u094b \u0938\u093e\u0930\u094d\u0925\u0915 \u092c\u0928\u093e\u0928\u0947\u0915\u0947 \u0932\u093f\u092f\u0947 \u0928\u093f\u0924\u094d\u092f-\u0928\u093f\u0930\u0928\u094d\u0924\u0930 \u0909\u0926\u094d\u092f\u0924 \u0930\u0939\u0928\u093e \u091a\u093e\u0939\u093f\u092f\u0947\u0964\u091b\u0920\u0947 \u0905\u0927\u094d\u092f\u093e\u092f\u0915\u0947 \u0905\u0928\u094d\u0924\u092e\u0947\u0902 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092a\u0939\u0932\u0947 \u092f\u094b\u0917\u0940\u0915\u0940 \u092e\u0939\u093f\u092e\u093e \u0915\u0939\u0940 \u0914\u0930 \u092a\u0940\u091b\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u092f\u094b\u0917\u0940 \u0939\u094b \u091c\u093e\u0928\u0947\u0915\u0940 \u0906\u091c\u094d\u091e\u093e \u0926\u0940 (6\u0964 46); \u0914\u0930 \u092f\u0939\u093e\u0901 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u092a\u0939\u0932\u0947 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u094b \u092f\u094b\u0917\u0940 \u0939\u094b\u0928\u0947\u0915\u0940 \u0906\u091c\u094d\u091e\u093e \u0926\u0940 \u0914\u0930 \u092a\u0940\u091b\u0947 \u092f\u094b\u0917\u0940\u0915\u0940 \u092e\u0939\u093f\u092e\u093e \u0915\u0939\u0940\u0964 \u0907\u0938\u0915\u093e \u0924\u093e\u0924\u094d\u092a\u0930\u094d\u092f \u0939\u0948 \u0915\u093f \u091b\u0920\u0947 \u0905\u0927\u094d\u092f\u093e\u092f\u092e\u0947\u0902 \u092f\u094b\u0917\u092d\u094d\u0930\u0937\u094d\u091f\u0915\u093e \u092a\u094d\u0930\u0938\u0919\u094d\u0917 \u0939\u0948, \u0914\u0930 \u0909\u0938\u0915\u0947 \u0935\u093f\u0937\u092f \u092e\u0947\u0902 \u0905\u0930\u094d\u091c\u0941\u0928 \u0915\u0947 \u092e\u0928 \u092e\u0947\u0902 \u0938\u0928\u094d\u0926\u0947\u0939 \u0925\u093e \u0915\u093f \u0935\u0939 \u0915\u0939\u0940\u0902 \u0928\u0937\u094d\u091f-\u092d\u094d\u0930\u0937\u094d\u091f \u0924\u094b \u0928\u0939\u0940\u0902 \u0939\u094b \u091c\u093e\u0924\u093e? \u0907\u0938 \u0936\u0919\u094d\u0915\u093e\u0915\u094b \u0926\u0942\u0930 \u0915\u0930\u0928\u0947 \u0915\u0947 \u0932\u093f\u092f\u0947 \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0915\u0939\u093e \u0915\u093f '\u0915\u094b\u0908 \u0915\u093f\u0938\u0940 \u0924\u0930\u0939 \u0938\u0947 \u092f\u094b\u0917\u092e\u0947\u0902 \u0932\u0917 \u091c\u093e\u092f \u0924\u094b \u0909\u0938\u0915\u093e \u092a\u0924\u0928 \u0928\u0939\u0940\u0902 \u0939\u094b\u0924\u093e\u0964 \u0907\u0924\u0928\u093e \u0939\u0940 \u0928\u0939\u0940\u0902, \u0907\u0938 \u092f\u094b\u0917\u0915\u093e \u091c\u093f\u091c\u094d\u091e\u093e\u0938\u0941\u092e\u093e\u0924\u094d\u0930 \u092d\u0940 \u0936\u092c\u094d\u0926\u092c\u094d\u0930\u0939\u094d\u092e\u0915\u093e \u0905\u0924\u093f\u0915\u094d\u0930\u092e\u0923 \u0915\u0930 \u091c\u093e\u0924\u093e \u0939\u0948\u0964' \u0907\u0938\u0932\u093f\u092f\u0947 \u092f\u094b\u0917\u0940\u0915\u0940 \u092e\u0939\u093f\u092e\u093e \u092a\u0939\u0932\u0947 \u0915\u0939\u0940 \u0914\u0930 \u092a\u0940\u091b\u0947 \u0905\u0930\u094d\u091c\u0941\u0928 \u0915\u0947 \u0932\u093f\u092f\u0947 \u092f\u094b\u0917\u0940 \u0939\u094b\u0928\u0947\u0915\u0940 \u0906\u091c\u094d\u091e\u093e \u0926\u0940\u0964 \u092a\u0930\u0928\u094d\u0924\u0941 \u092f\u0939\u093e\u0901 \u0905\u0930\u094d\u091c\u0941\u0928\u0915\u093e \u092a\u094d\u0930\u0936\u094d\u0928 \u0930\u0939\u093e \u0915\u093f \u0928\u093f\u092f\u0924\u093e\u0924\u094d\u092e\u093e \u092a\u0941\u0930\u0941\u0937\u094b\u0902\u0915\u0947 \u0926\u094d\u0935\u093e\u0930\u093e \u0906\u092a \u0915\u0948\u0938\u0947 \u091c\u093e\u0928\u0928\u0947\u092e\u0947\u0902 \u0906\u0924\u0947 \u0939\u0948\u0902? \u0907\u0938 \u092a\u094d\u0930\u0936\u094d\u0928\u0915\u093e \u0909\u0924\u094d\u0924\u0930 \u0926\u0947\u0924\u0947 \u0939\u0941\u090f \u092d\u0917\u0935\u093e\u0928\u094d\u0928\u0947 \u0915\u0939\u093e \u0915\u093f '\u091c\u094b \u0938\u093e\u0902\u0938\u093e\u0930\u093f\u0915 \u092a\u0926\u093e\u0930\u094d\u0925\u094b\u0902\u0938\u0947 \u0938\u0930\u094d\u0935\u0925\u093e \u0935\u093f\u092e\u0941\u0916 \u0939\u094b\u0915\u0930 \u0915\u0947\u0935\u0932 \u092e\u0947\u0930\u0947 \u092a\u0930\u093e\u092f\u0923 \u0939\u094b\u0924\u093e \u0939\u0948, \u0909\u0938 \u092f\u094b\u0917\u0940\u0915\u0947 \u0932\u093f\u092f\u0947 \u092e\u0948\u0902 \u0938\u0941\u0932\u092d \u0939\u0942\u0901', \u0907\u0938\u0932\u093f\u092f\u0947 \u092a\u0939\u0932\u0947 '\u0924\u0942 \u092f\u094b\u0917\u0940 \u0939\u094b \u091c\u093e' \u0910\u0938\u0940 \u0906\u091c\u094d\u091e\u093e \u0926\u0940 \u0914\u0930 \u092a\u0940\u091b\u0947 \u092f\u094b\u0917\u0940\u0915\u0940 \u092e\u0939\u093f\u092e\u093e \u0915\u0939\u0940\u0964"}]}}]);
